--usp_checkIDInUse 19,'Class'
CREATE Procedure [dbo].[usp_checkIDInUse]
(
	@Id int,
	@Type varchar(100)
)
As
Begin
	if (@Type = 'STUCategory')
	Begin
		if Exists (Select 'X' From StudentMaster  Where STU_CAT_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Class')
	Begin
		if Exists (Select 'X' From StudentMaster  Where STU_CM_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  StudentFeeDetails Where STUDFEE_CM_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  TeacherSubjectDetails Where TSUBD_CM_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  TeacherSectionDetails Where TSEC_CM_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  ClassSubjectDetail Where CLSUBD_CM_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  ClassSectionDetail Where CL_SEC_CM_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  FeeClassDetails  Where FCD_CM_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Section')
	Begin
		if Exists (Select 'X' From StudentMaster  Where STU_SEC_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  ClassSectionDetail Where CL_SEC_SM_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  TeacherSectionDetails Where TSEC_SEC_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Subject')
	Begin
		if Exists (Select 'X' From  ClassSubjectDetail Where CLSUBD_SUB_ID  = @Id)
		Select 'true'
		else if exists (Select 'X' From  TeacherSubjectDetails Where TSUBD_SUB_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  TeacherSectionDetails Where TSEC_SUB_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Qualification')
	Begin
		if Exists (Select 'X' From  ParentMaster Where PM_QUAL_ID  = @Id)
		Select 'true'
		else if exists (Select 'X' From  TeacherQualificationDetails Where TQUALD_QUAL_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  DriverMaster Where DRIVER_QUAL_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	
	else if (@Type = 'FeesCategory')
	Begin
		if Exists (Select 'X' From  FeeClassDetails Where FCD_FEE_CAT_ID  = @Id)
		Select 'true'
		else if exists (Select 'X' From  StudentFeeDetails Where STUD_FEE_CAT_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	
	else if (@Type = 'FeesClassCategory')
	Begin
		Declare
		@CM_ID int,
		@FEE_CAT_ID int
		Select  @CM_ID = FCD_CM_ID,@FEE_CAT_ID= FCD_FEE_CAT_ID    From FeeClassDetails Where FCD_ID  = @Id
		 if exists (Select 'X' From  StudentFeeDetails Where STUD_FEE_CAT_ID = @FEE_CAT_ID And STUDFEE_CM_ID = @CM_ID)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Teacher')
	Begin
		if exists (Select 'X' From  TeacherSubjectDetails Where TSUBD_TEACHER_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  TeacherSectionDetails Where TSEC_TEACHER_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'ExpenseCategory')
	Begin
		if exists (Select 'X' From  BillDetails Where BILL_DETAIL_EXP_CAT_ID  = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Vendor')
	Begin
		if exists (Select 'X' From  BillMaster  Where BILL_VENDOR_ID  = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Location')
	Begin
		if exists (Select 'X' From  RouteStopDetails  Where ROUTE_STOP_LOCATION_ID  = @Id)
		Select 'true'
		else if exists (Select 'X' From  RouteMaster  Where ROUTE_END_LOCATION_ID = @Id or ROUTE_START_LOCATION_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'RouteStop')
	Begin
		if exists (Select 'X' From  StudentMaster  Where STU_ROUTE_STOP_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'RouteDetail')
	Begin
		if exists (Select 'X' From  RouteStopDetails   Where ROUTE_STOP_ROUTE_DETAIL_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Route')
	Begin
		if exists (Select 'X' From  StudentMaster   Where STU_ROUTE_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  RouteDetails    Where ROUTE_DETAIL_ROUTE_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  RouteStopDetails     Where ROUTE_STOP_ROUTE_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Driver')
	Begin
		if exists (Select 'X' From  RouteDetails   Where ROUTE_DETAIL_DRIVER_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Vehicle')
	Begin
		if exists (Select 'X' From  RouteDetails   Where ROUTE_DETAIL_VEHICLE_ID = @Id)
		Select 'true'
		else if exists (Select 'X' From  VehicleExpenseDetails   Where VEHEXP_VEHICEL_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Cleaner')
	Begin
		if exists (Select 'X' From  RouteDetails   Where ROUTE_DETAIL_CLEANER_ID = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'Role')
	Begin
		if exists (Select 'X' From  UserDetails    Where USER_ROLE_ID  = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'DiscountCategory')
	Begin
		if Exists (Select 'X' From StudentMaster  Where isnull(STU_FDCM_ID,0) = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'ItemType')
	Begin
		if Exists (Select 'X' From ItemMaster  Where isnull(ITEM_TYPE_MASTER_ID ,0) = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'ItemLocation')
	Begin
		if Exists (Select 'X' From InventoryMaster  Where isnull(INV_ITEM_LOCATION_ID ,0) = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'ItemMaster')
	Begin
		if Exists (Select 'X' From InventoryMaster  Where isnull(INV_ITEM_ID ,0) = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'AttendanceReason')
	Begin
		if Exists (Select 'X' From StudentAttendanceDetails   Where isnull(STU_ATTEND_REASON_ID ,0) = @Id)
		Select 'true'
		else
		Select 'false'
	End
	else if (@Type = 'HolidayType')
	Begin
		if Exists (Select 'X' From HolidayMaster   Where isnull(HOLIDAY_TYPE_ID ,0) = @Id)
		Select 'true'
		else
		Select 'false'
	End

End


