--usp_CheckScholasticSubCategoryInUse 122

CREATE procedure [dbo].[usp_CheckScholasticSubCategoryInUse]

@ScholastcCategoryID int

As

Begin



Create table #TempIds

(

Id int,
CatSession varchar(50)

)



;WITH CatTB(SCHOLASTIC_ID,SCHOLASTIC_SESSION)

AS

( 

SELECT SCHOLASTIC_ID ,SCHOLASTIC_SESSION 

FROM ScholasticMaster 



WHERE SCHOLASTIC_ID = @ScholastcCategoryID

UNION ALL

SELECT C.SCHOLASTIC_ID,C.SCHOLASTIC_SESSION

FROM ScholasticMaster AS C

JOIN CatTB AS CT

ON C.SCHOLASTIC_PARENT_ID  = CT.SCHOLASTIC_ID

)

Insert Into #TempIds

(

Id,CatSession)

SELECT SCHOLASTIC_ID,SCHOLASTIC_SESSION FROM CatTB



Declare 

@IsExists varchar(10)

Set @IsExists ='False'


if Exists (Select 'X' From StudentGradeDetails S

		   Where   Ltrim(Rtrim(Str(S.STUGRADE_SCHOLASTIC_CAT_ID)))+STUGRADE_SESSION  in (Select Ltrim(Rtrim(Str(ID)))+CatSession from #TempIds))

Begin

	Set @IsExists ='True'

End

else if Exists (Select 'X' From StudentGradeDetailsHistory S
				
				Where  Ltrim(Rtrim(Str(S.STUGRADEH_SCHOLASTIC_CAT_ID)))+S.STUGRADEH_SESSION  in (Select Ltrim(Rtrim(Str(ID)))+CatSession from #TempIds))

Begin

	Set @IsExists ='True'

End



else if Exists (Select 'X' From StudentReportCardDetailsHistory S
				Join StudentReportCardMasterHistory 
				On REPCARDH_DETAIL_REPCARD_ID = REPCARDH_REPCARD_ID 
				Where  (Ltrim(Rtrim(Str(S.REPCARDH_DETAIL_SUBJECT_ID)))+REPCARDH_SESSION  in (Select Ltrim(Rtrim(Str(ID)))+CatSession from #TempIds))

				And S.REPCARDH_DETAIL_SUBJECT_TYPE = 'Scholastic' )

Begin

	Set @IsExists ='True'

End





Drop table #TempIds



Select @IsExists

End





GO
