	[STU_DOJ] ,
	[STU_REGSTRATION_NUMBER] ,
	[STU_CM_ID] ,
	[STU_SEC_ID] ,
	[STU_CMP_ID] ,
	[STU_SCH_ID] ,
	[STU_WITHDRAWN_DATE] ,
	[STU_WITHDRAWN_REASON] ,
	StudentMaster.[IS_ACTIVE] ,
	[STU_SESSION] ,
	[CM_NAME] ,
	[SM_NAME] ,
	CM_NAME+'-'+SM_NAME
From StudentMaster 
Join ClassMaster 
on CM_ID = STU_CM_ID
Join ClassSectionDetail
On CL_SEC_CM_ID = STU_CM_ID
And CL_SEC_ID = STU_SEC_ID
Join SectionMaster
On CL_SEC_SM_ID = SM_ID
Where isnull(StudentMaster.IS_ACTIVE,0) = 1
And isnull(STU_SESSION,'') = @Session
And STU_CMP_ID = @CompanyID
And STU_SCH_ID = @SchoolId


-------------------------------------Allocating New Classes-------------------------
Update #TempStudentMaster
Set [STU_NEW_CLASS_NAME] = Case When STU_CLASS_NAME = 'PG' then
								'MI'
							When  STU_CLASS_NAME = 'MI' then
								'MII'
							When  STU_CLASS_NAME = 'MII' then
								'MIII'
							When  STU_CLASS_NAME = 'MIII' then
								'I'
							When  STU_CLASS_NAME = 'I' then
								'II'
							When  STU_CLASS_NAME = 'II' then
								'III'
							When  STU_CLASS_NAME = 'III' then
								'IV'
							When  STU_CLASS_NAME = 'IV' then
								'V'
							When  STU_CLASS_NAME = 'V' then
								'VI'
							When  STU_CLASS_NAME = 'VI' then
								'VII'
							When  STU_CLASS_NAME = 'VII' then
								'VIII'
							When  STU_CLASS_NAME = 'VIII' then
								'IX'
							When  STU_CLASS_NAME = 'IX' then
								'X'
							End,
	[STU_NEW_SECTION_NAME] = STU_SECTION_NAME
Where STU_CLASS_NAME <> 'X'

------------------------Update New Class Name in temporary table-----------------------
Update #TempStudentMaster
Set STU_NEW_CLASS_SECTION_NAME = [STU_NEW_CLASS_NAME]+'-'+STU_NEW_SECTION_NAME
Where STU_CLASS_NAME <> 'X'

------------------------Update New Session in temporary table-----------------------
Update #TempStudentMaster
Set [STU_NEW_SESSION] = @NewSession
Where STU_CLASS_NAME <> 'X'

Update #TempStudentMaster 
Set STU_CM_ID_NEW = CL_SEC_CM_ID ,
STU_SEC_ID_NEW = CL_SEC_ID 
From #TempClassSectionDetail 
Where Class_Name = STU_NEW_CLASS_NAME 
And Section_Name = STU_NEW_SECTION_NAME 

------------------------------------------Checking Missing Class Section Details, if exists insert record into ClassSectionDetail--------------
if exists (Select 'X' From #TempStudentMaster 
		   Where STU_CM_ID_NEW is null
		   and STU_SEC_ID_NEW is null
		   and STU_NEW_CLASS_NAME is not null
		   and STU_NEW_SECTION_NAME is not null
		   and STU_NEW_CLASS_SECTION_NAME is not null
		   and STU_CLASS_NAME <> 'X'
		   )
Begin

		Insert Into #TempMissingClassSectionDetail
		(
			[CL_CMP_ID],
			[CL_SCH_ID],
			Class_Name,
			Section_Name,
			ClassSectionName 
		)
		Select Distinct STU_CMP_ID,
				STU_SCH_ID,
				STU_NEW_CLASS_NAME,
				STU_NEW_SECTION_NAME,
				STU_NEW_CLASS_SECTION_NAME   
		From #TempStudentMaster 
		Where STU_CM_ID_NEW is null
		and STU_SEC_ID_NEW is null
		and STU_NEW_CLASS_NAME is not null
		and STU_NEW_SECTION_NAME is not null
		and STU_NEW_CLASS_SECTION_NAME is not null
		and STU_CLASS_NAME <> 'X'

		-------------------Updating ClassID from ClassMaster------
		Update #TempMissingClassSectionDetail
		Set #TempMissingClassSectionDetail.CM_ID = CM.CM_ID From ClassMaster  CM
		Where CM.CM_NAME = Class_Name
		And CM.CM_CMP_ID = @CompanyId 
		And CM.CM_SCH_ID = @SchoolId 

		-------------------Updating SectionID from SectionMaster------
		Update #TempMissingClassSectionDetail
		Set #TempMissingClassSectionDetail.SM_ID = SM.SM_ID From SectionMaster  SM
		Where SM.SM_NAME = Section_Name
		And SM.SM_CMP_ID = @CompanyId 
		And SM.SM_SCH_ID = @SchoolId 

	--------------------------------INserting Missing Class Sections Records into table ClassSectionDetail--------------------
			INSERT INTO ClassSectionDetail
				   (
						[CL_SEC_CM_ID]
					   ,[CL_SEC_SM_ID]
					   ,[CL_SEC_LOCATION_ID]
					   ,[CL_CMP_ID]
					   ,[CL_SCH_ID]
					   ,[CREATED_BY]
					   ,[CREATED_DATE]
					   ,[MODIFIED_BY]
					   ,[MODIFIED_DATE]
				   )
					Select CM_ID,
					SM_ID,
					null,
					@CompanyId,
					@SchoolId,
					'Administrator',
					getdate(),
					'Administrator',
					getdate()
					From #TempMissingClassSectionDetail

	----------------------------------Inserting Missing Records into Temporary table----------------------
			Insert Into #TempClassSectionDetail
				(
				[CL_SEC_ID] ,
				[CL_SEC_CM_ID] ,
				[CL_SEC_SM_ID] ,
				[CL_SEC_LOCATION_ID],
				[CL_CMP_ID] ,
				[CL_SCH_ID] ,
				Class_Name ,
				Section_Name ,
				ClassSectionName 
				)
			Select  [CL_SEC_ID] ,
				[CL_SEC_CM_ID] ,
				[CL_SEC_SM_ID] ,
				[CL_SEC_LOCATION_ID],
				[CL_CMP_ID] ,
				[CL_SCH_ID] ,
				CM_NAME,
				SM_NAME,
				CM_NAME+'-'+SM_NAME
			From ClassSectionDetail
			Join ClassMaster
			On CL_SEC_CM_ID = CM_ID
			Join SectionMaster 
			On CL_SEC_SM_ID = SM_ID
			Where CL_CMP_ID = @CompanyId 
			And CL_SCH_ID = @SchoolId 
			And CM_CMP_ID = @CompanyId 
			And CM_SCH_ID = @SchoolId 
			And SM_CMP_ID = @CompanyId 
			And SM_SCH_ID = @SchoolId 
			And CL_SEC_ID not in (Select CL_SEC_ID From #TempClassSectionDetail)
	
	------------------------Updating New ClassId and Section ino temporary table-----------------
			Update #TempStudentMaster 
			Set STU_CM_ID_NEW = CL_SEC_CM_ID,
			STU_SEC_ID_NEW = CL_SEC_ID 
			From #TempClassSectionDetail 
			Where Class_Name = STU_NEW_CLASS_NAME 
			And Section_Name = STU_NEW_SECTION_NAME
			And  STU_CM_ID_NEW is null
			and STU_SEC_ID_NEW is null

End



