		  ,[STUCOMMENT_Q2_DESC]
		  ,[STUCOMMENT_Q3_DESC]
		  ,[STUCOMMENT_SA1_DESC]
		  ,[STUCOMMENT_SA2_DESC]
		  ,[STUCOMMENT_FINAL_DESC]
		  ,[IS_ACTIVE]
		  ,[STUCOMMENT_CMP_ID]
		  ,[STUCOMMENT_SCH_ID]
		  ,[CREATED_BY]
		  ,[CREATED_DATE]
		  ,[MODIFIED_BY]
		  ,[MODIFIED_DATE]
	  FROM StudentCommentDetails
	 Where STUCOMMENT_CM_ID = @ClassId 
	 And STUCOMMENT_SESSION = @Session
	 And STUCOMMENT_SEC_ID = @SectionID 
	And  STUCOMMENT_ID Not in (
							Select STUCOMMENTH_ID
							From StudentCommentDetailsHistory
							Where STUCOMMENTH_CM_ID = @ClassId 
							And STUCOMMENTH_SEC_ID = @SectionID 
							And STUCOMMENTH_SESSION = @Session
						  )

	-------------Updating the existsing records -------------------
	   Update StudentCommentDetailsHistory
			Set 
				[STUCOMMENTH_Q1_DESC] = [STUCOMMENT_Q1_DESC]
			   ,[STUCOMMENTH_Q2_DESC]= [STUCOMMENT_Q2_DESC]
			   ,[STUCOMMENTH_Q3_DESC] = [STUCOMMENT_Q3_DESC]
			  
			   ,[STUCOMMENTH_SA1_DESC] = [STUCOMMENT_SA1_DESC] 
			   ,[STUCOMMENTH_SA2_DESC] = [STUCOMMENT_SA2_DESC]
			   ,[STUCOMMENTH_FINAL_DESC] = [STUCOMMENT_FINAL_DESC]
			   ,[MODIFIED_BY] = 'Administrator'
			   ,[MODIFIED_DATE] = GETDATE()
			 FROM StudentCommentDetails
			Where STUCOMMENT_CM_ID = @ClassId 
			And STUCOMMENT_SESSION = @Session 
			And STUCOMMENTH_CM_ID = @ClassId 
			And STUCOMMENTH_SEC_ID = @SectionID 
			And STUCOMMENTH_SESSION = @Session 
			And STUCOMMENTH_CM_ID  = STUCOMMENT_CM_ID 
	
			
	
	------------------------Deleting Records-------------------
	
	---------------------Deleting Records from Report card Details------
		Delete from StudentReportCardDetails 
		Where REPCARD_DETAIL_REPCARD_ID in (
		
											Select REPCARD_ID From StudentReportCardMaster 
												   Where REPCARD_CM_ID = @ClassId
												   And REPCARD_SEC_ID = @SectionID 
												   And REPCARD_TYPE = @ExamType 
												   And REPCARD_TYPE_VALUE = @ReportCardExamUnit
		
											)
	---------------------Deleting Records from Report card Master------
		Delete From StudentReportCardMaster 
												   Where REPCARD_CM_ID = @ClassId
												   And REPCARD_TYPE = @ExamType 
												   And REPCARD_SEC_ID = @SectionID 
												   And REPCARD_TYPE_VALUE = @ReportCardExamUnit
	
	
	Select 'True'
	End
	Else
	Select 'False'



End



