 Set @dtFirstDate =ltrim(str(@Month))+'/'+'1/'++ltrim(str(@Year))  
  
--Calculate last date of processing month    
    
Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtFirstDate)+1,0))
Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

----Creating Tempporary table to store the EmpSalary Details-------
CREATE TABLE #TempEmpSalaryMaster
	(
		ESALM_ID int NULL,
		ESALM_EMP_ID int NOT NULL,
		ESALM_MONTH int NOT NULL,
		ESALM_YEAR int NOT NULL,
		ESALM_SESSION varchar(50) NOT NULL,
		ESALM_BATCHPRINT_DATE datetime NOT NULL,
		ESALM_BASIC_SALARY decimal(18, 2) NULL,
		ESALM_ALLOWANCES decimal(18, 2) NULL,
		ESALM_DEDUCTIONS decimal(18, 2) NULL,
		ESALM_NET_SALARY decimal(18, 2) NULL,
		ESALM_TOTAL_DAYS int NOT NULL,
		ESALM_PRESENT_DAYS decimal(18, 1) NULL,
		ESALM_ABSENT_DAYS decimal(18, 1) NULL,
		ESALM_LEAVE_DAYS decimal(18, 1) NULL,
		ESALM_LEAVE_DESC varchar(150) NULL,
		ESALM_LEAVE_BALANCE_DESC varchar(150) NULL,
		ESALM_DEPT_ID int NULL,
		ESALM_DESIG_ID int NULL,
		ESALM_GRADE_ID int NULL,
		ESALM_CMP_ID int,
		ESALM_SCH_ID int,
		ESALM_PER_DAY_SALARY decimal(18,2)
	)



	-------------------------INserting REcord into EmpSalaryMaster table---------------------
	INSERT INTO #TempEmpSalaryMaster
           (
             [ESALM_ID]
			,[ESALM_EMP_ID]
           ,[ESALM_MONTH]
           ,[ESALM_YEAR]
           ,[ESALM_SESSION]
           ,[ESALM_BATCHPRINT_DATE]
           ,[ESALM_BASIC_SALARY]
           ,[ESALM_ALLOWANCES]
           ,[ESALM_DEDUCTIONS]
           ,[ESALM_NET_SALARY]
           ,[ESALM_TOTAL_DAYS]
           ,[ESALM_PRESENT_DAYS]
           ,[ESALM_ABSENT_DAYS]
           ,[ESALM_LEAVE_DAYS]
           ,[ESALM_LEAVE_DESC]
           ,[ESALM_LEAVE_BALANCE_DESC]
           ,[ESALM_PER_DAY_SALARY]
           ,[ESALM_DEPT_ID]
           ,[ESALM_DESIG_ID]
           ,[ESALM_GRADE_ID]
           ,[ESALM_CMP_ID]
           ,[ESALM_SCH_ID]
          
         )
	Select 
			[ESALM_ID]
			,[ESALM_EMP_ID]
           ,[ESALM_MONTH]
           ,[ESALM_YEAR]
           ,[ESALM_SESSION]
           ,[ESALM_BATCHPRINT_DATE]
           ,[ESALM_BASIC_SALARY]
           ,[ESALM_ALLOWANCES]
           ,[ESALM_DEDUCTIONS]
           ,[ESALM_NET_SALARY]
           ,[ESALM_TOTAL_DAYS]
           ,[ESALM_PRESENT_DAYS]
           ,[ESALM_ABSENT_DAYS]
           ,[ESALM_LEAVE_DAYS]
           ,[ESALM_LEAVE_DESC]
           ,[ESALM_LEAVE_BALANCE_DESC]
           ,[ESALM_PER_DAY_SALARY]
           ,[ESALM_DEPT_ID]
           ,[ESALM_DESIG_ID]
           ,[ESALM_GRADE_ID]
           ,[ESALM_CMP_ID]
           ,[ESALM_SCH_ID]
        
      From EmpSalaryMaster E
     Where  E.ESALM_DEPT_ID  = @EmpDeptID  
		   And E.ESALM_MONTH  = @Month  
		   And E.ESALM_YEAR  = @Year  
		   And E.ESALM_SESSION = @Session  
		   And E.ESALM_CMP_ID = @CompanyID 
		   And E.ESALM_SCH_ID  = @SchoolID 

	
-----------------Updating Basic Salary in Emp Main table----------------
	Update #TempEmpSalaryMaster 
	Set ESALM_BASIC_SALARY = isnull(ESD.ESALD_AMOUNT,0)
	From EmpSalaryDetails  ESD
	Where ESD.ESALD_ESALM_ID = #TempEmpSalaryMaster.ESALM_ID
	And ESD.ESALD_SALHM_ID = 1

			
	
	-----------------Calculating  Allowences-----------------
	
	Update #TempEmpSalaryMaster 
	Set ESALM_ALLOWANCES = (
								Select Sum (isnull(ESD.ESALD_AMOUNT,0))
								From EmpSalaryDetails ESD
								Where ESD.ESALD_ESALM_ID = #TempEmpSalaryMaster.ESALM_ID
								And isnull(ESD.ESALD_SALHM_ID,0) <> 1
								And ESD.ESALD_IS_DEDUCTION = 0  	
							)
	
	
		-----------------Calculating  Deductions-----------------
	
	Update #TempEmpSalaryMaster 
	Set ESALM_DEDUCTIONS = (
								Select Sum (isnull(ESD.ESALD_AMOUNT,0))
								From EmpSalaryDetails ESD
								Where ESD.ESALD_ESALM_ID = #TempEmpSalaryMaster.ESALM_ID
								And isnull(ESD.ESALD_SALHM_ID,0) <> 1
								And ESD.ESALD_IS_DEDUCTION = 1  	
							)
	
	
		-----------------Calculating  Net Salary-----------------
	
	Update #TempEmpSalaryMaster 
	Set ESALM_NET_SALARY  = (isnull(ESALM_BASIC_SALARY,0)+ isnull(ESALM_ALLOWANCES,0))
							 - 
							(isnull(ESALM_DEDUCTIONS,0))
	

		
		

	Select  EMP_FIRST_NAME,
			EMP_LAST_NAME,
			DEPT_NAME,
			[ESALM_ID]
			,[ESALM_EMP_ID]
           ,[ESALM_MONTH]
           ,[ESALM_YEAR]
           ,[ESALM_SESSION]
           ,[ESALM_BATCHPRINT_DATE]
           ,[ESALM_BASIC_SALARY]
           ,[ESALM_ALLOWANCES]
           ,[ESALM_DEDUCTIONS]
           ,[ESALM_NET_SALARY]
           ,[ESALM_TOTAL_DAYS]
           ,[ESALM_PRESENT_DAYS]
           ,[ESALM_ABSENT_DAYS]
           ,[ESALM_LEAVE_DAYS]
           ,[ESALM_LEAVE_DESC]
           ,[ESALM_LEAVE_BALANCE_DESC]
           ,[ESALM_PER_DAY_SALARY]
           ,[ESALM_DEPT_ID]
           ,[ESALM_DESIG_ID]
           ,[ESALM_GRADE_ID]
           ,[ESALM_CMP_ID]
           ,[ESALM_SCH_ID] 
         From #TempEmpSalaryMaster
         Join EmpMaster 
         on EMP_ID = ESALM_EMP_ID
         Join DeptMaster 
         On DEPT_ID = EMP_DEPT_ID 
         And Case When @DisplayRecord = -1 then
			1
		else
			EMP_IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End
         
	Drop table #TempEmpSalaryMaster

End




