--usp_DisplayReportCard 7,'2013-2014','Quarter1','Display'
CREATE procedure [dbo].[usp_DisplayReportCard]
@ClassId int, 
@SectionId int,
@Session varchar(50),
@ReportCardExamUnit varchar(50),
@Mode varchar(50),
@CompanyID int,
@SchoolID int
As
Begin

Declare
@ExamType varchar(50)

---------------------Selecting Exam Assesment Type, It can be Semester or Quarterly-----
Select @ExamType = CM_EXAM_ASSESMENT  From ClassMaster Where CM_ID = @ClassId


if @Mode = 'Display'
Begin
Select SRCM.REPCARD_ID,
SRCM.REPCARD_CM_ID,
SRCM.REPCARD_STU_GUID,
SRCM.REPCARD_SEC_ID,
SRCM.REPCARD_TYPE_VALUE,
CM_NAME as RepCardClassName,
SM_NAME  AS RepCardSectionName,
STU_FIRST_NAME  as FirstName,
STU_LAST_NAME as LstName,
STU_ROLL_NUMBER as RollNumber,
SRCM.REPCARD_TYPE 

From StudentReportCardMaster SRCM
Join StudentMaster 
On SRCM.REPCARD_STU_GUID = STU_GUID 
And SRCM.REPCARD_CM_ID = STU_CM_ID 
And SRCM.REPCARD_SEC_ID = STU_SEC_ID 

Join ClassMaster 
On SRCM.REPCARD_CM_ID = CM_ID
Join ClassSectionDetail  CSD 
On SRCM.REPCARD_SEC_ID  = CL_SEC_ID 
JOin SectionMaster 
On CSD.CL_SEC_SM_ID  = SM_ID 

Where SRCM.REPCARD_CM_ID = @ClassId
And SRCM.REPCARD_SEC_ID = @SectionId 
And SRCM.REPCARD_TYPE = @ExamType
And SRCM.REPCARD_SESSION = @Session 
And srcm.REPCARD_TYPE_VALUE = @ReportCardExamUnit 
And SRCM.REPCARD_CMP_ID = @CompanyID 
And SRCM.REPCARD_SCH_ID  = @SchoolID  
Order By STU_ROLL_NUMBER 

End

End



