-- usp_GenClassSectionTimeTableData 1,1,3,1,1

CREATE procedure [dbo].[usp_GenClassSectionTimeTableData]
@SessionID int,
@ClassID int,
@SecId int,
@CompanyID int,
@SchoolID int
As
Begin

Declare  
@TotalPeriod int  ,
@SessionYear varchar(50) 

Select  @TotalPeriod = TTSETUP_TOTAL_PERIODS
, @SessionYear = isnull(TTSETUP_SESSION,'')
From TimeTableSetupDetails 
Where TTSETUP_TTSESSION_ID = @SessionID
And TTSETUP_CMP_ID = @CompanyID 
And TTSETUP_SCH_ID = @SchoolID  

Declare 
@Counter int
Create Table #TempTimeTableData
(
	Period_ID int,
	Period_Description varchar(50),
	Period_TimeSlot varchar(50),
	TeacherID_Day1 int,
	SubjectID_Day1 int,
	TeacherID_Day2 int,
	SubjectID_Day2 int,
	TeacherID_Day3 int,
	SubjectID_Day3 int,
	TeacherID_Day4 int,
	SubjectID_Day4 int,
	TeacherID_Day5 int,
	SubjectID_Day5 int,
	TeacherID_Day6 int,
	SubjectID_Day6 int
)

Insert into #TempTimeTableData
(
	Period_ID,
	Period_Description,
	Period_TimeSlot
)
Select TTPERIOD_ID,
	   TTPERIOD_DESCTIPTION,
	   Replace(Replace(convert(varchar,TTPERIOD_START_TIME,0),'AM', ' AM'),'PM', ' PM')
	  + ' - '
	  +
	   Replace(Replace(convert(varchar,TTPERIOD_END_TIME,0),'AM', ' AM'),'PM', ' PM')
    From TimeTablePeriodMaster 
	Where TTPERIOD_TTSESSION_ID =@SessionID 
	And TTPERIOD_CMP_ID = @CompanyID 
		And TTPERIOD_SCH_ID = @SchoolID   
	And TTPERIOD_NUMBER<=@TotalPeriod  
	 And TTPERIOD_SESSION = @SessionYear  

	
	if Exists (Select 'X' From TimeTableDetails TTD
				Where TTD.TTDETAIL_CMP_ID = @CompanyID 
				and TTD.TTDETAIL_SCH_ID = @SchoolID 
				and TTD.TTDETAIL_CM_ID = @ClassID 
				and TTD.TTDETAIL_SEC_ID = @SecId 
				And TTD.TTDETAIL_SESSION_ID = @SessionID 
				And TTD.TTDETAIL_SESSION = @SessionYear  
				)
				
	Begin
			Delete From TimeTableDetails 
			Where TTDETAIL_CMP_ID = @CompanyID 
			and TTDETAIL_SCH_ID = @SchoolID 
			and TTDETAIL_CM_ID = @ClassID 
			and TTDETAIL_SEC_ID = @SecId 
			And TTDETAIL_SESSION_ID = @SessionID 
			And TTDETAIL_SESSION = @SessionYear  

	End
	
---------------------Updating Teacher ID and Subject ID in Temp Table------
	
	Set @Counter = 1
	Declare 
	@Query varchar(5000)
	While @Counter <=6
	Begin
		Set @Query = '
		Update #TempTimeTableData   
		Set SubjectID_Day'+LTRIM(Str(@Counter)) +'= TTD.TTCLPD_SUB_ID   
		From TimeTableClassPeriodDetails TTD  
		Where TTD.TTCLPD_PERIOD_ID = #TempTimeTableData.Period_ID  
		And  TTD.TTCLPD_CM_ID ='+LTRIM(str(@ClassID))+'   
		And TTD.TTCLPD_SEC_ID = '+Ltrim(Str(@SecId))+'   
		And TTD.TTCLPD_DAY_OF_WEEK ='+LTRIM(Str(@Counter))+'  
		And TTD.TTCLPD_SESSION_ID = '+LTRIM(Str(@SessionID))+'  
		And TTD.TTCLPD_CMP_ID  = '+LTRIM(Str(@CompanyID))+'  
		And TTD.TTCLPD_SCH_ID  = '+LTRIM(Str(@SchoolID))+'
		And TTD.TTCLPD_SESSION  = '''+@SessionYear+''''+'
		And TTCLPD_SUB_ID  is not null '
		
		Execute (@Query)
		
		
		Set @Query ='Update #TempTimeTableData 
		Set TeacherID_Day'+LTRIM(Str(@Counter))+'=  TTD.TSEC_TEACHER_ID
		From TeacherSectionDetails TTD
		Where TTD.TSEC_CM_ID ='+LTRIM(str(@ClassID))+' 
		And TTD.TSEC_SEC_ID = '+Ltrim(Str(@SecId))+' 
		And TTD.TSEC_SUB_ID = SubjectID_Day'+LTRIM(Str(@Counter))+'
		And TTD.TSEC_CMP_ID  = '+LTRIM(Str(@CompanyID))+'
		And TTD.TSEC_SCH_ID  = '+LTRIM(Str(@SchoolID))+'
		And SubjectID_Day'+LTRIM(Str(@Counter))+' is not null'
	
		Execute (@Query)
				
		Set @Counter = @Counter+1 
	End
	
	
	------------------------Updating Teachers Id in Teamporary table-------
	
			
	Select * From #TempTimeTableData
	
	Drop Table #TempTimeTableData
End


  





GO
