CREATE Procedure [dbo].[usp_GenerateEmployeeLeavesData]
@CompanyID int,
@SchoolID int,
@Session varchar(50)
As
Begin

Create table #TempEmpLeaveDetails
(
	EMPLD_ID int NULL,
	EMPLD_EMP_ID int NOT NULL,
	EMPLD_CAT_ID int NOT NULL,
	EMPLD_LEAVE_TYPE_ID int NOT NULL,
	EMPLD_TOTAL_LEAVES decimal(18,1) NULL,
	EMPLD_SESSION varchar(50) NULL,
	EMPLD_CMP_ID int,
	EMPLD_SCH_ID int,
	EMPLD_APPLICABLE_GENDER varchar(50)
)


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

insert into #TempEmpLeaveDetails
(
	EMPLD_EMP_ID,
	EMPLD_CAT_ID,
	EMPLD_LEAVE_TYPE_ID,
	EMPLD_SESSION,
	EMPLD_CMP_ID,
	EMPLD_SCH_ID,
	EMPLD_APPLICABLE_GENDER
)
Select E.EMP_ID,
E.EMP_CAT_ID, 
L.LEAVE_TYPE_ID,
@Session,
@CompanyID,
@SchoolID,
L.LEAVE_TYPE_APPLICABLE_GENDER     
From EmpMaster E, LeaveTypeMaster L 
Where E.EMP_CMP_ID   =@CompanyID 
And E.EMP_SCH_ID = @SchoolID
and L.LEAVE_TYPE_CMP_ID = @CompanyID 
And L.LEAVE_TYPE_SCH_ID = @SchoolID 
And E.EMP_ID not in(Select EMPLD_EMP_ID From EMPLeaveDetails)
And Case When @DisplayRecord = -1 then
			1
		else
			L.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End
And Case When @DisplayRecord = -1 then
			1
		else
			L.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End

Update #TempEmpLeaveDetails
Set #TempEmpLeaveDetails.EMPLD_TOTAL_LEAVES = ED.ECAT_LEAVE_TOTAL_LEAVES
From EmpCatLeaveDetails ED
Where ED.ECAT_LEAVE_CAT_ID = #TempEmpLeaveDetails.EMPLD_CAT_ID
And ED.ECAT_LEAVE_TYPE_ID = #TempEmpLeaveDetails.EMPLD_LEAVE_TYPE_ID
And ED.ECAT_LEAVE_SESSION = #TempEmpLeaveDetails.EMPLD_SESSION 
And ED.ECAT_LEAVE_CMP_ID = #TempEmpLeaveDetails.EMPLD_CMP_ID 
And ED.ECAT_LEAVE_SCH_ID = #TempEmpLeaveDetails.EMPLD_SCH_ID

Update #TempEmpLeaveDetails
Set EMPLD_ID = ISNULL(EMPLD_ID,0)

Select * from #TempEmpLeaveDetails

Drop Table #TempEmpLeaveDetails

End
