CREATE Procedure [dbo].[usp_GenerateEmpSalaryData]
@Month int,
@Year int,
@EmpDeptID int,
@CompanyID int,
@SchoolID int,
@Session varchar(50),
@BatchPrintDate datetime
As
Begin

Declare  
  @dtLastDate datetime,  
  @dtFirstDate datetime  

---Calculate the first date of processing month    
 Set @dtFirstDate =ltrim(str(@Month))+'/'+'1/'++ltrim(str(@Year))  
  
--Calculate last date of processing month    
    
Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtFirstDate)+1,0))
Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0


Create Table #TempEmpMaster
(
   EMP_ID int,
   EMP_DEPT_ID int,
   EMP_DESIG_ID int,
   EMp_GRADE_ID int
)
----Creating Tempporary table to store the EmpSalary Details-------
CREATE TABLE #TempEmpSalaryMaster
	(
		ESALM_ID int NULL,
		ESALM_EMP_ID int NOT NULL,
		ESALM_MONTH int NOT NULL,
		ESALM_YEAR int NOT NULL,
		ESALM_SESSION varchar(50) NOT NULL,
		ESALM_BATCHPRINT_DATE datetime NOT NULL,
		ESALM_BASIC_SALARY decimal(18, 2) NULL,
		ESALM_ALLOWANCES decimal(18, 2) NULL,
		ESALM_DEDUCTIONS decimal(18, 2) NULL,
		ESALM_NET_SALARY decimal(18, 2) NULL,
		ESALM_TOTAL_DAYS int NOT NULL,
		ESALM_PRESENT_DAYS decimal(18, 1) NULL,
		ESALM_ABSENT_DAYS decimal(18, 1) NULL,
		ESALM_LEAVE_DAYS decimal(18, 1) NULL,
		ESALM_LEAVE_DESC varchar(150) NULL,
		ESALM_LEAVE_BALANCE_DESC varchar(150) NULL,
		ESALM_DEPT_ID int NULL,
		ESALM_DESIG_ID int NULL,
		ESALM_GRADE_ID int NULL,
		ESALM_CMP_ID int,
		ESALM_SCH_ID int,
		ESALM_PER_DAY_SALARY decimal(18,2)
	)

----Creating Tempporary table to store the Emp Salary LineItem Details-------
CREATE TABLE #TempEmpSalaryDetails
(
	ESALD_EMP_ID int,
	ESALD_ESALM_ID int  NULL,
	ESALD_SALHM_ID int NULL,
	ESALD_DESGRADE_ID int NULL,
	ESALD_VALUE decimal(18, 2) NULL,
	ESALD_SALARY_TYPE varchar(10) NULL,
	ESALD_IS_DEDUCTION bit NOT NULL,
	ESALD_SAL_CODE varchar(10) NULL,
	ESALD_SAL_DESCRIPTION varchar(100) NULL,
	ESALD_AMOUNT decimal(18, 2) NULL,
	ESALD_IS_SALARY_HEAD varchar(10) NULL,
	ESALD_CMP_ID int NOT NULL,
	ESALD_SCH_ID int NOT NULL,
)

----------------------Deleting and Regenerating the Employee Salary Slips Data---------
if Exists (Select 'X' From EmpSalaryMaster E  
		   Where E.ESALM_DEPT_ID  = @EmpDeptID  
		   And E.ESALM_MONTH  = @Month  
		   And E.ESALM_YEAR  = @Year  
		   And E.ESALM_SESSION = @Session  
		   And E.ESALM_CMP_ID = @CompanyID 
		   And E.ESALM_SCH_ID  = @SchoolID 
		   )
	Begin
	
	---------------------Deleting Records from EmpSalary Detrails------
		Delete from EmpSalaryDetails  
		Where ESALD_ESALM_ID in (
		
											Select ESALM_ID From EmpSalaryMaster E  
											   Where E.ESALM_DEPT_ID  = @EmpDeptID  
											   And E.ESALM_MONTH  = @Month  
											   And E.ESALM_YEAR  = @Year  
											   And E.ESALM_SESSION = @Session  
											   And E.ESALM_CMP_ID = @CompanyID 
											   And E.ESALM_SCH_ID  = @SchoolID  
		
											)
	---------------------Deleting Records from Emp Salary Master------
	Delete From EmpSalaryMaster 
	  Where ESALM_DEPT_ID  = @EmpDeptID  
	   And ESALM_MONTH  = @Month  
	   And ESALM_YEAR  = @Year  
	   And ESALM_SESSION = @Session  
	   And ESALM_CMP_ID = @CompanyID 
	   And ESALM_SCH_ID  = @SchoolID  

	
	End 






--------------inserting the reocrd of employees, whose salary is to be generate-------
	Insert into #TempEmpMaster
	(
	   EMP_ID ,
	   EMP_DEPT_ID ,
	   EMP_DESIG_ID ,
	   EMp_GRADE_ID 
    )
    Select E.EMP_ID,
		E.EMP_DEPT_ID,
		E.EMP_DESIG_ID,
		E.EMP_GRADE_ID   	
		From EmpMaster E
		Where E.EMP_CMP_ID = @CompanyID 
		And E.EMP_SCH_ID = @SchoolID 
		And E.EMP_DEPT_ID = @EmpDeptID 
		And Case When @DisplayRecord = -1 then
			1
		else
			E.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End
    
   -------------------Inserting Employee Detail Records ------------------------
   -------------------into Temporary table #TempEmpSalaryMaster-----------------
	Insert into  #TempEmpSalaryMaster
	(
		ESALM_EMP_ID ,
		ESALM_MONTH ,
		ESALM_YEAR ,
		ESALM_SESSION ,
		ESALM_BATCHPRINT_DATE ,
		ESALM_TOTAL_DAYS ,
		ESALM_DEPT_ID ,
		ESALM_DESIG_ID ,
		ESALM_GRADE_ID ,
		ESALM_CMP_ID ,
		ESALM_SCH_ID 
	)
	Select EMP_ID,
		   @Month,
		   @Year,
		   @Session,
		   @BatchPrintDate,
		   DAY(@dtLastDate),
	   EMP_DEPT_ID ,
	   EMP_DESIG_ID ,
	   EMp_GRADE_ID ,
	   @CompanyID,
	   @SchoolID   
	From #TempEmpMaster
    
    --------------------Calculating Attendance of Employee------------------------
    ---------------Present Days----------------
    Update #TempEmpSalaryMaster 
    Set ESALM_PRESENT_DAYS = ( Select CAST(Sum(ISNULL( Case When ED.EMP_ATTEND_STATUS = 1 then 
									1.0
									When ED.EMP_ATTEND_STATUS = 0 and ED.EMP_ATTEND_LEAVE_ID IS not null and ED.EMP_ATTEND_IS_HALF_DAY = 1 then
									0.5
									End,0)) as Decimal(18,1))
								 From
    EmpAttendanceDetails ED
    Where ED.EMP_ATTEND_EMP_ID =#TempEmpSalaryMaster.ESALM_EMP_ID 
    and ED.EMP_ATTEND_MONTH = #TempEmpSalaryMaster.ESALM_MONTH
    and ED.EMP_ATTEND_YEAR = #TempEmpSalaryMaster.ESALM_YEAR
    and ED.EMP_ATTEND_CMP_ID =  #TempEmpSalaryMaster.ESALM_CMP_ID
    and ED.EMP_ATTEND_SCH_ID =  #TempEmpSalaryMaster.ESALM_SCH_ID
    )
    
     ---------------Leaves Days----------------
    Update #TempEmpSalaryMaster 
    Set ESALM_LEAVE_DAYS = ( Select CAST( Sum(ISNULL( Case When ED.EMP_ATTEND_STATUS = 0  and ED.EMP_ATTEND_LEAVE_ID IS not null and ED.EMP_ATTEND_IS_HALF_DAY = 0 then 
									1.0
									When ED.EMP_ATTEND_STATUS = 0 and ED.EMP_ATTEND_LEAVE_ID IS not null and ED.EMP_ATTEND_IS_HALF_DAY = 1 then
									0.5
									End,0)) as Decimal(18,1))
								 From
    EmpAttendanceDetails ED
    Where ED.EMP_ATTEND_EMP_ID =#TempEmpSalaryMaster.ESALM_EMP_ID 
    and ED.EMP_ATTEND_MONTH = #TempEmpSalaryMaster.ESALM_MONTH
    and ED.EMP_ATTEND_YEAR = #TempEmpSalaryMaster.ESALM_YEAR
    and ED.EMP_ATTEND_CMP_ID =  #TempEmpSalaryMaster.ESALM_CMP_ID
    and ED.EMP_ATTEND_SCH_ID =  #TempEmpSalaryMaster.ESALM_SCH_ID
    )

 ---------------Absent Days----------------
    Update #TempEmpSalaryMaster 
    Set ESALM_ABSENT_DAYS =   ( Select Sum(1.0) From
    EmpAttendanceDetails ED
    Where ED.EMP_ATTEND_EMP_ID =#TempEmpSalaryMaster.ESALM_EMP_ID 
    and ED.EMP_ATTEND_MONTH = #TempEmpSalaryMaster.ESALM_MONTH
    and ED.EMP_ATTEND_YEAR = #TempEmpSalaryMaster.ESALM_YEAR
    and ED.EMP_ATTEND_CMP_ID =  #TempEmpSalaryMaster.ESALM_CMP_ID
    and ED.EMP_ATTEND_SCH_ID =  #TempEmpSalaryMaster.ESALM_SCH_ID
    and ED.EMP_ATTEND_STATUS = 0
    And ED.EMP_ATTEND_LEAVE_ID is null
    )



	-------------------------inserting Salary Details---------
	
	Insert Into #TempEmpSalaryDetails
	(
		ESALD_EMP_ID,
		ESALD_SALHM_ID,
		ESALD_DESGRADE_ID,
		ESALD_VALUE,
		ESALD_SALARY_TYPE ,
		ESALD_IS_DEDUCTION ,
		ESALD_SAL_CODE,
		ESALD_SAL_DESCRIPTION ,
		ESALD_IS_SALARY_HEAD ,
		ESALD_CMP_ID,
		ESALD_SCH_ID
	)
	
		Select ESALM_EMP_ID,
			ESD.ESSD_SALHM_ID,
			ESD.ESSD_DESGRADE_ID,
				isnull(ESD.ESSD_VALUE,0),
				ESD.ESSD_SALARY_TYPE,
				ESD.ESSD_IS_DEDUCTANCE,
				ESD.ESSD_SALH_CODE,
				ESD.ESDD_SALH_DESCRIPTION,
				'Y',
				@CompanyID, 
				@SchoolID 
	from #TempEmpSalaryMaster
	Join EmpSalaryStructureDetails  ESD
	On ESD.ESSD_EMP_ID = ESALM_EMP_ID
	And ESD.ESDD_CMP_ID = ESALM_CMP_ID
	And ESD.ESDD_SCH_ID = ESALM_SCH_ID 
	And Case When @DisplayRecord = -1 then
			1
		else
			ESD.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End
	
-----------------Updating Basic Salary in Emp Main table----------------
	Update #TempEmpSalaryMaster 
	Set ESALM_BASIC_SALARY = isnull(ESD.ESALD_VALUE,0)
	From #TempEmpSalaryDetails ESD
	Where ESD.ESALD_EMP_ID = #TempEmpSalaryMaster.ESALM_EMP_ID
	And ESD.ESALD_SALHM_ID = 1

---------------Calculating Fixed Salary Head Amount----------------------------
	
	Update #TempEmpSalaryDetails 
	Set ESALD_AMOUNT  = isnull(ESALD_VALUE,0)
	Where ESALD_IS_SALARY_HEAD = 'Y'
	And ESALD_SALARY_TYPE = 'F'
	
---------------Calculating Percentage Salary Head Amount----------------------------
	
	Update #TempEmpSalaryDetails 
	Set ESALD_AMOUNT  = (isnull(ESM.ESALM_BASIC_SALARY,0) *isnull(ESALD_VALUE,0))/100.0 
	From #TempEmpSalaryMaster ESM
	Where #TempEmpSalaryDetails.ESALD_EMP_ID = ESM.ESALM_EMP_ID
	AND ESALD_IS_SALARY_HEAD = 'Y'
	And ESALD_SALARY_TYPE = 'P'
	
		
	
	-----------------Calculating  Allowences-----------------
	
	Update #TempEmpSalaryMaster 
	Set ESALM_ALLOWANCES = (
								Select Sum (isnull(ESD.ESALD_AMOUNT,0))
								From #TempEmpSalaryDetails ESD
								Where ESD.ESALD_EMP_ID = #TempEmpSalaryMaster.ESALM_EMP_ID
								And ESD.ESALD_SALHM_ID <> 1
								And ESD.ESALD_IS_DEDUCTION = 0  	
							)
	-------------------------Calculating Per Day Salary Amount----------
	Update #TempEmpSalaryMaster 
	Set ESALM_PER_DAY_SALARY  = cast ((ISNULL (ESALM_BASIC_SALARY,0)
								+ ISNULL (ESALM_ALLOWANCES,0)
								)/ESALM_TOTAL_DAYS  as decimal(18,2))

---------------------inserting Absence Deduction Amount-----------								
	if Exists (Select 'X' From #TempEmpSalaryMaster 
				Where isnull(ESALM_ABSENT_DAYS,0)>0) 
	Begin
				
	Insert Into #TempEmpSalaryDetails
	(
		ESALD_EMP_ID,
		ESALD_SALHM_ID,
		ESALD_DESGRADE_ID,
		ESALD_VALUE,
		ESALD_SALARY_TYPE ,
		ESALD_IS_DEDUCTION ,
		ESALD_SAL_CODE,
		ESALD_SAL_DESCRIPTION ,
		ESALD_IS_SALARY_HEAD ,
		ESALD_CMP_ID,
		ESALD_SCH_ID,
		ESALD_AMOUNT 
	)
	
	Select  ESALM_EMP_ID,
			null,
			null,
			0,
			'F',
			1,
			'ADeduc',
			'Absent Days Deduction',
			'N',
			@CompanyID,
			@SchoolID,
			Case When  (isnull(ESALM_PER_DAY_SALARY,0) % 1) = 0 then
				       isnull(ESALM_ABSENT_DAYS,0) 
				       * 
				       ISNULL(ESALM_PER_DAY_SALARY,0)
			Else
					 ( Floor(isnull(ESALM_ABSENT_DAYS,0)) 
				       * 
				       ISNULL(ESALM_PER_DAY_SALARY,0)
				      )+
				      (
						(isnull(ESALM_ABSENT_DAYS,0) % 1)
						*
						(ISNULL(ESALM_PER_DAY_SALARY,0)/2)
						)
			End
	From #TempEmpSalaryMaster
	Where isnull(ESALM_ABSENT_DAYS,0)>0


	End	
	
	

	-----------------------Inserting Monthly Special a/c Heads-------
	
	Insert Into #TempEmpSalaryDetails
	(
		ESALD_EMP_ID,
		ESALD_SALHM_ID,
		ESALD_DESGRADE_ID,
		ESALD_VALUE,
		ESALD_SALARY_TYPE ,
		ESALD_IS_DEDUCTION ,
		ESALD_SAL_CODE,
		ESALD_SAL_DESCRIPTION ,
		ESALD_IS_SALARY_HEAD ,
		ESALD_CMP_ID,
		ESALD_SCH_ID,
		ESALD_AMOUNT 
	)
	
	Select  EMP_ID,
			null,
			null,
			0,
			'F',
			0,
			'Minc',
			'Other Incentive',
			'N',
			@CompanyID,
			@SchoolID,
			0 
	From #TempEmpMaster
	

Insert Into #TempEmpSalaryDetails
	(
		ESALD_EMP_ID,
		ESALD_SALHM_ID,
		ESALD_DESGRADE_ID,
		ESALD_VALUE,
		ESALD_SALARY_TYPE ,
		ESALD_IS_DEDUCTION ,
		ESALD_SAL_CODE,
		ESALD_SAL_DESCRIPTION ,
		ESALD_IS_SALARY_HEAD ,
		ESALD_CMP_ID,
		ESALD_SCH_ID,
		ESALD_AMOUNT 
	)
	
	Select  EMP_ID,
			null,
			null,
			0,
			'F',
			0,
			'MEarn',
			'Other Earning',
			'N',
			@CompanyID,
			@SchoolID,
			0 
	From #TempEmpMaster
	
	
	Insert Into #TempEmpSalaryDetails
	(
		ESALD_EMP_ID,
		ESALD_SALHM_ID,
		ESALD_DESGRADE_ID,
		ESALD_VALUE,
		ESALD_SALARY_TYPE ,
		ESALD_IS_DEDUCTION ,
		ESALD_SAL_CODE,
		ESALD_SAL_DESCRIPTION ,
		ESALD_IS_SALARY_HEAD ,
		ESALD_CMP_ID,
		ESALD_SCH_ID,
		ESALD_AMOUNT 
	)
	
	Select  EMP_ID,
			null,
			null,
			0,
			'F',
			1,
			'MDeduc',
			'Other Deduction',
			'N',
			@CompanyID,
			@SchoolID,
			0 
	From #TempEmpMaster
	
	
		-----------------Calculating  Deductions-----------------
	
	Update #TempEmpSalaryMaster 
	Set ESALM_DEDUCTIONS = (
								Select Sum (isnull(ESD.ESALD_AMOUNT,0))
								From #TempEmpSalaryDetails ESD
								Where ESD.ESALD_EMP_ID = #TempEmpSalaryMaster.ESALM_EMP_ID
								And ESD.ESALD_SALHM_ID <> 1
								And ESD.ESALD_IS_DEDUCTION = 1  	
							)
	
	
		-----------------Calculating  Net Salary-----------------
	
	Update #TempEmpSalaryMaster 
	Set ESALM_NET_SALARY  = (isnull(ESALM_BASIC_SALARY,0)+ isnull(ESALM_ALLOWANCES,0))
							 - 
							(isnull(ESALM_DEDUCTIONS,0))
	

	-------------------------INserting REcord into EmpSalaryMaster table---------------------
	INSERT INTO EmpSalaryMaster
           (
			[ESALM_EMP_ID]
           ,[ESALM_MONTH]
           ,[ESALM_YEAR]
           ,[ESALM_SESSION]
           ,[ESALM_BATCHPRINT_DATE]
           ,[ESALM_BASIC_SALARY]
           ,[ESALM_ALLOWANCES]
           ,[ESALM_DEDUCTIONS]
           ,[ESALM_NET_SALARY]
           ,[ESALM_TOTAL_DAYS]
           ,[ESALM_PRESENT_DAYS]
           ,[ESALM_ABSENT_DAYS]
           ,[ESALM_LEAVE_DAYS]
           ,[ESALM_LEAVE_DESC]
           ,[ESALM_LEAVE_BALANCE_DESC]
           ,[ESALM_PER_DAY_SALARY]
           ,[ESALM_DEPT_ID]
           ,[ESALM_DESIG_ID]
           ,[ESALM_GRADE_ID]
           ,[ESALM_CMP_ID]
           ,[ESALM_SCH_ID]
           ,[CREATED_BY]
           ,[CREATED_DATE]
           ,[MODIFIED_BY]
           ,[MODIFIED_DATE]
         )
	Select 
			[ESALM_EMP_ID]
           ,[ESALM_MONTH]
           ,[ESALM_YEAR]
           ,[ESALM_SESSION]
           ,[ESALM_BATCHPRINT_DATE]
           ,[ESALM_BASIC_SALARY]
           ,[ESALM_ALLOWANCES]
           ,[ESALM_DEDUCTIONS]
           ,[ESALM_NET_SALARY]
           ,[ESALM_TOTAL_DAYS]
           ,[ESALM_PRESENT_DAYS]
           ,[ESALM_ABSENT_DAYS]
           ,[ESALM_LEAVE_DAYS]
           ,[ESALM_LEAVE_DESC]
           ,[ESALM_LEAVE_BALANCE_DESC]
           ,[ESALM_PER_DAY_SALARY]
           ,[ESALM_DEPT_ID]
           ,[ESALM_DESIG_ID]
           ,[ESALM_GRADE_ID]
           ,[ESALM_CMP_ID]
           ,[ESALM_SCH_ID]
           ,'Administrator',
			GETDATE(),
			'Administrator',
			GETDATE()
      From #TempEmpSalaryMaster
		
		
		
Update #TempEmpSalaryMaster           
Set ESALM_ID = EM.ESALM_ID From EmpSalaryMaster EM
Where #TempEmpSalaryMaster.ESALM_ID is null
And #TempEmpSalaryMaster.ESALM_EMP_ID = EM.ESALM_EMP_ID
And #TempEmpSalaryMaster.ESALM_MONTH   = EM.ESALM_MONTH
And #TempEmpSalaryMaster.ESALM_YEAR  = EM.ESALM_YEAR
And #TempEmpSalaryMaster.ESALM_BATCHPRINT_DATE    = EM.ESALM_BATCHPRINT_DATE 
And #TempEmpSalaryMaster.ESALM_SESSION    = EM.ESALM_SESSION 
And #TempEmpSalaryMaster.ESALM_CMP_ID = EM.ESALM_CMP_ID
And #TempEmpSalaryMaster.ESALM_SCH_ID = EM.ESALM_SCH_ID
And EM.ESALM_CMP_ID  = @CompanyID 
And EM.ESALM_SCH_ID  = @SchoolID 

Update #TempEmpSalaryDetails 
Set ESALD_ESALM_ID =ESALM_ID 
From #TempEmpSalaryMaster
Where #TempEmpSalaryDetails.ESALD_EMP_ID = #TempEmpSalaryMaster.ESALM_EMP_ID 
		
INSERT INTO EmpSalaryDetails
           (
           
            [ESALD_ESALM_ID]
           ,[ESALD_SALHM_ID]
