           ,[ESALD_SCH_ID]
           ,[CREATED_BY]
           ,[CREATED_DATE]
           ,[MODIFIED_BY]
           ,[MODIFIED_DATE]
          )

	  Select 
       [ESALD_ESALM_ID]
      ,[ESALD_SALHM_ID]
      ,[ESALD_DESGRADE_ID]
      ,[ESALD_VALUE]
      ,[ESALD_SALARY_TYPE]
      ,[ESALD_IS_DEDUCTION]
