      ,'Administrator',
	  GETDATE(),
	  'Administrator',
	  GETDATE()
	from #TempEmpSalaryDetails
	
	--Select * From #TempEmpMaster
	--Select * from #TempEmpSalaryDetails

	Drop table #TempEmpMaster
	Drop table #TempEmpSalaryMaster
	Drop table #TempEmpSalaryDetails
	
	Select 'True'
End



