--usp_GenerateEmpSalaryStrucData 1,1,'2013-2014'
CREATE Procedure [dbo].[usp_GenerateEmpSalaryStrucData]
@CompanyID int,
@SchoolID int,
@Session varchar(50)
As
Begin

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

Create table #TempempSalaryStrucDetails
(
	ESSD_ID int  NULL,
	ESSD_EMP_ID int NOT NULL,
	ESSD_SALHM_ID int NOT NULL,
	ESSD_DESGRADE_ID int NOT NULL,
	ESSD_SESSION varchar(50) NULL,
	ESSD_VALUE decimal(18, 2) NULL,
	IS_ACTIVE bit NOT NULL,
	ESSD_SALARY_TYPE varchar(10) NOT NULL,
	ESSD_IS_DEDUCTANCE bit NOT NULL,
	ESSD_SALH_CODE varchar(10) NULL,
	ESDD_SALH_DESCRIPTION varchar(100) NULL,
	ESDD_SALH_IS_READONLY bit NULL,
	ESSD_CMP_ID int,
	ESSD_SCH_ID int
)

insert into #TempempSalaryStrucDetails
(
	ESSD_EMP_ID ,
	ESSD_SALHM_ID ,
	ESSD_DESGRADE_ID ,
	ESSD_SESSION,
	ESSD_CMP_ID,
	ESSD_SCH_ID,
	IS_ACTIVE ,
	ESSD_SALARY_TYPE ,
	ESSD_IS_DEDUCTANCE,
	ESSD_SALH_CODE,
	ESDD_SALH_DESCRIPTION,
	ESDD_SALH_IS_READONLY
)
Select E.EMP_ID,
S.SALHM_ID, 
E.EMP_GRADE_ID,
@Session,
@CompanyID,
@SchoolID,
1,
S.SALHM_TYPE,
S.SALHM_IS_DEDUCTION,
S.SALHM_CODE,
S.SALHM_DESCRIPTION,
S.SALHM_IS_READONLY   
From EmpMaster E, SalaryHeadMaster S 
Where E.EMP_CMP_ID   =@CompanyID 
And E.EMP_SCH_ID = @SchoolID
and S.SALHM_CMP_ID  = @CompanyID 
And S.SALHM_SCH_ID = @SchoolID 
And E.EMP_ID not in(Select ESSD_EMP_ID From EmpSalaryStructureDetails)
And S.SALHM_CODE Not in ('MEarn','MInc','MDEDUC')
And Case When @DisplayRecord = -1 then
			1
		else
			S.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
And Case When @DisplayRecord = -1 then
			1
		else
			E.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 

Update #TempempSalaryStrucDetails
Set #TempempSalaryStrucDetails.ESSD_VALUE= SD.SALDGD_VALUE
From SalaryDesigGradeDetails SD
Where SD.SALDGD_SALHM_ID= #TempempSalaryStrucDetails.ESSD_SALHM_ID
And SD.SALDGD_DESGRADE_ID = #TempempSalaryStrucDetails.ESSD_DESGRADE_ID
And SD.SALDGD_SESSION = #TempempSalaryStrucDetails.ESSD_SESSION 
And SD.SALDGD_CMP_ID = #TempempSalaryStrucDetails.ESSD_CMP_ID
And SD.SALDGD_SCH_ID = #TempempSalaryStrucDetails.ESSD_SCH_ID 
And Case When @DisplayRecord = -1 then
			1
		else
			SD.SALDGD_IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		
Update #TempempSalaryStrucDetails
Set ESSD_ID = ISNULL(ESSD_ID,0)

Select * from #TempempSalaryStrucDetails

Drop Table #TempempSalaryStrucDetails

End







