--usp_GenerateReportCard 12,14,'2013-2014','Final','2014-03-22','Create',2,1001

--usp_GenerateReportCard 6,6,'2013-2014','Quarter1','2013-10-08','Create'
CREATE procedure [dbo].[usp_GenerateReportCard]
@ClassId int,
@SectionId int, 
@Session varchar(50),
@ReportCardExamUnit varchar(50),
@BatchPrintDate datetime = null,
@Mode varchar(50),
@CompanyID int,
@SchoolID int
As
Begin

Declare
@ExamType varchar(50)


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

---------------------Selecting Exam Assesment Type, It can be Semester or Quarterly-----
Select @ExamType = CM_EXAM_ASSESMENT  From ClassMaster Where CM_ID = @ClassId

if @Mode = 'Create'
Begin

-------------------------Deleting and Regenerating the student Report Card Data---------
if Exists (Select 'X' From StudentReportCardMaster 
		   Where REPCARD_CM_ID = @ClassId
		   And REPCARD_SESSION = @Session 
		   And REPCARD_TYPE = @ExamType 
		   And REPCARD_SEC_ID = @SectionId 
		   And REPCARD_TYPE_VALUE = @ReportCardExamUnit
		   And REPCARD_CMP_ID = @CompanyID 
		   And REPCARD_SCH_ID = @SchoolID 
		   )
	Begin
	
	---------------------Deleting Records from Report card Details------
		Delete from StudentReportCardDetails 
		Where REPCARD_DETAIL_REPCARD_ID in (
		
											Select REPCARD_ID From StudentReportCardMaster 
												   Where REPCARD_CM_ID = @ClassId
												   And REPCARD_SEC_ID = @SectionId 
												   And REPCARD_SESSION = @Session 
												   And REPCARD_TYPE = @ExamType 
												   And REPCARD_TYPE_VALUE = @ReportCardExamUnit
												    And REPCARD_CMP_ID = @CompanyID 
													And REPCARD_SCH_ID = @SchoolID 
		
											)
	---------------------Deleting Records from Report card Master------
	Delete From StudentReportCardMaster 
												   Where REPCARD_CM_ID = @ClassId
												   And REPCARD_SESSION = @Session 
												   And REPCARD_SEC_ID = @SectionId 
												   And REPCARD_TYPE = @ExamType 
												   And REPCARD_TYPE_VALUE = @ReportCardExamUnit
												   And REPCARD_CMP_ID = @CompanyID 
													And REPCARD_SCH_ID = @SchoolID
	
	End 

-----------------------Temporary Table to Store the Student Report Card Data------
CREATE TABLE #TempStudentReportCardMaster(

	REPCARD_ID int NULL,
	REPCARD_STU_GUID [uniqueidentifier] NOT NULL,
	REPCARD_CM_ID [int] NOT NULL,
	REPCARD_SEC_ID [int] NOT NULL,
	REPCARD_SESSION [varchar](50) NULL,
	REPCARD_TYPE [varchar](50) NULL,
	REPCARD_TYPE_VALUE [varchar](50) NULL,
	REPCARD_PERIOD [datetime] NULL,
	REPCARD_CMP_ID int NULL,
	REPCARD_SCH_ID int NULL
)


---------------------Temporary to Store the Student Grade Details----------------
CREATE TABLE #TempStudentGradeDetails(
	[STUGRADE_STU_GUID] [uniqueidentifier] NOT NULL,
	[STUGRADE_SCHOLASTIC_CAT_ID] [int] NOT NULL,
	[STUGRADE_Q1_GRADE] [varchar](10) NULL,
	[STUGRADE_Q2_GRADE] [varchar](10) NULL,
	[STUGRADE_Q3_GRADE] [varchar](10) NULL,
	[STUGRADE_FA1_GRADE] [varchar](10) NULL,
	[STUGRADE_FA2_GRADE] [varchar](10) NULL,
	[STUGRADE_FA3_GRADE] [varchar](10) NULL,
	[STUGRADE_FA4_GRADE] [varchar](10) NULL,
	[STUGRADE_SA1_GRADE] [varchar](10) NULL,
	[STUGRADE_SA2_GRADE] [varchar](10) NULL,
	[STUGRADE_CM_ID] [int] NOT NULL,
	[STUGRADE_SEC_ID] [int] NOT NULL,
	[STUGRADE_SESSION] [varchar](50) NULL,
	
)

---------------------Temporary to Store the Student Marks Details----------------
CREATE TABLE #TempStudentMarksDetails
(
	[STUMARKS_STU_GUID] [uniqueidentifier] NOT NULL,
	[STUMARKS_SUB_CAT_ID] [int] NOT NULL,
	[STUMARKS_Q1_MARKS1] [decimal](18, 2) NULL,
	[STUMARKS_Q1_MARKS2] [decimal](18, 2) NULL,
	[STUMARKS_Q2_MARKS1] [decimal](18, 2) NULL,
	[STUMARKS_Q2_MARKS2] [decimal](18, 2) NULL,
	[STUMARKS_Q3_MARKS1] [decimal](18, 2) NULL,
	[STUMARKS_Q3_MARKS2] [decimal](18, 2) NULL,
	[STUMARKS_FA1] [decimal](18, 2) NULL,
	[STUMARKS_FA2] [decimal](18, 2) NULL,
	[STUMARKS_FA3] [decimal](18, 2) NULL,
	[STUMARKS_FA4] [decimal](18, 2) NULL,
	[STUMARKS_SA1] [decimal](18, 2) NULL,
	[STUMARKS_SA2] [decimal](18, 2) NULL,
	[STUMARKS_CM_ID] [int] NOT NULL,
	[STUMARKS_SEC_ID] [int] NOT NULL,
	[STUMARKS_SESSION] [varchar](50) NULL,
	[STUMARKS_EXAM_TYPE] VARCHAR (50),
	
)

--------------------Temporary table to Store the Report Card Details------------
--------------------#TempStudentReportCardDetails-------------------------------
CREATE TABLE #TempStudentReportCardDetails
(
	REPCARD_DETAIL_REPCARD_ID int,
	REPCARD_DETAIL_STU_GUID uniqueidentifier,
	REPCARD_DETAIL_SUBJECT_TYPE varchar(50),
	REPCARD_DETAIL_SUBJECT_ID int NULL,
	REPCARD_DETAIL_QUARTER_MARKS decimal(18, 2) NULL,
	REPCARD_DETAIL_FA1_MARKS decimal(18, 2) NULL,
	REPCARD_DETAIL_FA2_MARKS decimal(18, 2) NULL,
	REPCARD_DETAIL_SA_MARKS decimal(18, 2) NULL,
	REPCARD_DETAIL_GRADE varchar(10) NULL,
	REPCARD_DETAIL_FA1_GRADE [varchar](10) NULL,
	REPCARD_DETAIL_FA2_GRADE [varchar](10) NULL,
	REPCARD_DETAIL_SA_GRADE [varchar](10) NULL,
	REPCARD_DETAIL_EXAM_TYPE varchar(50) NULL,
	REPCARD_DETAIL_TOTAL_MARKS decimal(18,2) NULL,
	REPCARD_DETAIL_TOTAL_GRADE varchar(10) NULL,
	REPCARD_DETAIL_CMP_ID int NULL,
	REPCARD_DETAIL_SCH_ID int NULL,
	REPCARD_DETAIL_TOTAL_MARKS_QUARTER decimal(18, 2) NULL,
	REPCARD_DETAIL_TOTAL_MARKS_FA1 decimal(18, 2) NULL,
	REPCARD_DETAIL_TOTAL_MARKS_FA2 decimal(18, 2) NULL,
	REPCARD_DETAIL_TOTAL_MARKS_SA decimal(18, 2) NULL,
	REPCARD_DETAIL_TOTAL_MARKS_FINAL decimal(18, 2) NULL,
	
)
---------------------Inserting the Student Record using Class into temporary table
---------------------#TempStudentReportCardMaster----------------------------
Insert Into #TempStudentReportCardMaster
(
	REPCARD_STU_GUID,
	REPCARD_CM_ID,
	REPCARD_SEC_ID,
	REPCARD_SESSION,
	REPCARD_TYPE,
	REPCARD_TYPE_VALUE ,
	REPCARD_PERIOD,
	REPCARD_CMP_ID,
	REPCARD_SCH_ID
)
	Select STU_GUID,
	STU_CM_ID,
	STU_SEC_ID,
	@Session, 
	@ExamType,
	@ReportCardExamUnit,
	@BatchPrintDate,
	STU_CMP_ID,
	STU_SCH_ID   
	from StudentMaster 
	Where STU_CM_ID = @ClassId 
	And STU_SEC_ID = @SectionId 
	And STU_CMP_ID = @CompanyID 
	And STU_SCH_ID = @SchoolID 
	And Case When @DisplayRecord = -1 then
			1
		else
			STU_IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End

----------- Temporary Table Into #TempStudentGradeDetails Table---------
Insert Into #TempStudentGradeDetails
(
	STUGRADE_STU_GUID ,
	STUGRADE_SCHOLASTIC_CAT_ID ,
	STUGRADE_Q1_GRADE,
	STUGRADE_Q2_GRADE,
	STUGRADE_Q3_GRADE,
	STUGRADE_FA1_GRADE,
	STUGRADE_FA2_GRADE,
	STUGRADE_FA3_GRADE,
	STUGRADE_FA4_GRADE,
	STUGRADE_SA1_GRADE,
	STUGRADE_SA2_GRADE,
	STUGRADE_CM_ID,
	STUGRADE_SEC_ID,
	STUGRADE_SESSION
           
)
Select REPCARD_STU_GUID ,
	STUGRADE_SCHOLASTIC_CAT_ID ,
	STUGRADE_Q1_GRADE,
	STUGRADE_Q2_GRADE,
	STUGRADE_Q3_GRADE,
	STUGRADE_FA1_GRADE,
	STUGRADE_FA2_GRADE,
	STUGRADE_FA3_GRADE,
	STUGRADE_FA4_GRADE,
	STUGRADE_SA1_GRADE,
	STUGRADE_SA2_GRADE,
	REPCARD_CM_ID,
	REPCARD_SEC_ID,
	REPCARD_SESSION    
From StudentGradeDetails 
Join #TempStudentReportCardMaster 
On #TempStudentReportCardMaster.REPCARD_STU_GUID = STUGRADE_STU_GUID
And #TempStudentReportCardMaster.REPCARD_CM_ID = STUGRADE_CM_ID
And #TempStudentReportCardMaster.REPCARD_SEC_ID = STUGRADE_SEC_ID
And #TempStudentReportCardMaster.REPCARD_SESSION = STUGRADE_SESSION 
And STUGRADE_CMP_ID = @CompanyID 
And STUGRADE_SCH_ID = @SchoolID 



----------- Temporary Table Into #TempStudentMarksDetails Table---------
Insert Into #TempStudentMarksDetails
(
	STUMARKS_STU_GUID ,
	STUMARKS_SUB_CAT_ID,
	STUMARKS_Q1_MARKS1,
	STUMARKS_Q1_MARKS2,
	STUMARKS_Q2_MARKS1,
	STUMARKS_Q2_MARKS2,
	STUMARKS_Q3_MARKS1,
	STUMARKS_Q3_MARKS2,
	STUMARKS_FA1,
	STUMARKS_FA2,
	STUMARKS_FA3,
	STUMARKS_FA4,
	STUMARKS_SA1,
	STUMARKS_SA2,
	STUMARKS_CM_ID,
	STUMARKS_SEC_ID,
	STUMARKS_SESSION,
    STUMARKS_EXAM_TYPE       
)
Select STUMARKS_STU_GUID ,
	STUMARKS_SUB_CAT_ID,
	STUMARKS_Q1_MARKS1,
	STUMARKS_Q1_MARKS2,
	STUMARKS_Q2_MARKS1,
	STUMARKS_Q2_MARKS2,
	STUMARKS_Q3_MARKS1,
	STUMARKS_Q3_MARKS2,
	STUMARKS_FA1,
	STUMARKS_FA2,
	STUMARKS_FA3,
	STUMARKS_FA4,
	STUMARKS_SA1,
	STUMARKS_SA2,
	STUMARKS_CM_ID,
	STUMARKS_SEC_ID,
	STUMARKS_SESSION,
	@ExamType    
From StudentMarksDetails  
Join #TempStudentReportCardMaster 
On #TempStudentReportCardMaster.REPCARD_STU_GUID = STUMARKS_STU_GUID
And #TempStudentReportCardMaster.REPCARD_CM_ID = STUMARKS_CM_ID
And #TempStudentReportCardMaster.REPCARD_SEC_ID = STUMARKS_SEC_ID
And #TempStudentReportCardMaster.REPCARD_SESSION = STUMARKS_SESSION 
and STUMARKS_CMP_ID = @CompanyID 
And STUMARKS_SCH_ID = @SchoolID 





----------------------Logic if the Exam Assesment is Quarterly--------
if @ExamType = 'Quarterly'
Begin

-------------------Inserting Scholastic Grades Data----------------
	Insert Into #TempStudentReportCardDetails
	(
		REPCARD_DETAIL_STU_GUID,
		REPCARD_DETAIL_SUBJECT_TYPE,
		REPCARD_DETAIL_SUBJECT_ID,
		REPCARD_DETAIL_GRADE,
		REPCARD_DETAIL_EXAM_TYPE
	)
	Select STUGRADE_STU_GUID,
			'Scholastic',
			STUGRADE_SCHOLASTIC_CAT_ID,
			Case When @ReportCardExamUnit = 'Quarter1' then
			STUGRADE_Q1_GRADE
			When  @ReportCardExamUnit = 'Quarter2' then
			STUGRADE_Q2_GRADE
			When  @ReportCardExamUnit = 'Quarter3' then
			STUGRADE_Q3_GRADE
			End,
			@ExamType 
   from #TempStudentGradeDetails 
	
	
	-------------------Inserting Assesment Marks Data----------------
	Insert Into #TempStudentReportCardDetails
	(
		REPCARD_DETAIL_STU_GUID,
		REPCARD_DETAIL_SUBJECT_TYPE,
		REPCARD_DETAIL_SUBJECT_ID,
		REPCARD_DETAIL_QUARTER_MARKS,
		REPCARD_DETAIL_EXAM_TYPE,
		REPCARD_DETAIL_TOTAL_MARKS_QUARTER 
	)
	Select 
			STUMARKS_STU_GUID, 
			'Assesment',
			STUMARKS_SUB_CAT_ID,
			Case When @ReportCardExamUnit = 'Quarter1' then
					Case When isnull(STUMARKS_Q1_MARKS1,0) > = isnull(STUMARKS_Q1_MARKS2,0) then
							isnull(STUMARKS_Q1_MARKS1,0)
						else
							isnull(STUMARKS_Q1_MARKS2,0)
						end
			
			When  @ReportCardExamUnit = 'Quarter2' then
				Case When isnull(STUMARKS_Q2_MARKS1,0)>= isnull(STUMARKS_Q2_MARKS2,0) then
							isnull(STUMARKS_Q2_MARKS1,0)
						else
							isnull(STUMARKS_Q2_MARKS2,0)
						end
			When  @ReportCardExamUnit = 'Quarter3' then
				Case When isnull(STUMARKS_Q3_MARKS1,0)>= isnull(STUMARKS_Q3_MARKS2,0) then
							isnull(STUMARKS_Q3_MARKS1,0)
						else
							isnull(STUMARKS_Q3_MARKS2,0)
						end
			End,
			@ExamType,
			Case When @ReportCardExamUnit = 'Quarter1' then
					Case When isnull(STUMARKS_Q1_MARKS1,0) > = isnull(STUMARKS_Q1_MARKS2,0) then
							isnull(STUMARKS_Q1_MARKS1,0)
						else
							isnull(STUMARKS_Q1_MARKS2,0)
						end
			
			When  @ReportCardExamUnit = 'Quarter2' then
				Case When isnull(STUMARKS_Q2_MARKS1,0)>= isnull(STUMARKS_Q2_MARKS2,0) then
							isnull(STUMARKS_Q2_MARKS1,0)
						else
							isnull(STUMARKS_Q2_MARKS2,0)
						end
			When  @ReportCardExamUnit = 'Quarter3' then
				Case When isnull(STUMARKS_Q3_MARKS1,0)>= isnull(STUMARKS_Q3_MARKS2,0) then
							isnull(STUMARKS_Q3_MARKS1,0)
						else
							isnull(STUMARKS_Q3_MARKS2,0)
						end
			End 
   from #TempStudentMarksDetails  
   
   ---------------------Updating Quarterly marks Grade-----------------------
	Update #TempStudentReportCardDetails
	Set REPCARD_DETAIL_GRADE =MARKS_GRADE_CODE
	From MarksGradeMaster 
	Where REPCARD_DETAIL_EXAM_TYPE ='Quarterly'
	And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
	And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
	And  round(isnull(REPCARD_DETAIL_QUARTER_MARKS,0),0) >= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
	And  round(isnull(REPCARD_DETAIL_QUARTER_MARKS,0),0) <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE 
	And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID 
	
End 

----------------------Logic if the Exam Assesment is Semester--------
if @ExamType = 'Semester'
Begin

	if (@ReportCardExamUnit='Semester1')
	Begin
		Delete from #TempStudentMarksDetails
		Where (isnull(STUMARKS_FA1,0)=-1 and isnull(STUMARKS_FA2,0)=-1 and isnull(STUMARKS_SA1,0)=-1)

	End
	else if (@ReportCardExamUnit='Semester2')
	Begin
		Delete from #TempStudentMarksDetails
		Where (isnull(STUMARKS_FA3,0)=-1 and isnull(STUMARKS_FA4,0)=-1 and isnull(STUMARKS_SA2,0)=-1)

	End


	--if (@ReportCardExamUnit='Semester1')
	--Begin
	--	Delete from #TempStudentGradeDetails
	--	Where (isnull(STUGRADE_FA1_GRADE,'')='X' and isnull(STUGRADE_FA2_GRADE,'')='X' and isnull(STUGRADE_SA1_GRADE,'')='X')

	--End
	--else if (@ReportCardExamUnit='Semester2')
	--Begin
	--	Delete from #TempStudentGradeDetails
	--	Where (isnull(STUGRADE_FA3_GRADE,'')='X' and isnull(STUGRADE_FA4_GRADE,'')='X' and isnull(STUGRADE_SA2_GRADE,'')='X')

	--End

	-------------------Inserting Scholastic Grades Data----------------
	if (@ReportCardExamUnit='Semester1' Or @ReportCardExamUnit='Semester2')
	Begin
	
		Insert Into #TempStudentReportCardDetails
		(
			REPCARD_DETAIL_STU_GUID,
			REPCARD_DETAIL_SUBJECT_TYPE,
			REPCARD_DETAIL_SUBJECT_ID,
			REPCARD_DETAIL_FA1_GRADE ,
			REPCARD_DETAIL_FA2_GRADE ,
			REPCARD_DETAIL_SA_GRADE ,
			REPCARD_DETAIL_EXAM_TYPE
		)
		Select STUGRADE_STU_GUID,
				'Scholastic',
				STUGRADE_SCHOLASTIC_CAT_ID,
				Case When @ReportCardExamUnit = 'Semester1' then
				STUGRADE_FA1_GRADE 
				When  @ReportCardExamUnit = 'Semester2' then
				STUGRADE_FA3_GRADE
				END,
				Case When @ReportCardExamUnit = 'Semester1' then
				STUGRADE_FA2_GRADE 
				When  @ReportCardExamUnit = 'Semester2' then
				STUGRADE_FA4_GRADE
				END,
				Case When @ReportCardExamUnit = 'Semester1' then
				STUGRADE_SA1_GRADE 
				When  @ReportCardExamUnit = 'Semester2' then
				STUGRADE_SA2_GRADE
				END,
				@ExamType 
	   from #TempStudentGradeDetails 
	
		
		-------------------Inserting Assesment Marks Data----------------
		Insert Into #TempStudentReportCardDetails
		(
			REPCARD_DETAIL_STU_GUID,
			REPCARD_DETAIL_SUBJECT_TYPE,
			REPCARD_DETAIL_SUBJECT_ID,
			REPCARD_DETAIL_FA1_MARKS,
			REPCARD_DETAIL_FA2_MARKS,
			REPCARD_DETAIL_SA_MARKS,
			REPCARD_DETAIL_EXAM_TYPE,
			REPCARD_DETAIL_TOTAL_MARKS,
			REPCARD_DETAIL_TOTAL_MARKS_FA1,
			REPCARD_DETAIL_TOTAL_MARKS_FA2,
			REPCARD_DETAIL_TOTAL_MARKS_SA , 
			REPCARD_DETAIL_TOTAL_MARKS_FINAL 
		)
		Select STUMARKS_STU_GUID, 
				'Assesment',
				STUMARKS_SUB_CAT_ID,
				Case When @ReportCardExamUnit = 'Semester1' then
						CAST((isnull(STUMARKS_FA1,0)*100)/30.0 as decimal(18,2)) 
					When @ReportCardExamUnit = 'Semester2' then
						CAST((isnull(STUMARKS_FA3,0)*100)/30.0 as decimal(18,2))
				End,
				Case When @ReportCardExamUnit = 'Semester1' then
						CAST((isnull(STUMARKS_FA2,0)*100)/30.0 as decimal(18,2))
					When @ReportCardExamUnit = 'Semester2' then
						CAST((isnull(STUMARKS_FA4,0)*100)/30.0 as decimal(18,2))
				End,
				Case When @ReportCardExamUnit = 'Semester1' then
						CAST((isnull(STUMARKS_SA1,0)*100)/90.0 as decimal(18,2))
					When @ReportCardExamUnit = 'Semester2' then
						CAST((isnull(STUMARKS_SA2,0)*100)/90.0 as decimal(18,2))
				End,
				@ExamType,
				Case When @ReportCardExamUnit ='Semester1' then
					((CAST(isnull(STUMARKS_FA1,0) as decimal(18,2))+
					CAST(isnull(STUMARKS_FA2,0) as decimal(18,2))+
					CAST(isnull(STUMARKS_SA1,0) as decimal(18,2)) 
					)*100)/150.0
				When @ReportCardExamUnit ='Semester2' then
					((CAST(isnull(STUMARKS_FA3,0) as decimal(18,2))+
					CAST(isnull(STUMARKS_FA4,0) as decimal(18,2))+
					CAST(isnull(STUMARKS_SA2,0) as decimal(18,2)) 
					)*100)/150.0
				End
				,
				Case When @ReportCardExamUnit = 'Semester1' then
						isnull(STUMARKS_FA1,0)
					When @ReportCardExamUnit = 'Semester2' then
						isnull(STUMARKS_FA3,0)
				End,
				Case When @ReportCardExamUnit = 'Semester1' then
						isnull(STUMARKS_FA2,0)
					When @ReportCardExamUnit = 'Semester2' then
						isnull(STUMARKS_FA4,0)
				End,
				Case When @ReportCardExamUnit = 'Semester1' then
						isnull(STUMARKS_SA1,0)
					When @ReportCardExamUnit = 'Semester2' then
						isnull(STUMARKS_SA2,0)
				End,
				Case When @ReportCardExamUnit ='Semester1' then
					isnull(STUMARKS_FA1,0) +
					isnull(STUMARKS_FA2,0)+
					isnull(STUMARKS_SA1,0) 
					
				When @ReportCardExamUnit ='Semester2' then
					isnull(STUMARKS_FA3,0) +
					isnull(STUMARKS_FA4,0)+
					isnull(STUMARKS_SA2,0) 
				End
				 
	   from #TempStudentMarksDetails  FM
	   
	   ---------------------Updating Semesterly marks Grade-----------------------
	   ----FA1 Or FA3 Grade---
	   
		Update #TempStudentReportCardDetails
		Set REPCARD_DETAIL_FA1_GRADE = MARKS_GRADE_CODE
		From MarksGradeMaster 
		Where REPCARD_DETAIL_EXAM_TYPE ='Semester'
		And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
		And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
		And  Round(isnull(REPCARD_DETAIL_FA1_MARKS,0),0)
		>= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
		And  Round(isnull(REPCARD_DETAIL_FA1_MARKS,0),0) <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE
		And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID
	
		----FA2 OR FA4 Grade---	
		Update #TempStudentReportCardDetails
		Set REPCARD_DETAIL_FA2_GRADE = MARKS_GRADE_CODE
		From MarksGradeMaster 
		Where REPCARD_DETAIL_EXAM_TYPE ='Semester'
		And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
		And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
		And  Round(isnull(REPCARD_DETAIL_FA2_MARKS,0),0)
		>= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
		And  Round(isnull(REPCARD_DETAIL_FA2_MARKS,0),0) <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE 
		And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID
		
		----SA1 Or SA2 Grade---	
		Update #TempStudentReportCardDetails
		Set REPCARD_DETAIL_SA_GRADE = MARKS_GRADE_CODE
		From MarksGradeMaster 
		Where REPCARD_DETAIL_EXAM_TYPE ='Semester'
		And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
		And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
		And  Round(isnull(REPCARD_DETAIL_SA_MARKS,0),0)
		>= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
		And  Round(isnull(REPCARD_DETAIL_SA_MARKS,0),0) <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE 
		And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID
		
		------Total Terminal------
		Update #TempStudentReportCardDetails
		Set REPCARD_DETAIL_TOTAL_GRADE = MARKS_GRADE_CODE
		From MarksGradeMaster 
		Where REPCARD_DETAIL_EXAM_TYPE ='Semester'
		And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
		And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
		And  Round(isnull(REPCARD_DETAIL_TOTAL_MARKS,0),0) >= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
		
		And  Round(isnull(REPCARD_DETAIL_TOTAL_MARKS,0),0)  <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE 
		And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID
		
		
		
	End
	Else if (@ReportCardExamUnit='Final')
	Begin
	
	
		Delete from #TempStudentMarksDetails
		Where (isnull(STUMARKS_FA1,0)=-1 and isnull(STUMARKS_FA2,0)=-1 and isnull(STUMARKS_SA1,0)=-1)

	
		Delete from #TempStudentMarksDetails
		Where (isnull(STUMARKS_FA3,0)=-1 and isnull(STUMARKS_FA4,0)=-1 and isnull(STUMARKS_SA2,0)=-1)


		
		--Delete from #TempStudentGradeDetails
		--Where (isnull(STUGRADE_FA1_GRADE,'')='X' and isnull(STUGRADE_FA2_GRADE,'')='X' and isnull(STUGRADE_SA1_GRADE,'')='X')

		--Delete from #TempStudentGradeDetails
		--Where (isnull(STUGRADE_FA3_GRADE,'')='X' and isnull(STUGRADE_FA4_GRADE,'')='X' and isnull(STUGRADE_SA2_GRADE,'')='X')

	

	Insert Into #TempStudentReportCardDetails
		(
			REPCARD_DETAIL_STU_GUID,
			REPCARD_DETAIL_SUBJECT_TYPE,
			REPCARD_DETAIL_SUBJECT_ID,
			REPCARD_DETAIL_FA1_GRADE ,
			REPCARD_DETAIL_FA2_GRADE ,
			REPCARD_DETAIL_SA_GRADE ,
			REPCARD_DETAIL_EXAM_TYPE
		)
		Select STUGRADE_STU_GUID,
				'Scholastic',
				STUGRADE_SCHOLASTIC_CAT_ID,
				Case When @ReportCardExamUnit = 'Final' then
				STUGRADE_FA3_GRADE
				END,
				Case When @ReportCardExamUnit = 'Final' then
				STUGRADE_FA4_GRADE
				END,
				Case When @ReportCardExamUnit = 'Final' then
				STUGRADE_SA2_GRADE
				END,
				@ExamType 
	   from #TempStudentGradeDetails 
	
		
		-------------------Inserting Assesment Marks Data----------------
		Insert Into #TempStudentReportCardDetails
		(
			REPCARD_DETAIL_STU_GUID,
			REPCARD_DETAIL_SUBJECT_TYPE,
			REPCARD_DETAIL_SUBJECT_ID,
			REPCARD_DETAIL_FA1_MARKS,
			REPCARD_DETAIL_FA2_MARKS,
			REPCARD_DETAIL_SA_MARKS,
			REPCARD_DETAIL_EXAM_TYPE,
			REPCARD_DETAIL_TOTAL_MARKS ,
			REPCARD_DETAIL_TOTAL_MARKS_FA1,
			REPCARD_DETAIL_TOTAL_MARKS_FA2,
			REPCARD_DETAIL_TOTAL_MARKS_SA,
			REPCARD_DETAIL_TOTAL_MARKS_FINAL 
		)
		Select STUMARKS_STU_GUID, 
				'Assesment',
				STUMARKS_SUB_CAT_ID,
				Case When @ReportCardExamUnit = 'Final' then
						CAST(
						((isnull(STUMARKS_FA1,0)+
						isnull(STUMARKS_FA2,0)+
						isnull(STUMARKS_FA3,0)+
						isnull(STUMARKS_FA4,0))*100.0)/120   
						as decimal(18,2)) 
				End,
				NULL,
				Case When @ReportCardExamUnit = 'Final' then
				CAST(
						((isnull(STUMARKS_SA1,0)+
						isnull(STUMARKS_SA2,0)
						)*100.0)/180   
						as decimal(18,2)) 
				End,
				@ExamType,
				CAST(
						((isnull(STUMARKS_FA1,0)+
						isnull(STUMARKS_FA2,0)+
						isnull(STUMARKS_FA3,0)+
						isnull(STUMARKS_FA4,0))*40)/120   
						as decimal(18,2))+
				CAST(
						((isnull(STUMARKS_SA1,0)+
						isnull(STUMARKS_SA2,0)
						)*60)/180   
						as decimal(18,2)) 
			 ,
			Case When @ReportCardExamUnit = 'Final' then
						
						isnull(STUMARKS_FA1,0)+
						isnull(STUMARKS_FA2,0)+
						isnull(STUMARKS_FA3,0)+
						isnull(STUMARKS_FA4,0)  
						
				End,
				NULL,
				Case When @ReportCardExamUnit = 'Final' then
			
						isnull(STUMARKS_SA1,0)+
						isnull(STUMARKS_SA2,0)
						
				End,	 
						isnull(STUMARKS_FA1,0)+
						isnull(STUMARKS_FA2,0)+
						isnull(STUMARKS_FA3,0)+
						isnull(STUMARKS_FA4,0)+
						isnull(STUMARKS_SA1,0)+
						isnull(STUMARKS_SA2,0)
						 
						 
	   from #TempStudentMarksDetails  FM
	   
		   ---------------------Updating Quarterly marks Grade-----------------------
		------TFA Grade----
		Update #TempStudentReportCardDetails
		Set REPCARD_DETAIL_FA1_GRADE =MARKS_GRADE_CODE
		From MarksGradeMaster 
		Where REPCARD_DETAIL_EXAM_TYPE ='Semester'
		And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
		And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
		And  Round(isnull(REPCARD_DETAIL_FA1_MARKS,0),0) >= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
		
		And  Round(isnull(REPCARD_DETAIL_FA1_MARKS,0),0) <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE 
		And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID
	
		------TSA Grade----
		Update #TempStudentReportCardDetails
		Set REPCARD_DETAIL_SA_GRADE =MARKS_GRADE_CODE
		From MarksGradeMaster 
		Where REPCARD_DETAIL_EXAM_TYPE ='Semester'
		And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
		And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
		And  Round(isnull(REPCARD_DETAIL_SA_MARKS,0),0) >= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
		
		And  Round(isnull(REPCARD_DETAIL_SA_MARKS,0),0) <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE 
		And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID
	
		------OverAll----
		Update #TempStudentReportCardDetails
		Set REPCARD_DETAIL_TOTAL_GRADE = MARKS_GRADE_CODE
		From MarksGradeMaster 
		Where REPCARD_DETAIL_EXAM_TYPE ='Semester'
		And REPCARD_DETAIL_SUBJECT_TYPE = 'Assesment'
		And MarksGradeMaster.MARKS_GRADE_CLASS_ID = @ClassId
		And  Round(isnull(REPCARD_DETAIL_TOTAL_MARKS,0),0) >= MarksGradeMaster.MARKS_GRADE_MIN_RANGE
		
		And  Round(isnull(REPCARD_DETAIL_TOTAL_MARKS,0),0) <= MarksGradeMaster.MARKS_GRADE_MAX_RANGE 
		And MARKS_GRADE_CMP_ID = @CompanyID 
	And MARKS_GRADE_SCH_ID = @SchoolID
	End
	
End 



----------------------Inserting Records into dbo.StudentReportCardMaster-------
----------------------And dbo.StudentReportCardDetails tables -----------------

