 From  #TempStudentReportCardMaster

Update #TempStudentReportCardMaster           
Set REPCARD_ID = SRCM.REPCARD_ID From StudentReportCardMaster SRCM
Where #TempStudentReportCardMaster.REPCARD_ID is null
