And #TempStudentReportCardMaster.REPCARD_TYPE   = SRCM.REPCARD_TYPE 
And #TempStudentReportCardMaster.REPCARD_TYPE_VALUE    = SRCM.REPCARD_TYPE_VALUE
And #TempStudentReportCardMaster.REPCARD_CMP_ID = SRCM.REPCARD_CMP_ID
And #TempStudentReportCardMaster.REPCARD_SCH_ID = SRCM.REPCARD_SCH_ID
And SRCM.REPCARD_CMP_ID = @CompanyID 
