REPCARD_DETAIL_CMP_ID = REPCARD_CMP_ID,
REPCARD_DETAIL_SCH_ID = REPCARD_SCH_ID
From #TempStudentReportCardMaster

Where REPCARD_DETAIL_STU_GUID = REPCARD_STU_GUID 


----------------------Insert Record into StudentReportCardDetails-------------
INSERT INTO StudentReportCardDetails
           (
				[REPCARD_DETAIL_REPCARD_ID]
			   ,[REPCARD_DETAIL_SUBJECT_TYPE]
			   ,[REPCARD_DETAIL_SUBJECT_ID]
			   ,[REPCARD_DETAIL_QUARTER_MARKS]
			   ,[REPCARD_DETAIL_FA1_MARKS]
			   ,[REPCARD_DETAIL_FA2_MARKS]
			   ,[REPCARD_DETAIL_SA_MARKS]
