CREATE Procedure [dbo].[usp_GenerateStudentFeeData]
@ClassID int,
@Fees_Month int,
@Fees_Year int,
@Fees_DueDate Datetime,
@UserName varchar(50),
@CompanyID int,
@SchoolID int 
As
Begin

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

Declare
@dtFeeStartDate datetime,
@dtFeeEndDate datetime,
@TransPortFeeCatID int,
@TutionFeesCatID int,
@AnnualFeesCatID int,
@AdmissionFeeCatId int

Select @TransPortFeeCatID = FCM_ID From FeesCategoryMaster 
Where FCM_CAT_NAME ='Transport Fees'
And FCM_CAT_CMP_ID = @CompanyID 
And FCM_CAT_SCH_ID = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
if @TransPortFeeCatID is null
Set @TransPortFeeCatID = -1


Select @TutionFeesCatID = FCM_ID From FeesCategoryMaster 
Where FCM_CAT_NAME ='Tuition Fees'
And FCM_CAT_CMP_ID = @CompanyID 
And FCM_CAT_SCH_ID = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
if @TutionFeesCatID is null
Set @TutionFeesCatID = -1


Select @AdmissionFeeCatId = FCM_ID From FeesCategoryMaster 
Where FCM_CAT_NAME ='Admisison Fee'
And FCM_CAT_CMP_ID = @CompanyID 
And FCM_CAT_SCH_ID = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
if @AdmissionFeeCatId is null
Set @AdmissionFeeCatId = -1

Select @AnnualFeesCatID = FCM_ID From FeesCategoryMaster 
Where FCM_CAT_NAME ='Annual Charges'
And FCM_CAT_CMP_ID = @CompanyID 
And FCM_CAT_SCH_ID = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
								
if @AnnualFeesCatID is null
Set @AnnualFeesCatID = -1



Declare @TotalFees decimal(18,2)
---Calculate the first date of processing month    
 Set @dtFeeStartDate =ltrim(str(@Fees_Month))+'/'+'1/'++ltrim(str(@Fees_Year))    
--Calculate last date of processing month    
 Set @dtFeeEndDate =ltrim(str(@Fees_Month))+'/'+'1/'++ltrim(str(@Fees_Year))    
    
 Set @dtFeeEndDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtFeeEndDate)+1,0))  

--Select @TotalFees = Sum(isnull(FD.FCD_AMOUNT,0)) From FeeClassDetails FD
--Where FD.FCD_CM_ID = @ClassID
--And  @dtFeeEndDate>=FD.FCD_FROM_DATE and @dtFeeStartDate<=FD.FCD_TO_DATE 




-----------------Selecting Records if the Discount category is null for students-------
		Insert into dbo.StudentFeeDetails
		(
					[STUD_FEE_STU_GUID]
				   ,[STUD_FEE_CM_ID]
				   ,[STUD_FEE_DUE_DATE]
				  ,[STUD_FEE_PAID]
				   ,[STUD_FEE_AMOUNT]
				   ,[STUD_LATE_FEE_AMOUNT]
				   ,[STUD_FEE_TOTAL_AMOUNT]
				   ,[IS_ACTIVE]
				   ,[STUD_FEE_MONTH]
				   ,[STUD_FEE_YEAR]
				   ,[CREATED_BY]
				   ,[CREATED_DATE]
				   ,[MODIFIED_BY]
				   ,[MODIFIED_DATE]
				   ,[STUD_FEE_SCH_ID]
				   ,[STUD_FEE_CMP_ID]
				   ,STUD_FEE_CAT_ID
				   ,STUD_FEE_SEC_ID
		)
		Select SM.STU_GUID,
		SM.STU_CM_ID,
		@Fees_DueDate,
		0,
		isnull(FCD.FCD_AMOUNT,0),
		0,
		isnull(FCD.FCD_AMOUNT,0),
		1,
		@Fees_Month,
		@Fees_Year , 
		@UserName,
		GETDATE(),
		@UserName,
		getdate(),
		SM.STU_SCH_ID,
		SM.STU_CMP_ID,
		FCD.FCD_FEE_CAT_ID  
		,SM.STU_SEC_ID  
		From StudentMaster SM
		Join FeeClassDetails FCD
		On SM.STU_CM_ID = FCD.FCD_CM_ID 
		Where SM.STU_CM_ID = @ClassID 
		And FCD.FCD_CM_ID  = @ClassID
		And @dtFeeEndDate >= DATEADD(mm, DATEDIFF(mm, 0, Convert(Datetime,(Convert(Varchar(4),year(FCD_FROM_DATE)) + '-' + Convert(Varchar(2),month(FCD_FROM_DATE)) + '-' +Convert(Varchar(2),day(FCD_FROM_DATE))))), 0) 
		and @dtFeeStartDate <=Convert(Datetime,(Convert(Varchar(4),year(DATEADD(ms, -3, DATEADD(mm, DATEDIFF(m, 0, FCD_TO_DATE) + 1, 0)))) + '-' + Convert(Varchar(2),month(DATEADD(ms, -3, DATEADD(mm, DATEDIFF(m, 0, FCD_TO_DATE) + 1, 0)))) + '-' +Convert(Varchar(2),day(DATEADD(ms, -3, DATEADD(mm, DATEDIFF(m, 0, FCD_TO_DATE) + 1, 0))))))
		And FCD.FCD_FEE_CAT_ID <> @TransPortFeeCatID 
		--And FCD.FCD_FEE_CAT_ID <> @TutionFeesCatID
		--And FCD.FCD_FEE_CAT_ID <> @AnnualFeesCatID
		And FCD.FCD_FEE_CAT_ID <> @AdmissionFeeCatId 
		And SM.STU_FDCM_ID is null
		And SM.STU_CMP_ID = @CompanyID 
		And SM.STU_SCH_ID = @SchoolID 
		And Case When @DisplayRecord = -1 then
									1
								else
									SM.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
		And Case When @DisplayRecord = -1 then
									1
								else
									SM.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
		

-----------------Selecting Records if the Discount category is applicable for students-------
		
		Insert into dbo.StudentFeeDetails
		(
					[STUD_FEE_STU_GUID]
				   ,[STUD_FEE_CM_ID]
				   ,[STUD_FEE_DUE_DATE]
				  ,[STUD_FEE_PAID]
				   ,[STUD_FEE_AMOUNT]
				   ,[STUD_LATE_FEE_AMOUNT]
				   ,[STUD_FEE_TOTAL_AMOUNT]
				   ,[IS_ACTIVE]
				   ,[STUD_FEE_MONTH]
				   ,[STUD_FEE_YEAR]
				   ,[CREATED_BY]
				   ,[CREATED_DATE]
				   ,[MODIFIED_BY]
				   ,[MODIFIED_DATE]
				   ,[STUD_FEE_SCH_ID]
				   ,[STUD_FEE_CMP_ID]
				   ,STUD_FEE_CAT_ID
				   ,STUD_FEE_SEC_ID
		)
		Select SM.STU_GUID, 
		SM.STU_CM_ID,
		@Fees_DueDate,
		0,
		Case When SM.STU_FDCM_ID Is not null and isnull(FD.FDCM_FEE_CAT_ID,0) = FCD.FCD_FEE_CAT_ID and isnull(FD.FDCM_IS_PERCENTAGE,0) = 0  then 
			isnull(FCD.FCD_AMOUNT,0)-isnull(FD.FDCM_AMOUNT,0) 
		 When SM.STU_FDCM_ID Is not null and isnull(FD.FDCM_FEE_CAT_ID,0) = FCD.FCD_FEE_CAT_ID and isnull(FD.FDCM_IS_PERCENTAGE,0) = 1  then 
			isnull(FCD.FCD_AMOUNT,0)-(isnull(FCD.FCD_AMOUNT,0)*isnull(FD.FDCM_AMOUNT,0)/100.0) 
		 else
			isnull(FCD_AMOUNT ,0)
		End,
		0,
		Case When SM.STU_FDCM_ID Is not null and isnull(FD.FDCM_FEE_CAT_ID,0) = FCD.FCD_FEE_CAT_ID and isnull(FD.FDCM_IS_PERCENTAGE,0) = 0  then 
			isnull(FCD.FCD_AMOUNT,0)-isnull(FD.FDCM_AMOUNT,0) 
		 When SM.STU_FDCM_ID Is not null and isnull(FD.FDCM_FEE_CAT_ID,0) = FCD.FCD_FEE_CAT_ID and isnull(FD.FDCM_IS_PERCENTAGE,0) = 1  then 
			isnull(FCD.FCD_AMOUNT,0)-(isnull(FCD.FCD_AMOUNT,0)*isnull(FD.FDCM_AMOUNT,0)/100.0) 
		 else
			isnull(FCD_AMOUNT ,0)
		End,
		1,
		@Fees_Month,
		@Fees_Year , 
		@UserName,
		GETDATE(),
		@UserName,
		getdate(),
		SM.STU_SCH_ID,
		SM.STU_CMP_ID,
		FCD.FCD_FEE_CAT_ID  
		,SM.STU_SEC_ID  
		From StudentMaster SM
		Join FeeClassDetails FCD
		On SM.STU_CM_ID = FCD.FCD_CM_ID
		Join FeesDiscountCategoryMaster FD 
		On SM.STU_FDCM_ID = FD.FDCM_ID  
		Where SM.STU_CM_ID = @ClassID 
		And FCD.FCD_CM_ID  = @ClassID
		And @dtFeeEndDate >= DATEADD(mm, DATEDIFF(mm, 0, Convert(Datetime,(Convert(Varchar(4),year(FCD_FROM_DATE)) + '-' + Convert(Varchar(2),month(FCD_FROM_DATE)) + '-' +Convert(Varchar(2),day(FCD_FROM_DATE))))), 0) 
		and @dtFeeStartDate <=Convert(Datetime,(Convert(Varchar(4),year(DATEADD(ms, -3, DATEADD(mm, DATEDIFF(m, 0, FCD_TO_DATE) + 1, 0)))) + '-' + Convert(Varchar(2),month(DATEADD(ms, -3, DATEADD(mm, DATEDIFF(m, 0, FCD_TO_DATE) + 1, 0)))) + '-' +Convert(Varchar(2),day(DATEADD(ms, -3, DATEADD(mm, DATEDIFF(m, 0, FCD_TO_DATE) + 1, 0))))))
		And FCD.FCD_FEE_CAT_ID <> @TransPortFeeCatID 
		--And FCD.FCD_FEE_CAT_ID <> @TutionFeesCatID
		--And FCD.FCD_FEE_CAT_ID <> @AnnualFeesCatID
		And FCD.FCD_FEE_CAT_ID <> @AdmissionFeeCatId 
		And SM.STU_FDCM_ID is not null
		And SM.STU_CMP_ID = @CompanyID 
		And SM.STU_SCH_ID = @SchoolID 
		And Case When @DisplayRecord = -1 then
									1
								else
									SM.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
		And Case When @DisplayRecord = -1 then
									1
								else
									SM.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
		
-------------------------Generating Transport Fees Details From Transport Module------------------------
if Exists (
			   Select 'X' From StudentMaster 
			   Where STU_CM_ID = @ClassID 
			   And STU_ROUTE_ID is not null
			   And STU_ROUTE_STOP_ID is not null
			   ANd STU_ROUTE_PICK_AND_DROP is not null
			   	And STU_CMP_ID = @CompanyID 
				And STU_SCH_ID = @SchoolID 
				And isnull(STU_USE_TRANSPORT_FEES,0) = 0
				And STU_TRANSPORT_AVAILING_DATE is not null
				And Case When @DisplayRecord = -1 then
									1
								else
									IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
		
		   )
Begin
		Insert into dbo.StudentFeeDetails
		(
			[STUD_FEE_STU_GUID]
		   ,[STUD_FEE_CM_ID]
		   ,[STUD_FEE_DUE_DATE]
		  ,[STUD_FEE_PAID]
		   ,[STUD_FEE_AMOUNT]
		   ,[STUD_LATE_FEE_AMOUNT]
		   ,[STUD_FEE_TOTAL_AMOUNT]
		   ,[IS_ACTIVE]
		   ,[STUD_FEE_MONTH]
		   ,[STUD_FEE_YEAR]
		   ,[CREATED_BY]
		   ,[CREATED_DATE]
		   ,[MODIFIED_BY]
		   ,[MODIFIED_DATE]
		   ,[STUD_FEE_SCH_ID]
		   ,[STUD_FEE_CMP_ID]
		   ,STUD_FEE_CAT_ID
		    ,STUD_FEE_SEC_ID
		)
		Select SM.STU_GUID,
		SM.STU_CM_ID,
		@Fees_DueDate,
		0,
		Case When STU_ROUTE_PICK_AND_DROP = 1 or STU_ROUTE_PICK_AND_DROP = 3 then 
		isnull(RD.ROUTE_STOP_ONE_WAY_MONTHLY_FEE,0)
		When STU_ROUTE_PICK_AND_DROP = 2 then  
			isnull(RD.ROUTE_STOP_TWO_WAY_MONTHLY_FEE ,0)
		End,
		0,
		Case When STU_ROUTE_PICK_AND_DROP = 1  or STU_ROUTE_PICK_AND_DROP = 3 then 
		isnull(RD.ROUTE_STOP_ONE_WAY_MONTHLY_FEE,0)
		When STU_ROUTE_PICK_AND_DROP = 2 then  
			isnull(RD.ROUTE_STOP_TWO_WAY_MONTHLY_FEE ,0)
		End,
		1,
		@Fees_Month,
		@Fees_Year , 
		@UserName,
		GETDATE(),
		@UserName,
		getdate(),
		SM.STU_SCH_ID,
		SM.STU_CMP_ID,
		@TransPortFeeCatID
		,SM.STU_SEC_ID  
		From StudentMaster SM
		Join  RouteMaster RM
		On SM.STU_ROUTE_ID = RM.ROUTE_ID
		Join RouteStopDetails RD
		On SM.STU_ROUTE_STOP_ID = RD.ROUTE_STOP_ID  
		And RM.ROUTE_ID = RD.ROUTE_STOP_ROUTE_ID 
		Where SM.STU_CM_ID = @ClassID 
		And STU_ROUTE_ID is not null
		 And STU_ROUTE_STOP_ID is not null
		 ANd STU_ROUTE_PICK_AND_DROP is not null
		 	And SM.STU_CMP_ID = @CompanyID 
		And SM.STU_SCH_ID = @SchoolID 
		And isnull(STU_USE_TRANSPORT_FEES,0) =0
		And STU_TRANSPORT_AVAILING_DATE is not null
		and Convert(Datetime,(Convert(Varchar(4),year(@dtFeeEndDate )) + '-' + Convert(Varchar(2),month(@dtFeeEndDate )) + '-' +Convert(Varchar(2),day(@dtFeeEndDate))))
		>=Convert(Datetime,(Convert(Varchar(4),year(STU_TRANSPORT_AVAILING_DATE)) + '-' + Convert(Varchar(2),month(STU_TRANSPORT_AVAILING_DATE)) + '-' +Convert(Varchar(2),day(STU_TRANSPORT_AVAILING_DATE))))
		
		-- And RD.ROUTE_STOP_ONE_WAY_MONTHLY_FEE is not null
		-- And RD.ROUTE_STOP_TWO_WAY_MONTHLY_FEE is not null
	And Case When @DisplayRecord = -1 then
									1
								else
									SM.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 


End


-------------------------Generating Transport Fees Details From STudent Transport Fees Column------------------------
if Exists (
			   Select 'X' From StudentMaster 
			   Where STU_CM_ID = @ClassID 
			   And STU_ROUTE_ID is not null
			   And STU_ROUTE_STOP_ID is not null
			   ANd STU_ROUTE_PICK_AND_DROP is not null
			   	And STU_CMP_ID = @CompanyID 
				And STU_SCH_ID = @SchoolID 
				And isnull(STU_USE_TRANSPORT_FEES,0) = 1
				And STU_TRANSPORT_AVAILING_DATE is not null
				And Case When @DisplayRecord = -1 then
									1
								else
									IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
		   )
Begin
		Insert into dbo.StudentFeeDetails
		(
			[STUD_FEE_STU_GUID]
		   ,[STUD_FEE_CM_ID]
		   ,[STUD_FEE_DUE_DATE]
		  ,[STUD_FEE_PAID]
		   ,[STUD_FEE_AMOUNT]
		   ,[STUD_LATE_FEE_AMOUNT]
		   ,[STUD_FEE_TOTAL_AMOUNT]
		   ,[IS_ACTIVE]
		   ,[STUD_FEE_MONTH]
		   ,[STUD_FEE_YEAR]
		   ,[CREATED_BY]
		   ,[CREATED_DATE]
		   ,[MODIFIED_BY]
		   ,[MODIFIED_DATE]
		   ,[STUD_FEE_SCH_ID]
		   ,[STUD_FEE_CMP_ID]
		   ,STUD_FEE_CAT_ID
		    ,STUD_FEE_SEC_ID
		)
		Select SM.STU_GUID,
		SM.STU_CM_ID,
		@Fees_DueDate,
		0,
		isnull(STU_TRANSPORT_FEES,0),
		0,
		isnull(STU_TRANSPORT_FEES,0),
		1,
		@Fees_Month,
		@Fees_Year , 
		@UserName,
		GETDATE(),
		@UserName,
		getdate(),
		SM.STU_SCH_ID,
		SM.STU_CMP_ID,
		@TransPortFeeCatID
		,SM.STU_SEC_ID  
		From StudentMaster SM
		Join  RouteMaster RM
		On SM.STU_ROUTE_ID = RM.ROUTE_ID
		Join RouteStopDetails RD
		On SM.STU_ROUTE_STOP_ID = RD.ROUTE_STOP_ID  
		And RM.ROUTE_ID = RD.ROUTE_STOP_ROUTE_ID 
		Where SM.STU_CM_ID = @ClassID 
		And STU_ROUTE_ID is not null
		 And STU_ROUTE_STOP_ID is not null
		 ANd STU_ROUTE_PICK_AND_DROP is not null
		 	And SM.STU_CMP_ID = @CompanyID 
		And SM.STU_SCH_ID = @SchoolID 
		And isnull(STU_USE_TRANSPORT_FEES,0) = 1
		And STU_TRANSPORT_AVAILING_DATE is not null
		and Convert(Datetime,(Convert(Varchar(4),year(@dtFeeEndDate )) + '-' + Convert(Varchar(2),month(@dtFeeEndDate )) + '-' +Convert(Varchar(2),day(@dtFeeEndDate))))
		>=Convert(Datetime,(Convert(Varchar(4),year(STU_TRANSPORT_AVAILING_DATE)) + '-' + Convert(Varchar(2),month(STU_TRANSPORT_AVAILING_DATE)) + '-' +Convert(Varchar(2),day(STU_TRANSPORT_AVAILING_DATE))))
		
		-- And RD.ROUTE_STOP_ONE_WAY_MONTHLY_FEE is not null
		-- And RD.ROUTE_STOP_TWO_WAY_MONTHLY_FEE is not null
	And Case When @DisplayRecord = -1 then
									1
								else
									SM.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 


End
		

Select 'True'

End




