--usp_GenerateTimeTablePeriodData 1
CREATE Procedure [dbo].[usp_GenerateTimeTablePeriodData]
@SessionID int
As
Begin

Declare
@TotalPeriod int,
@PeriodDuration int,
@RecessDuration int,
@RecessAfterPeriod int,
@PeriodStartTime time(0),
@PeriodEndTime time(0),
@FruitRecessDuration int,
@FruitRecessAfterPeriod int,
@SessionPeriod varchar(50)

Select  @TotalPeriod = TTSETUP_TOTAL_PERIODS,
@PeriodDuration = TTSETUP_PERIOD_DURATION,
@RecessDuration = TTSETUP_RECCESS_DURATION,
@RecessAfterPeriod = TTSETUP_RECCESS_AFTER_PERIOD,
@PeriodStartTime = TTSETUP_PERIOD_START_TIME,
@FruitRecessDuration = isnull(TTSETUP_FRUIT_RECCESS_DURATION,-1),
@FruitRecessAfterPeriod = isnull(TTSETUP_FRUIT_RECCESS_AFTER_PERIOD,-1),
@SessionPeriod = isnull(TTSETUP_SESSION,'')
From TimeTableSetupDetails 
Where TTSETUP_TTSESSION_ID = @SessionID 

--Select @FruitRecessDuration,@FruitRecessAfterPeriod
--Select @TotalPeriod ,@PeriodDuration ,@RecessDuration ,@RecessAfterPeriod ,@PeriodStartTime

Declare
@StartPeriod int
Set @StartPeriod = 0
Set @PeriodEndTime =  DateAdd(mi,@PeriodDuration,@PeriodStartTime) 
------------------------While Loop to generate the data for each period.
While @StartPeriod <= @TotalPeriod 
Begin
	
	
	
	if Not exists (
					   Select 'X' From TimeTablePeriodMaster  TTP
					   Where TTP.TTPERIOD_NUMBER =@StartPeriod
					   and TTP.TTPERIOD_TTSESSION_ID = @SessionID
				   )  				
	Begin
			
		INSERT INTO TimeTablePeriodMaster	
			(
				[TTPERIOD_DESCTIPTION]
			   ,[TTPERIOD_NUMBER]
			   ,[TTPERIOD_START_TIME]
			   ,[TTPERIOD_END_TIME]
			   ,[TTPERIOD_TTSESSION_ID]
			   ,[TTPERIOD_CMP_ID]
			   ,[TTPERIOD_SCH_ID]
			   ,[CREATED_BY]
			   ,[CREATED_DATE]
			   ,[MODIFIED_BY]
			   ,[MODIFIED_DATE]
			   ,TTPERIOD_SESSION
			)
		Select  Case When @StartPeriod <> 0 then
					 dbo.fnCONVTO_ROMAN(@StartPeriod)
				else
					'Zero'
				end
				,
				@StartPeriod,
				@PeriodStartTime,
				@PeriodEndTime,
				@SessionID,
				1,
				1,
				'Administrator',
				GETDATE(),
				'Administrator',
				GETDATE() ,
				@SessionPeriod
			   
	End
	Else
	Begin
		   Update TimeTablePeriodMaster 
		   Set  TTPERIOD_START_TIME = @PeriodStartTime,
		    TTPERIOD_END_TIME = @PeriodEndTime
		   Where TTPERIOD_NUMBER =@StartPeriod
		   and TTPERIOD_TTSESSION_ID = @SessionID
	End
	if (@StartPeriod = @FruitRecessAfterPeriod And @FruitRecessAfterPeriod <> - 1 And @FruitRecessDuration <>-1)
	Begin
	
		Set @StartPeriod = @StartPeriod + 1 
		Set @PeriodStartTime  = DateAdd(mi,@FruitRecessDuration,@PeriodEndTime)  
		Set @PeriodEndTime   = DateAdd(mi,@PeriodDuration,@PeriodStartTime)  
		
	End
	else if (@StartPeriod = @RecessAfterPeriod)  
	Begin
	
		Set @StartPeriod = @StartPeriod + 1 
		Set @PeriodStartTime  = DateAdd(mi,@RecessDuration,@PeriodEndTime)  
		Set @PeriodEndTime   = DateAdd(mi,@PeriodDuration,@PeriodStartTime)  
	End
	Else
	Begin
		Set @PeriodStartTime  = @PeriodEndTime
		Set @PeriodEndTime   = DateAdd(mi,@PeriodDuration,@PeriodStartTime)  
		Set @StartPeriod = @StartPeriod + 1 
	End
	
	
End

Select 'True'

End




GO
