--exec usp_getAgeGradeReportData '2013-12-06',1,1
CREATE Procedure [dbo].[usp_getAgeGradeReportData]
@ReportRunDate datetime,
@CompanyID int,
@SchoolID int
As
Begin


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

Create Table #TempClassAgeGrades
(
	AgeInYears int,
	PG_M int,
	PG_F int,
	MI_M int,
	MI_F int,
	MII_M int,
	MII_F int,
	MIII_M int,
	MIII_F int,
	I_M int,
	I_F int,
	II_M int,
	II_F int,
	III_M int,
	III_F int,
	IV_M int,
	IV_F int,
	V_M int,
	V_F int,
	VI_M int,
	VI_F int,
	VII_M int,
	VII_F int,
	VIII_M int,
	VIII_F int,
	IX_M int,
	IX_F int,
	X_M int,
	X_F int
	)

Declare @AgeYear int
Declare @CM_NAME varchar(50)
Declare @CM_FULL_NAME varchar(50)
Declare @CM_ID int
Declare @StrQuery varchar(1000)
Set @AgeYear = 3
While @AgeYear <=23
Begin
	Insert Into #TempClassAgeGrades
	(
		AgeInYears
	)
	Values(@AgeYear)
	
	Set @AgeYear = @AgeYear +1

End

	  Declare CursorClass Cursor For  
        Select CM_Name,CM_ID
        From Classmaster
        Where CM_CMP_ID = @CompanyID
        And CM_SCH_ID = @SchoolID
       
			 --Open the cursor
			 OPEN CursorClass   

			--Fetching the values from cursor
			 FETCH NEXT FROM CursorClass 
			 INTO @CM_NAME,@CM_ID
			 WHILE @@FETCH_STATUS = 0   
			 BEGIN 
			 ----------------Calculating the total number of Boys--------------
		            if exists (Select 'X' From StudentMaster 
							   Where STU_CM_ID = @CM_ID
							   And STU_CMP_ID = @CompanyID 
							   And STU_SCH_ID = @SchoolID
							   AND isnull(STU_GENDER,'') = 'M'
							   And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
							   ) 
					Begin
					
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_M=(Select Count(DATEDIFF(YY,STU_DOB,'''+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))  
										+''')) from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										 AND isnull(STU_GENDER,'''') = ''M'''
										+' And #TempClassAgeGrades.AgeInYears = 3'
										+' And DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) <=3 )
										Where #TempClassAgeGrades.AgeInYears = 3'
										
						--print @StrQuery
						exec (@StrQuery)  
						
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_M=(Select Count(DATEDIFF(YY,STU_DOB,'''+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))  
										+''')) from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										 AND isnull(STU_GENDER,'''') = ''M'''
										+' And #TempClassAgeGrades.AgeInYears >22'
										+' And DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) >22 )
										Where #TempClassAgeGrades.AgeInYears >22
										'
						
						exec (@StrQuery)  
						
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_M= (Select Count(DATEDIFF(YY,STU_DOB,'''+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))  
										+''')) from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										 AND isnull(STU_GENDER,'''') = ''M'''
										+' And #TempClassAgeGrades.AgeInYears >3 And #TempClassAgeGrades.AgeInYears <23'
										+' And DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) >3 And '
										+' DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) <23 '
										+ ' And #TempClassAgeGrades.AgeInYears ='
										+' DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+'''))
										Where #TempClassAgeGrades.AgeInYears > 3 and  #TempClassAgeGrades.AgeInYears < 23
										'
						--print @StrQuery
						exec (@StrQuery)  
						
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_M=null
										 Where '+@CM_NAME+'_M = 0'
							
							exec (@StrQuery)  
						 ----------------Calculating the total number of Girls--------------
		            if exists (Select 'X' From StudentMaster 
							   Where STU_CM_ID = @CM_ID
							   And STU_CMP_ID = @CompanyID 
							   And STU_SCH_ID = @SchoolID
							   AND isnull(STU_GENDER,'') = 'F' 
							   And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
							   ) 
					Begin
					
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_F=(Select Count(DATEDIFF(YY,STU_DOB,'''+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))  
										+''')) from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										 AND isnull(STU_GENDER,'''') = ''F'''
										+' And #TempClassAgeGrades.AgeInYears = 3'
										+' And DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) <=3 )
										Where #TempClassAgeGrades.AgeInYears = 3
										'
						
						exec (@StrQuery)  
						
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_F=(Select Count(DATEDIFF(YY,STU_DOB,'''+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))  
										+''')) from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										 AND isnull(STU_GENDER,'''') = ''F'''
										+' And #TempClassAgeGrades.AgeInYears >22'
										+' And DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) >22 )
										Where #TempClassAgeGrades.AgeInYears >22
										'
						
						exec (@StrQuery)  
						
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_F= (Select Count(DATEDIFF(YY,STU_DOB,'''+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))  
										+''')) from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										  AND isnull(STU_GENDER,'''') = ''F'''
										+' And #TempClassAgeGrades.AgeInYears >3 And #TempClassAgeGrades.AgeInYears <23'
										+' And DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) >3 And '
										+' DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+''' ) <23 '
										+ ' And #TempClassAgeGrades.AgeInYears ='
										+' DATEDIFF(YY,STU_DOB,'''
										+Convert(varchar(4),year(@ReportRunDate))+'-'+Convert(varchar(2),month(@ReportRunDate))+'-'+Convert(varchar(2),day(@ReportRunDate))
										+'''))
										Where #TempClassAgeGrades.AgeInYears > 3 and  #TempClassAgeGrades.AgeInYears < 23
										'
						--print @StrQuery
						exec (@StrQuery)  
						
							Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_F=null
										 Where '+@CM_NAME+'_F = 0'
							
							exec (@StrQuery)
						End
					End
		
			  --Fetching the values from cursor
				 FETCH NEXT FROM CursorClass 
				 INTO @CM_NAME,@CM_ID
			 END
			CLOSE CursorClass   
			DEALLOCATE CursorClass 


		

Select Case When AgeInYears = 3 then
		'<4'
		When AgeInYears>22 then
		'>22'
		else
		LTRIM(Str(AgeInYears))
		End as  AgeInYears
		 ,
