-- usp_getAllClassSectionTimeTableReportData 1,1,1

CREATE procedure [dbo].[usp_getAllClassSectionTimeTableReportData]
@SessionID int,
@CompanyID int,
@SchoolID int
As
Begin

Declare  
@TotalPeriod int  ,
@SessionYear varchar(50) 

Select  @TotalPeriod = TTSETUP_TOTAL_PERIODS
, @SessionYear = isnull(TTSETUP_SESSION,'')
From TimeTableSetupDetails 
Where TTSETUP_TTSESSION_ID = @SessionID
And TTSETUP_CMP_ID = @CompanyID 
And TTSETUP_SCH_ID = @SchoolID 

Declare 
@Counter int
Create Table #TempTimeTableData
(
	Period_ID int,
	Period_Description varchar(50),
	Period_TimeSlot varchar(50),
	ClassSectionID int,
	ClassSectionName varchar(50),
	ClassOrder  int,
	TeacherID_Day1 int,
	SubjectID_Day1 int,
	TeacherID_Day2 int,
	SubjectID_Day2 int,
	TeacherID_Day3 int,
	SubjectID_Day3 int,
	TeacherID_Day4 int,
	SubjectID_Day4 int,
	TeacherID_Day5 int,
	SubjectID_Day5 int,
	TeacherID_Day6 int,
	SubjectID_Day6 int,
	
	TeacherName_Day1 varchar(100),
	SubjectName_Day1 varchar(100),
	TeacherName_Day2 varchar(100),
	SubjectName_Day2 varchar(100),
	TeacherName_Day3 varchar(100),
	SubjectName_Day3 varchar(100),
	TeacherName_Day4 varchar(100),
	SubjectName_Day4 varchar(100),
	TeacherName_Day5 varchar(100),
	SubjectName_Day5 varchar(100),
	TeacherName_Day6 varchar(100),
	SubjectName_Day6 varchar(100)
)

Insert into #TempTimeTableData
(
	Period_ID,
	Period_Description,
	Period_TimeSlot,
	ClassSectionID
)
Select TTPERIOD_ID,
	   TTPERIOD_DESCTIPTION,
	   Replace(Replace(convert(varchar,TTPERIOD_START_TIME,0),'AM', ' AM'),'PM', ' PM')
	  + ' - '
	  +
	   Replace(Replace(convert(varchar,TTPERIOD_END_TIME,0),'AM', ' AM'),'PM', ' PM')
	   , Cl.CL_SEC_ID
    From TimeTablePeriodMaster ,
    ClassSectionDetail Cl
	Where TTPERIOD_TTSESSION_ID =@SessionID 
	And TTPERIOD_CMP_ID = @CompanyID 
		And TTPERIOD_SCH_ID = @SchoolID   
	And TTPERIOD_NUMBER<=@TotalPeriod  
	And CL.CL_CMP_ID = @CompanyID
	And CL.CL_SCH_ID = @SchoolID
	And TTPERIOD_SESSION = @SessionYear

Update #TempTimeTableData
Set ClassSectionName = CM_NAME +'-'+SM_NAME ,
ClassOrder = isnull(CM_ORDER_BY,0)
From ClassSectionDetail
Join ClassMaster
on CL_SEC_CM_ID = CM_ID
Join SectionMaster
On CL_SEC_SM_ID = SM_ID
Where CL_SEC_ID = ClassSectionID
	
	
---------------------Updating Teacher ID and Subject ID in Temp Table------
	
	Set @Counter = 1
	Declare 
	@Query varchar(5000)
	While @Counter <=6
	Begin
		Set @Query = '
		Update #TempTimeTableData 
		Set TeacherID_Day'+LTRIM(Str(@Counter))+'=  TTD.TTDETAIL_TEACHER_ID,
		SubjectID_Day'+LTRIM(Str(@Counter)) +'= TTD.TTDETAIL_SUB_ID 
		From TimeTableDetails TTD
		Where TTD.TTDETAIL_PERIOD_ID = #TempTimeTableData.Period_ID
		And TTD.TTDETAIL_SEC_ID = #TempTimeTableData.ClassSectionID
		And TTD.TTDETAIL_DAY_OF_WEEK ='+LTRIM(Str(@Counter))+'
		And TTD.TTDETAIL_SESSION_ID = '+LTRIM(Str(@SessionID))+'
		And TTD.TTDETAIL_CMP_ID  = '+LTRIM(Str(@CompanyID))+'
		And TTD.TTDETAIL_SCH_ID  = '+LTRIM(Str(@SchoolID))+'
		And TTD.TTDETAIL_SESSION  = '''+@SessionYear+''''
		Execute (@Query)
		
		-------------------Setting Teacher Name------------------------
		Set @Query = '
		Update #TempTimeTableData 
		Set TeacherName_Day'+LTRIM(Str(@Counter))+'=  isnull(EMP_SALUTATION,'''')+ TTD.EMP_FIRST_NAME +'' ''+TTD.EMP_LAST_NAME
		From EmpMaster TTD
		Where TTD.EMP_ID = #TempTimeTableData.TeacherID_Day'+LTRIM(Str(@Counter))+'
		And TTD.EMP_CMP_ID  = '+LTRIM(Str(@CompanyID))+'
		And TTD.EMP_SCH_ID  = '+LTRIM(Str(@SchoolID))
	
		--print @Query
		Execute (@Query)
		
		-------------------Setting Subject Name------------------------
		Set @Query = '
		Update #TempTimeTableData 
		Set SubjectName_Day'+LTRIM(Str(@Counter))+'=  TTD.SUB_NAME
		From SubjectMaster TTD
		Where TTD.SUB_ID = #TempTimeTableData.SubjectID_Day'+LTRIM(Str(@Counter))+'
		And TTD.SUB_CMP_ID  = '+LTRIM(Str(@CompanyID))+'
		And TTD.SUB_SCH_ID  = '+LTRIM(Str(@SchoolID))
	
		--print @Query
		Execute (@Query)
		
		Set @Counter = @Counter+1 
	End
	
	
	
	Select Period_ID ,
	Period_Description ,
	Period_TimeSlot ,
	ClassSectionID,
	ClassSectionName,
	ClassOrder,
	isnull(TeacherName_Day1,'') as TeacherName_Day1 ,
	isnull(SubjectName_Day1 ,'') as SubjectName_Day1 ,
	isnull(TeacherName_Day2 ,'')as TeacherName_Day2  ,
	isnull(SubjectName_Day2 ,'') as SubjectName_Day2 ,
	isnull(TeacherName_Day3,'') as TeacherName_Day3 ,
	isnull(SubjectName_Day3,'') as SubjectName_Day3 ,
	isnull(TeacherName_Day4,'') as TeacherName_Day4 ,
	isnull(SubjectName_Day4 ,'') as SubjectName_Day4 ,
	isnull(TeacherName_Day5 ,'') as TeacherName_Day5 ,
	isnull(SubjectName_Day5 ,'') as SubjectName_Day5 ,
	isnull(TeacherName_Day6 ,'') as TeacherName_Day6 ,
	isnull(SubjectName_Day6 ,'') as SubjectName_Day6 
	From #TempTimeTableData
	Order By ClassOrder,Period_ID
	Drop Table #TempTimeTableData
End


  







