	On STU_ATTENDH_CM_ID = CM_ID 
	Join ClassSectionDetail 
	On CL_SEC_CM_ID = STU_ATTENDH_CM_ID 
	And CL_SEC_ID = STU_ATTENDH_SEC_ID  
	Join SectionMaster 
	On SM_ID = CL_SEC_SM_ID 
	Where STU_ATTENDH_CM_ID = @ClassId 
	And STU_ATTENDH_SEC_ID = @SectionId 
	And STU_ATTENDH_CMP_ID = @CompanyID 
	And STU_ATTENDH_SCH_ID = @SchoolID 
	And CM_CMP_ID = @CompanyID 
	And CM_SCH_ID = @SchoolID 
	And CL_CMP_ID = @CompanyID 
	And CL_SCH_ID = @SchoolID 
   And Case When @DisplayRecord = -1 then
		1
	else
		STU_IS_ACTIVE
	End = 
	Case When @DisplayRecord = -1 then
		1
	else
		@DisplayRecord
	End 
		Set @dtStartDate=dateadd(d,1,@dtStartDate)
	   
	End  
	
Update #TempAttendanceDaily 
Set STU_ATTEND_STATUS = 0


	
if Exists(Select 'X' From StudentAttendanceDetailsHistory 
			  Where STU_ATTENDH_MONTH = @Month 
			  And STU_ATTENDH_Year = @Year 
			  And STU_ATTENDH_CM_ID = @ClassId 
			  And STU_ATTENDH_SEC_ID = @SectionId
			  And STU_ATTENDH_TIME = @AttendanceShift
			  )
	Begin 

			Update #TempAttendanceDaily
			Set STU_ATTEND_STATUS = ST_Attend.STU_ATTENDH_STATUS,
			STU_ATTEND_REASON_ID =  ST_Attend.STU_ATTENDH_REASON_ID,
			STU_ATTEND_ID = ST_Attend.STU_ATTENDH_ID
			From StudentAttendanceDetailsHistory ST_Attend
			Where #TempAttendanceDaily.STU_ATTEND_CM_ID = ST_Attend.STU_ATTENDH_CM_ID 
			And #TempAttendanceDaily.STU_ATTEND_SEC_ID = ST_Attend.STU_ATTENDH_SEC_ID 
			And #TempAttendanceDaily.STU_ATTEND_GUID = ST_Attend.STU_ATTENDH_GUID 
			And #TempAttendanceDaily.STU_ATTEND_YEAR  = ST_Attend.STU_ATTENDH_YEAR 
			And #TempAttendanceDaily.STU_ATTEND_MONTH  = ST_Attend.STU_ATTENDH_MONTH
			And Convert(varchar(4),year(#TempAttendanceDaily.STU_ATTEND_DATE))+'-'+Convert(varchar(2),month(#TempAttendanceDaily.STU_ATTEND_DATE))+'-'+Convert(varchar(2),day(#TempAttendanceDaily.STU_ATTEND_DATE))         
			   = Convert(varchar(4),year(ST_Attend.STU_ATTENDH_DATE))+'-'+Convert(varchar(2),month(ST_Attend.STU_ATTENDH_DATE))+'-'+Convert(varchar(2),day(ST_Attend.STU_ATTENDH_DATE))           
			And #TempAttendanceDaily.STU_ATTEND_TIME = ST_Attend.STU_ATTENDH_TIME
			And ST_Attend.STU_ATTENDH_TIME = @AttendanceShift  
			And ST_Attend.STU_ATTENDH_CMP_ID = @CompanyID 
			And ST_Attend.STU_ATTENDH_SCH_ID  = @SchoolID 
				
 
	End

	Select * From #TempAttendanceDaily
	Order BY STU_ATTEND_ROLL_NUMBER
	
	Drop table #TempAttendanceDaily


End



