--usp_getAttendanceReportData 9,2013,6,6,'PM'
CREATE Procedure [dbo].[usp_getAttendanceReportData]
@Month int,
@Year int,
@ClassId int,
@SectionId int,
@AttendanceShift varchar(10),
@CompanyID int,
@SchoolID int
As
Begin

Declare  
  @dtLastDate datetime,  
  @dtFirstDate datetime,  
  @dtStartDate datetime, 
  @IteratingDate datetime,
  @strQuery varchar(MAX), 
  @totaldays varchar(50)


---------------Creating Temporary Table to store the Attendance Details-------
  Create Table #TempAttendanceDaily  
 (  
	  STU_ATTEND_GUID uniqueIdentifier,
	  STU_ATTEND_FIRST_NAME varchar(50),
	  STU_ATTEND_LAST_NAME varchar(50),
	  STU_ATTEND_CM_ID	int,
	  STU_ATTEND_ROLL_NUMBER int,
	  STU_ATTEND_SEC_ID int,  
	  STU_ATTEND_CLASS varchar(50),  
	  STU_ATTEND_SECTION varchar(50),  
	  STU_ATTEND_TIME varchar(50),
	  Day1 varchar(1),  
	  Day2 varchar(1),  
	  Day3 varchar(1),  
	  Day4 varchar(1),  
	  Day5 varchar(1),  
	  Day6 varchar(1),  
	  Day7 varchar(1),  
	  Day8 varchar(1),  
	  Day9 varchar(1),  
	  Day10 varchar(1),  
	  Day11 varchar(1),  
	  Day12 varchar(1),  
	  Day13 varchar(1),  
	  Day14 varchar(1),  
	  Day15 varchar(1),  
	  Day16 varchar(1),  
	  Day17 varchar(1),  
	  Day18 varchar(1),  
	  Day19 varchar(1),  
	  Day20 varchar(1),  
	  Day21 varchar(1),  
	  Day22 varchar(1),  
	  Day23 varchar(1),  
	  Day24 varchar(1),  
	  Day25 varchar(1),  
	  Day26 varchar(1),  
	  Day27 varchar(1),  
	  Day28 varchar(1),  
	  Day29 varchar(1),  
	  Day30 varchar(1),  
	  Day31 varchar(1)  
 )  
 
 Create table #TempSundays
	(
		DayID int
	)
 
 CREATE TABLE #TempHolidayMaster
	(
		HOLIDAY_NAME [varchar](50) NULL,
		HOLIDAY_TYPE_ID [int] NULL,
		HOLIDAY_TYPE_NAME varchar(50),
		HOLIDAY_DATE [datetime] NOT NULL,
		HOLIDAY_MONTH int,
		HOLIDAY_YEAR int
	)
---Calculate the first date of processing month    
 Set @dtFirstDate =ltrim(str(@Month))+'/'+'1/'++ltrim(str(@Year))  
  
--Calculate last date of processing month    
    
Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtFirstDate)+1,0))
Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))

	-------------------Calculating Sundays in Month------------------------
	declare @date varchar(20)
	--@first day is used to find the first day name in a month
	declare @firstday varchar(50)
	declare @start int
	set @date=Ltrim(Str(@month))+'/'+'01'+'/'+Ltrim(Str(@year))
	
	--print @date
	
	set @totaldays = day(@dtLastDate)
	set @firstday = datename(dw,@date)

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0
	

	set @start=
	case @firstday when 'Monday'then 7
	when 'Tuesday' then 6
	when 'Wednesday'then 5
	when 'Thursday'then 4
	when 'Friday'then 3
	when 'Saturday'then 2
	else 1
	end
	while(@start<=@totaldays)
	begin
	Insert Into #TempSundays
	(
		DayID
	)
	Select @start
	set @start=@start+7
	end
	

------------------------------Calculating Month Holidays---------------------------	
	

Set @IteratingDate = Convert(Datetime,(Convert(Varchar(4),year(@dtFirstDate)) + '-' + Convert(Varchar(2),month(@dtFirstDate)) + '-' +Convert(Varchar(2),day(@dtFirstDate))))



--continue to loop until our iterating date is the same as the last date of month
--Select * from #TempLeaseMonthlyDaysData
	WHILE @IteratingDate <= @dtLastDate
	BEGIN

		--****************************Daily Performance Starts************************************
		-------------Insertinng KM Data records into temporary table DailyEquipmentPerformance---------
			Insert into #TempHolidayMaster
			(
				HOLIDAY_NAME,
				HOLIDAY_TYPE_ID,
				HOLIDAY_TYPE_NAME,
				HOLIDAY_DATE,
				HOLIDAY_MONTH,
				HOLIDAY_YEAR
				
			)
			Select	HOLIDAY_NAME,
					isnull(T.HOLIDAY_TYPE_ID,0),
					isnull(T.HOLIDAY_TYPE_NAME,''),
					@IteratingDate,
					month(@IteratingDate),
					Year(@IteratingDate)
			From HolidayMaster B
			Left Join HolidayTypeMaster T
			On B.HOLIDAY_TYPE_ID = T.HOLIDAY_TYPE_ID
			Where @IteratingDate
											 >=
												Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_FROM_DATE)) 
												+ '-' + Convert(Varchar(2),month(B.HOLIDAY_FROM_DATE)) 
												+ '-' +Convert(Varchar(2),day(B.HOLIDAY_FROM_DATE))) )
										
										and @IteratingDate
											<= 	Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_TO_DATE)) 
													+ '-' + Convert(Varchar(2),month(B.HOLIDAY_TO_DATE)) 
													+ '-' +Convert(Varchar(2),day(B.HOLIDAY_TO_DATE))) )
		
		And B.HOLIDAY_CMP_ID = @CompanyID 
		And B.HOLIDAY_SCH_ID = @SchoolID 
		And Case When @DisplayRecord = -1 then
			1
		else
			B.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		And Case When @DisplayRecord = -1 then
			1
		else
			T.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		---increase the value of our iterating date
		SET @IteratingDate = @IteratingDate + 1
	END
	

	
	
--Select * from #TempSundays
--Select * from #TempHolidayMaster

	

----------------------Populating the Temporary table to get the attendance details------

if Exists(Select 'X' From StudentAttendanceDetails 
			  Where STU_ATTEND_MONTH = @Month 
