			And STU_CMP_ID = @CompanyID 
			And STU_SCH_ID = @SchoolID 
			And Case When @DisplayRecord = -1 then
					1
				else
					StudentMaster.IS_ACTIVE
				End = 
				Case When @DisplayRecord = -1 then
					1
				else
					@DisplayRecord
				End 

	Update #TempAttendanceDaily
	Set  Day1 ='',  
	  Day2 ='',  
	  Day3 ='',  
	  Day4 ='',  
	  Day5 ='',  
	  Day6 ='',  
	  Day7 ='',  
	  Day8 ='',  
	  Day9 ='',  
	  Day10 ='',  
	  Day11 ='',  
	  Day12 ='',  
