	  Day26 ='',  
	  Day27 ='',  
	  Day28 ='',  
	  Day29 ='',  
	  Day30 ='',  
	  Day31 =''   


		Set  @dtStartDate = @dtFirstDate 
		While Convert(Datetime,(Convert(Varchar(4),year(@dtStartDate))   
				   + '-' + Convert(Varchar(2),month(@dtStartDate))   
				   + '-' +Convert(Varchar(2),day(@dtStartDate))) )  
			<=Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate))   
				   + '-' + Convert(Varchar(2),month(@dtLastDate))   
				   + '-' +Convert(Varchar(2),day(@dtLastDate))) )  
			Begin  
		  
				Set @StrQuery=''  
			
				if exists (Select 'X' From #TempSundays Where DayID = datepart(d,@dtStartDate))
					Begin
						
						Set @strQuery='Update #TempAttendanceDaily  
							Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''S'''
						
						exec (@strQuery)
					End
				else if exists (Select 'X' From #TempHolidayMaster Where datepart(d,HOLIDAY_DATE) = datepart(d,@dtStartDate))
					Begin
						Set @strQuery='Update #TempAttendanceDaily  
						Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''H'''
						
						exec (@strQuery)
					End
				Else
				Begin
					----------Set Present------
					 Set @strQuery='Update #TempAttendanceDaily  
					 Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''P''  
					  from StudentAttendanceDetails STAD  
					   Where STAD.STU_ATTEND_GUID = #TempAttendanceDaily.STU_ATTEND_GUID  
					   And STAD.STU_ATTEND_CM_ID = #TempAttendanceDaily.STU_ATTEND_CM_ID   
