					  And STAD.STU_ATTEND_TIME ='''+@AttendanceShift+'''
					   And  STAD.STU_ATTEND_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.STU_ATTEND_SCH_ID ='+Ltrim(Str(@SchoolID))
					--print @strQuery
					exec (@strQuery)  
		     
