					   And STAD.STU_ATTEND_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.STU_ATTEND_TIME ='''+@AttendanceShift+''' 
