					    And STAD.STU_ATTEND_SCH_ID ='+Ltrim(Str(@SchoolID))  
					--print @strQuery
					exec (@strQuery)
				End
				Set @dtStartDate=dateadd(d,1,@dtStartDate)   
			 End  
 
End

