					   And STAD.STU_ATTENDH_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.STU_ATTENDH_TIME ='''+@AttendanceShift+''' 
					  And  STAD.STU_ATTENDH_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.STU_ATTENDH_SCH_ID ='+Ltrim(Str(@SchoolID))  
					--print @strQuery
					exec (@strQuery)
				End
				Set @dtStartDate=dateadd(d,1,@dtStartDate)   
			 End  
 
	End

	Select * From #TempAttendanceDaily
	Order By STU_ATTEND_ROLL_NUMBER

	Drop table #TempSundays
	Drop table #TempHolidayMaster

End



