/****** Object:  StoredProcedure [dbo].[usp_getAttendanceSemSummaryReportData]    Script Date: 11-01-2025 14:40:06 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
--usp_getAttendanceSemSummaryReportData 2,2012,6,6,'AMPM',1,1
CREATE Procedure [dbo].[usp_getAttendanceSemSummaryReportData]
@Unit int,
@Year int,
@ClassId int,
@SectionId int,
@AttendanceShift varchar(10),
@CompanyID int,
@SchoolID int
As
Begin

Declare  
  @dtLastDate datetime,  
  @dtFirstDate datetime,  
  @dtStartDate datetime, 
  @IteratingDate datetime,
  @strQuery varchar(MAX), 
  @TotalDays int,
  @TotalWorkingDays int,
  @TotalHolidays int,
  @TotalSundays int,
  @d datetime


---------------Creating Temporary Table to store the Attendance Details-------
  Create Table #TempAttendanceDaily  
 (  
	  STU_ATTEND_GUID uniqueIdentifier,
	  STU_ATTEND_FIRST_NAME varchar(50),
	  STU_ATTEND_LAST_NAME varchar(50),
	  STU_ATTEND_CM_ID	int,
	  STU_ATTEND_ROLL_NUMBER int,
	  STU_ATTEND_SEC_ID int,  
	  STU_ATTEND_CLASS varchar(50),  
	  STU_ATTEND_SECTION varchar(50),  
	  STU_ATTEND_TIME varchar(50),
	  TotalWorkingDays int,  
	  TotalPresent int,  
	  TotalLeave int,
	  TotalAbsent int,
	  TotalHoliDays int,
	  TotalSundays int
 )  
 
 Create table #TempSundays
	(
		DayID int,
		DayMonth int,
		DayYear int
	)
 

 CREATE TABLE #TempHolidayMaster
	(
		HOLIDAY_NAME [varchar](50) NULL,
		HOLIDAY_TYPE_ID [int] NULL,
		HOLIDAY_TYPE_NAME varchar(50),
		HOLIDAY_DATE [datetime] NOT NULL,
		HOLIDAY_MONTH int,
		HOLIDAY_YEAR int
	)



CREATE TABLE #TempStudentAttendanceDetails
(
	[STU_ATTEND_ID] [int] NOT NULL,
	[STU_ATTEND_GUID] [uniqueidentifier] NOT NULL,
	[STU_ATTEND_CM_ID] [int] NOT NULL,
	[STU_ATTEND_SEC_ID] [int] NOT NULL,
	[STU_ATTEND_MONTH] [int] NULL,
	[STU_ATTEND_YEAR] [int] NULL,
	[STU_ATTEND_DATE] [datetime] NOT NULL,
	[STU_ATTEND_STATUS] [bit] NOT NULL,
	[STU_ATTEND_REASON_ID] [int] NULL,
	[STU_ATTEND_TIME] [varchar](50) NULL,
	[STU_ATTEND_CMP_ID] [int] NOT NULL,
	[STU_ATTEND_SCH_ID] [int] NOT NULL
)

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

---Calculate the first date of processing month    
if (@Unit = 1)
Begin
	  Set @dtFirstDate =ltrim(str(04))+'/'+'1/'++ltrim(str(2013))  
	  Set @dtLastDate = dateadd(MM,5,@dtFirstDate)
	  Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtLastDate)+1,0))
	  Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))
	  
	  


	select @d = @dtFirstDate  --'20090101'  if you want 2009 etc etc

	Insert Into #TempSundays
	(
		DayID,
		DayMonth,
		DayYear
	)
	Select Day(dateadd(dd,number,@d)),
	MONTH( dateadd(dd,number,@d)),
	YEAR(dateadd(dd,number,@d))
	From master..spt_values
	Where Type = 'p'
	and dateadd(dd,number,@d)<=@dtLastDate
	and DATEPART(dw,dateadd(dd,number,@d)) = 1
	  
 
End
if (@Unit = 2)
Begin
	 Set @dtFirstDate =ltrim(str(10))+'/'+'1/'++ltrim(str(@Year)) 
	 Set @dtLastDate = dateadd(MM,5,@dtFirstDate)
	 Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtLastDate)+1,0)) 
	 Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))
	 
	 select @d = @dtFirstDate  --'20090101'  if you want 2009 etc etc

	Insert Into #TempSundays
	(
		DayID,
		DayMonth,
		DayYear
	)
	Select Day(dateadd(dd,number,@d)),
	MONTH( dateadd(dd,number,@d)),
	YEAR(dateadd(dd,number,@d))
	From master..spt_values
	Where Type = 'p'
	and dateadd(dd,number,@d)<=@dtLastDate
	and DATEPART(dw,dateadd(dd,number,@d)) = 1
 
End

 
 
------------------------------Calculating Month Holidays---------------------------	
	

Set @IteratingDate = Convert(Datetime,(Convert(Varchar(4),year(@dtFirstDate)) + '-' + Convert(Varchar(2),month(@dtFirstDate)) + '-' +Convert(Varchar(2),day(@dtFirstDate))))



--continue to loop until our iterating date is the same as the last date of month
--Select * from #TempLeaseMonthlyDaysData
	WHILE @IteratingDate <= @dtLastDate
	BEGIN

		--****************************Daily Performance Starts************************************
		-------------Insertinng KM Data records into temporary table DailyEquipmentPerformance---------
			Insert into #TempHolidayMaster
			(
				HOLIDAY_NAME,
				HOLIDAY_TYPE_ID,
				HOLIDAY_TYPE_NAME,
				HOLIDAY_DATE,
				HOLIDAY_MONTH,
				HOLIDAY_YEAR
				
			)
			Select	HOLIDAY_NAME,
					isnull(T.HOLIDAY_TYPE_ID,0),
					isnull(T.HOLIDAY_TYPE_NAME,''),
					@IteratingDate,
					month(@IteratingDate),
					Year(@IteratingDate)
			From HolidayMaster B
			Left Join HolidayTypeMaster T
			On B.HOLIDAY_TYPE_ID = T.HOLIDAY_TYPE_ID
			Where @IteratingDate
											 >=
												Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_FROM_DATE)) 
												+ '-' + Convert(Varchar(2),month(B.HOLIDAY_FROM_DATE)) 
												+ '-' +Convert(Varchar(2),day(B.HOLIDAY_FROM_DATE))) )
										
										and @IteratingDate
											<= 	Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_TO_DATE)) 
													+ '-' + Convert(Varchar(2),month(B.HOLIDAY_TO_DATE)) 
													+ '-' +Convert(Varchar(2),day(B.HOLIDAY_TO_DATE))) )
		
		And B.HOLIDAY_CMP_ID = @CompanyID 
		And B.HOLIDAY_SCH_ID = @SchoolID 
		And Case When @DisplayRecord = -1 then
			1
		else
			B.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		And Case When @DisplayRecord = -1 then
			1
		else
			T.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		---increase the value of our iterating date
		SET @IteratingDate = @IteratingDate + 1
	END
	

	
Set @TotalDays = DATEDIFF(d,@dtFirstDate,@dtLastDate)+1

Set @TotalWorkingDays = @TotalDays - isnull((Select COUNT('X') From #TempSundays),0) 
Set @TotalHolidays = isnull((Select COUNT('X') From #TempHolidayMaster),0)

Set @TotalSundays = isnull((Select COUNT('X') From #TempSundays),0)



Insert Into #TempStudentAttendanceDetails
(
	[STU_ATTEND_ID]  ,
	[STU_ATTEND_GUID] ,
	[STU_ATTEND_CM_ID] ,
	[STU_ATTEND_SEC_ID] ,
	[STU_ATTEND_MONTH] ,
	[STU_ATTEND_YEAR] ,
	[STU_ATTEND_DATE] ,
	[STU_ATTEND_STATUS] ,
	[STU_ATTEND_REASON_ID] ,
	[STU_ATTEND_TIME] ,
	[STU_ATTEND_CMP_ID] ,
	[STU_ATTEND_SCH_ID] 
)
Select [STU_ATTEND_ID]  ,
	[STU_ATTEND_GUID] ,
	[STU_ATTEND_CM_ID] ,
	[STU_ATTEND_SEC_ID] ,
	[STU_ATTEND_MONTH] ,
	[STU_ATTEND_YEAR] ,
	[STU_ATTEND_DATE] ,
	[STU_ATTEND_STATUS] ,
	[STU_ATTEND_REASON_ID] ,
	[STU_ATTEND_TIME] ,
	[STU_ATTEND_CMP_ID] ,
	[STU_ATTEND_SCH_ID] 
		  from StudentAttendanceDetails STAD  
		   Where 
		    STAD.STU_ATTEND_Year = @Year 
		  And STAD.STU_ATTEND_CM_ID = @ClassId
		  And STAD.STU_ATTEND_SEC_ID = @SectionId
		  And STAD.STU_ATTEND_DATE >= @dtFirstDate
		  And STAD.STU_ATTEND_DATE<=@dtLastDate
		  And STAD.STU_ATTEND_TIME =@AttendanceShift
		  And STAD.STU_ATTEND_CMP_ID = @CompanyID 
		  And STAD.STU_ATTEND_SCH_ID  = @SchoolID  

Insert Into #TempStudentAttendanceDetails
(
	[STU_ATTEND_ID]  ,
	[STU_ATTEND_GUID] ,
	[STU_ATTEND_CM_ID] ,
	[STU_ATTEND_SEC_ID] ,
	[STU_ATTEND_MONTH] ,
	[STU_ATTEND_YEAR] ,
	[STU_ATTEND_DATE] ,
	[STU_ATTEND_STATUS] ,
	[STU_ATTEND_REASON_ID] ,
	[STU_ATTEND_TIME] ,
	[STU_ATTEND_CMP_ID] ,
	[STU_ATTEND_SCH_ID] 
)
Select [STU_ATTENDH_ID]  ,
	[STU_ATTENDH_GUID] ,
	[STU_ATTENDH_CM_ID] ,
	[STU_ATTENDH_SEC_ID] ,
	[STU_ATTENDH_MONTH] ,
	[STU_ATTENDH_YEAR] ,
	[STU_ATTENDH_DATE] ,
	[STU_ATTENDH_STATUS] ,
	[STU_ATTENDH_REASON_ID] ,
	[STU_ATTENDH_TIME] ,
	[STU_ATTENDH_CMP_ID] ,
	[STU_ATTENDH_SCH_ID] 
	from StudentAttendanceDetailsHistory STAD  
	   Where 
		STAD.STU_ATTENDH_Year = @Year 
	  And STAD.STU_ATTENDH_CM_ID = @ClassId
	  And STAD.STU_ATTENDH_SEC_ID = @SectionId
	  And STAD.STU_ATTENDH_DATE >= @dtFirstDate
	  And STAD.STU_ATTENDH_DATE<=@dtLastDate
	  And STAD.STU_ATTENDH_TIME =@AttendanceShift
	  And STAD.STU_ATTENDH_CMP_ID = @CompanyID 
	  And STAD.STU_ATTENDH_SCH_ID  = @SchoolID 	

	

------------------------Populating the Temporary table to get the attendance details------

	Insert Into #TempAttendanceDaily  
	(  
	  STU_ATTEND_GUID,  
	  STU_ATTEND_FIRST_NAME,
	  STU_ATTEND_LAST_NAME, 
	  STU_ATTEND_CM_ID	,
	  STU_ATTEND_SEC_ID ,  
	  STU_ATTEND_CLASS ,  
	  STU_ATTEND_SECTION ,  
	  STU_ATTEND_TIME ,
	  STU_ATTEND_ROLL_NUMBER
	)
	
	
	Select Distinct STU_GUID,
	  STU_FIRST_NAME,
	  STU_LAST_NAME,
	  STU_ATTEND_CM_ID,
	  STU_ATTEND_SEC_ID,
	  CM_NAME ,
	  SM_NAME ,
	  @AttendanceShift,
	  STU_ROLL_NUMBER 
	From 
	#TempStudentAttendanceDetails
	Join 
	StudentMaster 
	On STU_ATTEND_GUID = STU_GUID
	Join ClassMaster 
	On STU_ATTEND_CM_ID = CM_ID 
	Join ClassSectionDetail 
	On CL_SEC_CM_ID = STU_ATTEND_CM_ID 
	And CL_SEC_ID = STU_ATTEND_SEC_ID 
	Join SectionMaster 
	On SM_ID = CL_SEC_SM_ID 
	Where STU_ATTEND_CM_ID = @ClassId 
	And STU_ATTEND_SEC_ID = @SectionId 
	And STU_ATTEND_CMP_ID = @CompanyID 
	And STU_ATTEND_SCH_ID = @SchoolID 
	And Case When @DisplayRecord = -1 then
			1
		else
			STU_IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		

	Update #TempAttendanceDaily
	Set TotalWorkingDays  = 0,  
	TotalPresent  = 0,  
	TotalLeave  = 0,
	TotalAbsent =  0,
    TotalHoliDays = 0,
    TotalSundays  = 0
	  
	if (@AttendanceShift = 'AM' Or @AttendanceShift = 'PM')
	Begin
	
		Update #TempAttendanceDaily
		Set TotalWorkingDays  = @TotalWorkingDays ,  
		TotalPresent  = 0,  
		TotalLeave  = 0,
		TotalAbsent =  0,
		TotalHoliDays = @TotalHolidays,
		TotalSundays  = @TotalSundays 
	
	
	------------Set Present------
		Update #TempAttendanceDaily  
		 Set TotalPresent = isnull((Select COUNT('X')  
		  from #TempStudentAttendanceDetails STAD  
		   Where STAD.STU_ATTEND_GUID = #TempAttendanceDaily.STU_ATTEND_GUID  
		   And STAD.STU_ATTEND_CM_ID = #TempAttendanceDaily.STU_ATTEND_CM_ID   
		   And STAD.STU_ATTEND_SEC_ID =#TempAttendanceDaily.STU_ATTEND_SEC_ID
		   And STAD.STU_ATTEND_STATUS = 1
		  And STAD.STU_ATTEND_Year = @Year 
		  And STAD.STU_ATTEND_CM_ID = @ClassId
		  And STAD.STU_ATTEND_SEC_ID = @SectionId
		  And STAD.STU_ATTEND_DATE >= @dtFirstDate
		  And STAD.STU_ATTEND_DATE<=@dtLastDate
		  And STAD.STU_ATTEND_TIME =@AttendanceShift
		    And STAD.STU_ATTEND_CMP_ID = @CompanyID 
		  And STAD.STU_ATTEND_SCH_ID  = @SchoolID 
		  ),0)
		  
	------------Set Absent------
		Update #TempAttendanceDaily  
		 Set TotalAbsent = isnull((Select COUNT('X')  
		  from #TempStudentAttendanceDetails STAD
		  Join AttendanceReasonMaster  ARM
		  On STAD.STU_ATTEND_REASON_ID =  ARM.ATTEND_REASON_ID 
		   Where STAD.STU_ATTEND_GUID = #TempAttendanceDaily.STU_ATTEND_GUID  
		   And STAD.STU_ATTEND_CM_ID = #TempAttendanceDaily.STU_ATTEND_CM_ID   
		   And STAD.STU_ATTEND_SEC_ID =#TempAttendanceDaily.STU_ATTEND_SEC_ID
		   And STAD.STU_ATTEND_STATUS = 1
		  And STAD.STU_ATTEND_Year = @Year 
		  And STAD.STU_ATTEND_CM_ID = @ClassId
		  And STAD.STU_ATTEND_SEC_ID = @SectionId
		  And STAD.STU_ATTEND_DATE >= @dtFirstDate
		  And STAD.STU_ATTEND_DATE<=@dtLastDate
		  And STAD.STU_ATTEND_TIME =@AttendanceShift
		  And STAD.STU_ATTEND_REASON_ID is not null
		  And ARM.ATTEND_REASON_CODE ='A'
		    And STAD.STU_ATTEND_CMP_ID = @CompanyID 
		  And STAD.STU_ATTEND_SCH_ID  = @SchoolID 
		  ),0)

------------Set Leaves------
		Update #TempAttendanceDaily  
		 Set TotalLeave  = isnull((Select COUNT('X')  
		  from #TempStudentAttendanceDetails STAD
		  Join AttendanceReasonMaster  ARM
		  On STAD.STU_ATTEND_REASON_ID =  ARM.ATTEND_REASON_ID 
		   Where STAD.STU_ATTEND_GUID = #TempAttendanceDaily.STU_ATTEND_GUID  
		   And STAD.STU_ATTEND_CM_ID = #TempAttendanceDaily.STU_ATTEND_CM_ID   
		   And STAD.STU_ATTEND_SEC_ID =#TempAttendanceDaily.STU_ATTEND_SEC_ID
		   And STAD.STU_ATTEND_STATUS = 1
		  And STAD.STU_ATTEND_Year = @Year 
		  And STAD.STU_ATTEND_CM_ID = @ClassId
		  And STAD.STU_ATTEND_SEC_ID = @SectionId
		  And STAD.STU_ATTEND_DATE >= @dtFirstDate
		  And STAD.STU_ATTEND_DATE<=@dtLastDate
		  And STAD.STU_ATTEND_TIME =@AttendanceShift
		  And STAD.STU_ATTEND_REASON_ID is not null
		  And ARM.ATTEND_REASON_CODE <> 'A'
		    And STAD.STU_ATTEND_CMP_ID = @CompanyID 
		  And STAD.STU_ATTEND_SCH_ID  = @SchoolID 
		  ),0)
	
	End
	
	if (@AttendanceShift = 'AMPM')
	Begin
	
		Update #TempAttendanceDaily
		Set TotalWorkingDays  = @TotalWorkingDays*2 ,  
		TotalPresent  = 0,  
		TotalLeave  = 0,
		TotalAbsent =  0,
		TotalHoliDays = @TotalHolidays*2,
		TotalSundays  = @TotalSundays*2 
	
	
	------------Set Present------
		Update #TempAttendanceDaily  
		 Set TotalPresent = isnull((Select COUNT('X')  
		  from #TempStudentAttendanceDetails STAD  
		   Where STAD.STU_ATTEND_GUID = #TempAttendanceDaily.STU_ATTEND_GUID  
		   And STAD.STU_ATTEND_CM_ID = #TempAttendanceDaily.STU_ATTEND_CM_ID   
		   And STAD.STU_ATTEND_SEC_ID =#TempAttendanceDaily.STU_ATTEND_SEC_ID
		   And STAD.STU_ATTEND_STATUS = 1
		  And STAD.STU_ATTEND_Year = @Year 
		  And STAD.STU_ATTEND_CM_ID = @ClassId
		  And STAD.STU_ATTEND_SEC_ID = @SectionId
		  And STAD.STU_ATTEND_DATE >= @dtFirstDate
		  And STAD.STU_ATTEND_DATE<=@dtLastDate
		  --And STAD.STU_ATTEND_TIME =@AttendanceShift
		    And STAD.STU_ATTEND_CMP_ID = @CompanyID 
		  And STAD.STU_ATTEND_SCH_ID  = @SchoolID 
		  ),0)
		  
	------------Set Absent------
		Update #TempAttendanceDaily  
		 Set TotalAbsent = isnull((Select COUNT('X')  
		  from #TempStudentAttendanceDetails STAD
		  Join AttendanceReasonMaster  ARM
		  On STAD.STU_ATTEND_REASON_ID =  ARM.ATTEND_REASON_ID 
		   Where STAD.STU_ATTEND_GUID = #TempAttendanceDaily.STU_ATTEND_GUID  
		   And STAD.STU_ATTEND_CM_ID = #TempAttendanceDaily.STU_ATTEND_CM_ID   
		   And STAD.STU_ATTEND_SEC_ID =#TempAttendanceDaily.STU_ATTEND_SEC_ID
		   And STAD.STU_ATTEND_STATUS = 1
		  And STAD.STU_ATTEND_Year = @Year 
		  And STAD.STU_ATTEND_CM_ID = @ClassId
		  And STAD.STU_ATTEND_SEC_ID = @SectionId
		  And STAD.STU_ATTEND_DATE >= @dtFirstDate
		  And STAD.STU_ATTEND_DATE<=@dtLastDate
		  And STAD.STU_ATTEND_TIME =@AttendanceShift
		  --And STAD.STU_ATTEND_REASON_ID is not null
		  And ARM.ATTEND_REASON_CODE ='A'
		    And STAD.STU_ATTEND_CMP_ID = @CompanyID 
		  And STAD.STU_ATTEND_SCH_ID  = @SchoolID 
		  ),0)

------------Set Leaves------
		Update #TempAttendanceDaily  
		 Set TotalLeave  = isnull((Select COUNT('X')  
		  from #TempStudentAttendanceDetails STAD
		  Join AttendanceReasonMaster  ARM
		  On STAD.STU_ATTEND_REASON_ID =  ARM.ATTEND_REASON_ID 
		   Where STAD.STU_ATTEND_GUID = #TempAttendanceDaily.STU_ATTEND_GUID  
		   And STAD.STU_ATTEND_CM_ID = #TempAttendanceDaily.STU_ATTEND_CM_ID   
		   And STAD.STU_ATTEND_SEC_ID =#TempAttendanceDaily.STU_ATTEND_SEC_ID
		   And STAD.STU_ATTEND_STATUS = 1
		  And STAD.STU_ATTEND_Year = @Year 
		  And STAD.STU_ATTEND_CM_ID = @ClassId
		  And STAD.STU_ATTEND_SEC_ID = @SectionId
		  And STAD.STU_ATTEND_DATE >= @dtFirstDate
		  And STAD.STU_ATTEND_DATE<=@dtLastDate
		  And STAD.STU_ATTEND_TIME =@AttendanceShift
		  --And STAD.STU_ATTEND_REASON_ID is not null
		  And ARM.ATTEND_REASON_CODE <> 'A'
		    And STAD.STU_ATTEND_CMP_ID = @CompanyID 
		  And STAD.STU_ATTEND_SCH_ID  = @SchoolID 
		  ),0)
	
	End

--Select @TotalDays
--Select  @TotalWorkingDays
--Select @TotalHolidays
--Select * from #TempSundays
--Select * from #TempHolidayMaster
Select * from #TempAttendanceDaily
Order By STU_ATTEND_ROLL_NUMBER 


End


GO
/****** Object:  StoredProcedure [dbo].[usp_getClassMonthHolidaysList]    Script Date: 11-01-2025 14:40:06 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
