	  EMP_ATTEND_DATE 
		)  
		Select EMP_ID ,
		  EMP_FIRST_NAME,
		  EMP_LAST_NAME,
		  @AttendanceShift,
		  0,
		  @Month,
		  @Year,
		  @dtStartDate   
		From EmpMaster  
		
	
		Where 
	 EMP_CMP_ID = @CompanyID 
	And EMP_SCH_ID = @SchoolID 
	--And Case When @EmpCatID = 0 then
	--	0
	--else
	--	EMP_CAT_ID 
	--End = Case When @EmpCatID = 0 then
	--	0
	--else
	--	@EmpCatID 
	--End 
	And Case When @DisplayRecord = -1 then
		1
	else
		IS_ACTIVE
	End = 
	Case When @DisplayRecord = -1 then
		1
	else
		@DisplayRecord
	End 
	Set @dtStartDate=dateadd(d,1,@dtStartDate)
	   
	End  
Update #TempAttendanceDaily 
Set EMP_ATTEND_STATUS = 0


	if Exists(Select 'X' From EmpAttendanceDetails  
			  Where EMP_ATTEND_MONTH = @Month 
			  And EMP_ATTEND_Year = @Year
			  And EMP_ATTEND_TIME = @AttendanceShift 
			  ) 

	Begin 

			Update #TempAttendanceDaily
			Set EMP_ATTEND_STATUS = ST_Attend.EMP_ATTEND_STATUS,
			EMP_ATTEND_LEAVE_ID =  ST_Attend.EMP_ATTEND_LEAVE_ID,
			EMP_ATTEND_ID = ST_Attend.EMP_ATTEND_ID,
			EMP_ATTEND_IS_HALF_DAY = ST_Attend.EMP_ATTEND_IS_HALF_DAY
			From EmpAttendanceDetails ST_Attend
			Where 
			 #TempAttendanceDaily.EMP_ATTEND_EMP_ID  = ST_Attend.EMP_ATTEND_EMP_ID 
			And #TempAttendanceDaily.EMP_ATTEND_YEAR  = ST_Attend.EMP_ATTEND_YEAR 
			And #TempAttendanceDaily.EMP_ATTEND_MONTH  = ST_Attend.EMP_ATTEND_MONTH
			And Convert(varchar(4),year(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),month(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),day(#TempAttendanceDaily.EMP_ATTEND_DATE))         
			   = Convert(varchar(4),year(ST_Attend.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),month(ST_Attend.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),day(ST_Attend.EMP_ATTEND_DATE))           
			And #TempAttendanceDaily.EMP_ATTEND_TIME = ST_Attend.EMP_ATTEND_TIME
			And ST_Attend.EMP_ATTEND_TIME = @AttendanceShift  
			And ST_Attend.EMP_ATTEND_CMP_ID = @CompanyID 
			And ST_Attend.EMP_ATTEND_SCH_ID  = @SchoolID 
				
 
	End


	if exists (Select 'X' From #TempEmpLeavesAvailed)
	Begin
		
	Update #TempAttendanceDaily
			Set EMP_ATTEND_LEAVE_ID = ST_Attend.EMPLAD_LEAVE_TYPE_ID,
			EMP_ATTEND_IS_HALF_DAY =  ST_Attend.EMPLAD_IS_HALF_DAY
			From #TempEmpLeavesAvailed ST_Attend
			Where 
			 #TempAttendanceDaily.EMP_ATTEND_EMP_ID  = ST_Attend.EMPLAD_EMP_ID 
			 And Convert(varchar(4),year(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),month(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),day(#TempAttendanceDaily.EMP_ATTEND_DATE))         
			  = Convert(varchar(4),year(ST_Attend.EMPLAD_LEAVE_DATE))+'-'+Convert(varchar(2),month(ST_Attend.EMPLAD_LEAVE_DATE))+'-'+Convert(varchar(2),day(ST_Attend.EMPLAD_LEAVE_DATE))           
		
	End
	
	Select * From #TempAttendanceDaily
	Order BY EMP_ATTEND_EMP_ID 
	
	Drop table #TempAttendanceDaily
Drop table #TempEmpLeavesAvailed

End


