--usp_getEmpAttendanceRecordsHistory 10,2013,'AM',1,1
CREATE Procedure [dbo].[usp_getEmpAttendanceRecordsHistory]
@Month int,
@Year int,
@AttendanceShift varchar(10),
@CompanyID int,
@SchoolID int
As
Begin

Declare  
  @dtLastDate datetime,  
  @dtFirstDate datetime,  
  @dtStartDate datetime, 
  @IteratingDate datetime,
  @strQuery varchar(MAX) 
  ---Calculate the first date of processing month  
  Set @dtFirstDate =ltrim(str(@Month))+'/'+'1/'++ltrim(str(@Year))  
  Set @dtStartDate=@dtFirstDate  
 --Calculate last date of processing month  
  --Set @dtLastDate =ltrim(str(@Month))+'/'+'1/'++ltrim(str(@Year))  
  
  --Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtLastDate)+1,0))  

	Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtFirstDate)+1,0))
	Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))


CREATE TABLE #TempEmpLeavesAvailed
	(
		[EMPLAD_EMP_ID] [int] NOT NULL,
		[EMPLAD_LEAVE_TYPE_ID] [int] NOT NULL,
		[EMPLAD_LEAVE_DATE] [datetime] NOT NULL,
		[EMPLAD_IS_HALF_DAY] [bit] Not NULL,
		[EMPLAD_STATUS_ID] [int] NOT NULL,
		[EMPLAD_SESSION] [varchar](50) NULL,
		[EMPLAD_CMP_ID] [int] NOT NULL,
		[EMPLAD_SCH_ID] [int] NOT NULL
	)

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

Set @IteratingDate = Convert(Datetime,(Convert(Varchar(4),year(@dtFirstDate)) + '-' + Convert(Varchar(2),month(@dtFirstDate)) + '-' +Convert(Varchar(2),day(@dtFirstDate))))
--continue to loop until our iterating date is the same as the last date of month
--Select * from #TempLeaseMonthlyDaysData
	WHILE @IteratingDate <= @dtLastDate
	BEGIN

		--****************************Daily Performance Starts************************************
		-------------Insertinng KM Data records into temporary table DailyEquipmentPerformance---------
			Insert into #TempEmpLeavesAvailed
			(
				[EMPLAD_EMP_ID] ,
				[EMPLAD_LEAVE_TYPE_ID],
				[EMPLAD_LEAVE_DATE] ,
				[EMPLAD_IS_HALF_DAY] ,
				[EMPLAD_STATUS_ID] ,
				[EMPLAD_SESSION] ,
				[EMPLAD_CMP_ID] ,
				[EMPLAD_SCH_ID] 
				
			)
			Select	EMPLAD_EMP_ID,
					[EMPLAD_LEAVE_TYPE_ID],
						@IteratingDate,
					[EMPLAD_IS_HALF_DAY] ,
					[EMPLAD_STATUS_ID] ,
				[EMPLAD_SESSION] ,
				[EMPLAD_CMP_ID] ,
				[EMPLAD_SCH_ID] 
			From EmpLeaveAvailDetails B
			Where @IteratingDate
											 >=
												Convert(Datetime,(Convert(Varchar(4),year(B.EMPLAD_START_DATE)) 
												+ '-' + Convert(Varchar(2),month(B.EMPLAD_START_DATE)) 
												+ '-' +Convert(Varchar(2),day(B.EMPLAD_START_DATE))) )
										
										and @IteratingDate
											<= 	Convert(Datetime,(Convert(Varchar(4),year(B.EMPLAD_END_DATE)) 
													+ '-' + Convert(Varchar(2),month(B.EMPLAD_END_DATE)) 
													+ '-' +Convert(Varchar(2),day(B.EMPLAD_END_DATE))) )
		And B.EMPLAD_CMP_ID = @CompanyID 
		And B.EMPLAD_SCH_ID = @SchoolID 
		And B.EMPLAD_STATUS_ID = 2

		---increase the value of our iterating date
		SET @IteratingDate = @IteratingDate + 1
	END



--Select @dtFirstDate 
--Select @dtLastDate
---------------Creating Temporary Table to store the Attendance Details-------
  Create Table #TempAttendanceDaily  
 (  
	 EMP_ATTEND_EMP_ID int,
	 EMP_ATTEND_FIRST_NAME varchar(50),
	 EMP_ATTEND_LAST_NAME varchar(50),
	 EMP_ATTEND_TIME varchar(50),
	 EMP_ATTEND_ID int ,
	 EMP_ATTEND_MONTH int,
	 EMP_ATTEND_YEAR int,
	 EMP_ATTEND_DATE datetime,
	 EMP_ATTEND_STATUS bit,
	 EMP_ATTEND_LEAVE_ID int,
	 EMP_ATTEND_IS_HALF_DAY bit null
 )  


	

----------------------Populating the Temporary table to get the attendance details------

	While Convert(Datetime,(Convert(Varchar(4),year(@dtStartDate))   
				   + '-' + Convert(Varchar(2),month(@dtStartDate))   
				   + '-' +Convert(Varchar(2),day(@dtStartDate))) )  
			<=Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate))   
				   + '-' + Convert(Varchar(2),month(@dtLastDate))   
				   + '-' +Convert(Varchar(2),day(@dtLastDate))) )  
			Begin 
			
	Insert Into #TempAttendanceDaily    
		(  
	  EMP_ATTEND_EMP_ID,
	  EMP_ATTEND_FIRST_NAME ,
	  EMP_ATTEND_LAST_NAME ,
	  EMP_ATTEND_TIME ,
	  EMP_ATTEND_ID  ,
	  EMP_ATTEND_MONTH ,
	  EMP_ATTEND_YEAR ,
	  EMP_ATTEND_DATE 
		)  
		Select Distinct EMP_ID ,
		  EMP_FIRST_NAME,
		  EMP_LAST_NAME,
		  @AttendanceShift,
		  0,
		  @Month,
		  @Year,
		  @dtStartDate   
		From 
		EMPAttendanceDetailsHistory
		Join
		EmpMaster  
		ON EMP_ATTENDH_EMP_ID = EMP_ID
		Where 
		EMP_ATTENDH_CMP_ID = @CompanyID 
		And EMP_ATTENDH_SCH_ID = @SchoolID 
		And Case When @DisplayRecord = -1 then
			1
		else
			EmpMaster.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
	End 
	Set @dtStartDate=dateadd(d,1,@dtStartDate)
	   
	End  
Update #TempAttendanceDaily 
Set EMP_ATTEND_STATUS = 0


	if Exists(Select 'X' From EMPAttendanceDetailsHistory 
			  Where EMP_ATTENDH_MONTH = @Month 
			  And EMP_ATTENDH_Year = @Year
			  And EMP_ATTENDH_TIME = @AttendanceShift  
			  And EMP_ATTENDH_CMP_ID = @CompanyID
			  And EMP_ATTENDH_SCH_ID = @SchoolID
			 )

	Begin 

			Update #TempAttendanceDaily
			Set EMP_ATTEND_STATUS = ST_Attend.EMP_ATTENDH_STATUS,
			EMP_ATTEND_LEAVE_ID =  ST_Attend.EMP_ATTENDH_LEAVE_ID,
			EMP_ATTEND_ID = ST_Attend.EMP_ATTENDH_ID,
			EMP_ATTEND_IS_HALF_DAY = ST_Attend.EMP_ATTENDH_IS_HALF_DAY
			From EMPAttendanceDetailsHistory ST_Attend
			Where 
			 #TempAttendanceDaily.EMP_ATTEND_EMP_ID  = ST_Attend.EMP_ATTENDH_EMP_ID 
			And #TempAttendanceDaily.EMP_ATTEND_YEAR  = ST_Attend.EMP_ATTENDH_YEAR 
			And #TempAttendanceDaily.EMP_ATTEND_MONTH  = ST_Attend.EMP_ATTENDH_MONTH
			And Convert(varchar(4),year(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),month(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),day(#TempAttendanceDaily.EMP_ATTEND_DATE))         
			   = Convert(varchar(4),year(ST_Attend.EMP_ATTENDH_DATE))+'-'+Convert(varchar(2),month(ST_Attend.EMP_ATTENDH_DATE))+'-'+Convert(varchar(2),day(ST_Attend.EMP_ATTENDH_DATE))           
			And #TempAttendanceDaily.EMP_ATTEND_TIME = ST_Attend.EMP_ATTENDH_TIME
			And ST_Attend.EMP_ATTENDH_TIME = @AttendanceShift  
			And ST_Attend.EMP_ATTENDH_CMP_ID = @CompanyID 
			And ST_Attend.EMP_ATTENDH_SCH_ID  = @SchoolID 
				
 
	End


	if exists (Select 'X' From #TempEmpLeavesAvailed)
	Begin
		
	Update #TempAttendanceDaily
			Set EMP_ATTEND_LEAVE_ID = ST_Attend.EMPLAD_LEAVE_TYPE_ID,
			EMP_ATTEND_IS_HALF_DAY =  ST_Attend.EMPLAD_IS_HALF_DAY
			From #TempEmpLeavesAvailed ST_Attend
			Where 
			 #TempAttendanceDaily.EMP_ATTEND_EMP_ID  = ST_Attend.EMPLAD_EMP_ID 
			 And Convert(varchar(4),year(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),month(#TempAttendanceDaily.EMP_ATTEND_DATE))+'-'+Convert(varchar(2),day(#TempAttendanceDaily.EMP_ATTEND_DATE))         
			  = Convert(varchar(4),year(ST_Attend.EMPLAD_LEAVE_DATE))+'-'+Convert(varchar(2),month(ST_Attend.EMPLAD_LEAVE_DATE))+'-'+Convert(varchar(2),day(ST_Attend.EMPLAD_LEAVE_DATE))           
		
	End
	
	Select * From #TempAttendanceDaily
	Order BY EMP_ATTEND_EMP_ID 
	
	Drop table #TempAttendanceDaily
Drop table #TempEmpLeavesAvailed

End


GO
