--usp_getEmpAttendanceReportData 8,2013,3,'AM',1,1
CREATE Procedure [dbo].[usp_getEmpAttendanceReportData]
@Month int,
@Year int,
@DeptId int,
@AttendanceShift varchar(10),
@CompanyID int,
@SchoolID int
As
Begin

Declare  
  @dtLastDate datetime,  
  @dtFirstDate datetime,  
  @dtStartDate datetime, 
  @IteratingDate datetime,
  @strQuery varchar(MAX), 
  @totaldays varchar(50)


---------------Creating Temporary Table to store the Attendance Details-------
  Create Table #TempAttendanceDaily  
 (  
	  EMP_ID int,
	  EMP_NAME varchar(100),
	  EMP_DESIG varchar(100),
	  EMP_GRADE	varchar(100),
	  EMP_ATTEND_TIME varchar(50),
	  EMP_DEPT_ID int,
	  Day1 varchar(10),  
	  Day2 varchar(10),  
	  Day3 varchar(10),  
	  Day4 varchar(10),  
	  Day5 varchar(10),  
	  Day6 varchar(10),  
	  Day7 varchar(10),  
	  Day8 varchar(10),  
	  Day9 varchar(10),  
	  Day10 varchar(10),  
	  Day11 varchar(10),  
	  Day12 varchar(10),  
	  Day13 varchar(10),  
	  Day14 varchar(10),  
	  Day15 varchar(10),  
	  Day16 varchar(10),  
	  Day17 varchar(10),  
	  Day18 varchar(10),  
	  Day19 varchar(10),  
	  Day20 varchar(10),  
	  Day21 varchar(10),  
	  Day22 varchar(10),  
	  Day23 varchar(10),  
	  Day24 varchar(10),  
	  Day25 varchar(10),  
	  Day26 varchar(10),  
	  Day27 varchar(10),  
	  Day28 varchar(10),  
	  Day29 varchar(10),  
	  Day30 varchar(10),  
	  Day31 varchar(10)  
 )  
 
 Create table #TempSundays
	(
		DayID int
	)
 
 CREATE TABLE #TempHolidayMaster
	(
		HOLIDAY_NAME [varchar](50) NULL,
		HOLIDAY_TYPE_ID [int] NULL,
		HOLIDAY_TYPE_NAME varchar(50),
		HOLIDAY_DATE [datetime] NOT NULL,
		HOLIDAY_MONTH int,
		HOLIDAY_YEAR int,
		HOLIDAY_DEPT_ID int
	)
---Calculate the first date of processing month    
 Set @dtFirstDate =ltrim(str(@Month))+'/'+'1/'++ltrim(str(@Year))  
  
--Calculate last date of processing month    
    
Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtFirstDate)+1,0))
Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))

	-------------------Calculating Sundays in Month------------------------
	declare @date varchar(20)
	--@first day is used to find the first day name in a month
	declare @firstday varchar(50)
	declare @start int
	set @date=Ltrim(Str(@month))+'/'+'01'+'/'+Ltrim(Str(@year))
	
	--print @date
	
	set @totaldays = day(@dtLastDate)
	set @firstday = datename(dw,@date)

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

	

	set @start=
	case @firstday when 'Monday'then 7
	when 'Tuesday' then 6
	when 'Wednesday'then 5
	when 'Thursday'then 4
	when 'Friday'then 3
	when 'Saturday'then 2
	else 1
	end
	while(@start<=@totaldays)
	begin
	Insert Into #TempSundays
	(
		DayID
	)
	Select @start
	set @start=@start+7
	end
	

------------------------------Calculating Month Holidays---------------------------	
	

Set @IteratingDate = Convert(Datetime,(Convert(Varchar(4),year(@dtFirstDate)) + '-' + Convert(Varchar(2),month(@dtFirstDate)) + '-' +Convert(Varchar(2),day(@dtFirstDate))))



--continue to loop until our iterating date is the same as the last date of month
--Select * from #TempLeaseMonthlyDaysData
	WHILE @IteratingDate <= @dtLastDate
	BEGIN

		--****************************Daily Performance Starts************************************
		-------------Insertinng KM Data records into temporary table DailyEquipmentPerformance---------
			Insert into #TempHolidayMaster
			(
				HOLIDAY_NAME,
				HOLIDAY_TYPE_ID,
				HOLIDAY_TYPE_NAME,
				HOLIDAY_DATE,
				HOLIDAY_MONTH,
				HOLIDAY_YEAR,
				HOLIDAY_DEPT_ID
				
			)
			Select	HOLIDAY_NAME,
					isnull(T.HOLIDAY_TYPE_ID,0),
					isnull(T.HOLIDAY_TYPE_NAME,''),
					@IteratingDate,
					month(@IteratingDate),
					Year(@IteratingDate),
					D.HDEPT_DEPT_ID
			From HolidayMaster B
			Join HolidayDeptDetails D
			On D.HDEPT_HOLIDAY_ID = B.HOLIDAY_ID
			Left Join HolidayTypeMaster T
			On B.HOLIDAY_TYPE_ID = T.HOLIDAY_TYPE_ID
			Where @IteratingDate
											 >=
												Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_FROM_DATE)) 
												+ '-' + Convert(Varchar(2),month(B.HOLIDAY_FROM_DATE)) 
												+ '-' +Convert(Varchar(2),day(B.HOLIDAY_FROM_DATE))) )
										
										and @IteratingDate
											<= 	Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_TO_DATE)) 
													+ '-' + Convert(Varchar(2),month(B.HOLIDAY_TO_DATE)) 
													+ '-' +Convert(Varchar(2),day(B.HOLIDAY_TO_DATE))) )
		
		And B.HOLIDAY_CMP_ID = @CompanyID 
		And B.HOLIDAY_SCH_ID = @SchoolID 
		And isnull(B.HOLIDAY_IS_STAFF_APPLICABLE,0) = 1 
		And Case When @DisplayRecord = -1 then
			1
		else
			B.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		And Case When @DisplayRecord = -1 then
			1
		else
			T.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
		---increase the value of our iterating date
		SET @IteratingDate = @IteratingDate + 1
	END
	

	
	
--Select * from #TempSundays
--Select * from #TempHolidayMaster

	

----------------------Populating the Temporary table to get the attendance details------

if Exists(Select 'X' From EmpAttendanceDetails
			  Where EMP_ATTEND_MONTH  = @Month 
			  And EMP_ATTEND_YEAR  = @Year 
			  And EMP_ATTEND_CMP_ID  = @CompanyID 
			  And EMP_ATTEND_SCH_ID = @SchoolID 
			  )

	Begin 
	Insert Into #TempAttendanceDaily  
	(  
	  EMP_ID,
	  EMP_NAME,
	  EMP_DESIG , 
	  EMP_GRADE,
	  EMP_ATTEND_TIME,
	  EMP_DEPT_ID 
	)
	
	Select Distinct EMP_ID,
	  EMP_FIRST_NAME+ ' '+ISNULL(EMP_LAST_NAME,'') ,
	  DESIG_NAME,
	  GRADE_NAME,
	  
	  @AttendanceShift,
	  EMP_DEPT_ID
	
	From EmpAttendanceDetails
	Join 
	
	EmpMaster  
	On EMP_ID = EMP_ATTEND_EMP_ID
	Join 
	DeptMaster 
	On EMP_DEPT_ID = DEPT_ID 
	Join DeptDesigDetails DS
	On DS.DEPDES_ID = EMP_DESIG_ID 
	Join DesigMaster 
	On DS.DEPDES_DESIG_ID = DESIG_ID 
	Join DesigGradeDetails DG
	On DG.DESGRADE_ID = EMP_GRADE_ID 
	Join GradeMaster 
	On GRADE_ID = DG.DESGRADE_GRADE_ID 
	
	Where EMP_DEPT_ID = @DeptId  
	And EMP_ATTEND_CMP_ID  = @CompanyID 
	And EMP_ATTEND_SCH_ID  = @SchoolID 
	And Case When @DisplayRecord = -1 then
		1
	else
		EmpMaster.IS_ACTIVE
	End = 
	Case When @DisplayRecord = -1 then
		1
	else
		@DisplayRecord
	End 
	
	Update #TempAttendanceDaily
	Set  Day1 ='',  
	  Day2 ='',  
	  Day3 ='',  
	  Day4 ='',  
	  Day5 ='',  
	  Day6 ='',  
	  Day7 ='',  
	  Day8 ='',  
	  Day9 ='',  
	  Day10 ='',  
	  Day11 ='',  
	  Day12 ='',  
	  Day13 ='',  
	  Day14 ='',  
	  Day15 ='',  
	  Day16 ='',  
	  Day17 ='',  
	  Day18 ='',  
	  Day19 ='',  
	  Day20 ='',  
	  Day21 ='',  
	  Day22 ='',  
	  Day23 ='',  
	  Day24 ='',  
	  Day25 ='',  
	  Day26 ='',  
	  Day27 ='',  
	  Day28 ='',  
	  Day29 ='',  
	  Day30 ='',  
	  Day31 =''   



		Set  @dtStartDate = @dtFirstDate 
			While Convert(Datetime,(Convert(Varchar(4),year(@dtStartDate))   
				   + '-' + Convert(Varchar(2),month(@dtStartDate))   
				   + '-' +Convert(Varchar(2),day(@dtStartDate))) )  
			<=Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate))   
				   + '-' + Convert(Varchar(2),month(@dtLastDate))   
				   + '-' +Convert(Varchar(2),day(@dtLastDate))) )  
			Begin  
		  
				Set @StrQuery=''  
			
				if exists (Select 'X' From #TempSundays Where DayID = datepart(d,@dtStartDate))
					Begin
						
						Set @strQuery='Update #TempAttendanceDaily  
							Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''S'''
						
						exec (@strQuery)
					End
				else if exists (Select 'X' From #TempHolidayMaster Where datepart(d,HOLIDAY_DATE) = datepart(d,@dtStartDate) And HOLIDAY_DEPT_ID = @DeptId)
					Begin
						Set @strQuery='Update #TempAttendanceDaily  
						Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''H''
						From #TempHolidayMaster
						Where EMP_DEPT_ID = HOLIDAY_DEPT_ID'
						
						exec (@strQuery)
					End
				Else
				Begin
					----------Set Present------
					 Set @strQuery='Update #TempAttendanceDaily  
					 Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''P''  
					  from EmpAttendanceDetails STAD  
					   Where STAD.EMP_ATTEND_EMP_ID= #TempAttendanceDaily.EMP_ID  
					   And STAD.EMP_ATTEND_STATUS = 1
					   And STAD.EMP_ATTEND_MONTH = '+Ltrim(Str(@Month))+' 
					  And STAD.EMP_ATTEND_Year = '+Ltrim(Str(@Year))+' 
					   And STAD.EMP_ATTEND_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.EMP_ATTEND_TIME ='''+@AttendanceShift+'''
					   And  STAD.EMP_ATTEND_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.EMP_ATTEND_SCH_ID ='+Ltrim(Str(@SchoolID))
					--print @strQuery
					exec (@strQuery)  
		     
		     Set @strQuery='Update #TempAttendanceDaily  
					 Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''A''  
					  from EmpAttendanceDetails STAD  
					   Where STAD.EMP_ATTEND_EMP_ID= #TempAttendanceDaily.EMP_ID  
					   And STAD.EMP_ATTEND_STATUS = 0
					   And STAD.EMP_ATTEND_LEAVE_ID is null
					   And STAD.EMP_ATTEND_MONTH = '+Ltrim(Str(@Month))+' 
					  And STAD.EMP_ATTEND_Year = '+Ltrim(Str(@Year))+' 
					   And STAD.EMP_ATTEND_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.EMP_ATTEND_TIME ='''+@AttendanceShift+'''
					   And  STAD.EMP_ATTEND_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.EMP_ATTEND_SCH_ID ='+Ltrim(Str(@SchoolID))
					--print @strQuery
					exec (@strQuery)  
		     
					--------Set Absent Status------
					 Set @strQuery='Update #TempAttendanceDaily  
					 Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=isnull(LT.LEAVE_TYPE_CODE,'''')  
					  from EmpAttendanceDetails STAD
					  Join EmpLeaveAvailDetails ELAD
					  On  ELAD.EMPLAD_ID = isnull(EMP_ATTEND_LEAVE_ID,0)
					  Join LeaveTypeMaster LT
					  On ELAD.EMPLAD_LEAVE_TYPE_ID = LT.LEAVE_TYPE_ID
					    
					  Where STAD.EMP_ATTEND_EMP_ID= #TempAttendanceDaily.EMP_ID 
					 
					   And STAD.EMP_ATTEND_STATUS = 0
					   And STAD.EMP_ATTEND_MONTH = '+Ltrim(Str(@Month))+' 
					  And STAD.EMP_ATTEND_Year = '+Ltrim(Str(@Year))+' 
					   And STAD.EMP_ATTEND_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.EMP_ATTEND_TIME ='''+@AttendanceShift+'''
					   And  STAD.EMP_ATTEND_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.EMP_ATTEND_SCH_ID ='+Ltrim(Str(@SchoolID))  
				--	print @strQuery
					exec (@strQuery)
				End
				Set @dtStartDate=dateadd(d,1,@dtStartDate)   
			 End  
 
	End



if Exists(Select 'X' From EmpAttendanceDetailsHistory
			  Where EMP_ATTENDH_MONTH  = @Month 
			  And EMP_ATTENDH_YEAR  = @Year 
			  And EMP_ATTENDH_CMP_ID  = @CompanyID 
			  And EMP_ATTENDH_SCH_ID = @SchoolID 
			  )

	Begin 
	Insert Into #TempAttendanceDaily  
	(  
	  EMP_ID,
	  EMP_NAME,
	  EMP_DESIG , 
	  EMP_GRADE,
	  EMP_ATTEND_TIME,
	  EMP_DEPT_ID 
	)
	
	Select Distinct EMP_ID,
	  EMP_FIRST_NAME+ ' '+ISNULL(EMP_LAST_NAME,'') ,
	  DESIG_NAME,
	  GRADE_NAME,
	  
	  @AttendanceShift,
	  EMP_DEPT_ID
	
	From EmpAttendanceDetailsHistory
	Join 
	
	EmpMaster  
	On EMP_ID = EMP_ATTENDH_EMP_ID
	Join 
	DeptMaster 
	On EMP_DEPT_ID = DEPT_ID 
	Join DeptDesigDetails DS
	On DS.DEPDES_ID = EMP_DESIG_ID 
	Join DesigMaster 
	On DS.DEPDES_DESIG_ID = DESIG_ID 
	Join DesigGradeDetails DG
	On DG.DESGRADE_ID = EMP_GRADE_ID 
	Join GradeMaster 
	On GRADE_ID = DG.DESGRADE_GRADE_ID 
	
	Where EMP_DEPT_ID = @DeptId  
	And EMP_ATTENDH_CMP_ID  = @CompanyID 
	And EMP_ATTENDH_SCH_ID  = @SchoolID 
	And Case When @DisplayRecord = -1 then
		1
	else
		EmpMaster.IS_ACTIVE
	End = 
	Case When @DisplayRecord = -1 then
		1
	else
		@DisplayRecord
	End 
	
	Update #TempAttendanceDaily
	Set  Day1 ='',  
	  Day2 ='',  
	  Day3 ='',  
	  Day4 ='',  
	  Day5 ='',  
	  Day6 ='',  
	  Day7 ='',  
	  Day8 ='',  
	  Day9 ='',  
	  Day10 ='',  
	  Day11 ='',  
	  Day12 ='',  
	  Day13 ='',  
	  Day14 ='',  
	  Day15 ='',  
	  Day16 ='',  
	  Day17 ='',  
	  Day18 ='',  
	  Day19 ='',  
	  Day20 ='',  
	  Day21 ='',  
	  Day22 ='',  
	  Day23 ='',  
	  Day24 ='',  
	  Day25 ='',  
	  Day26 ='',  
	  Day27 ='',  
	  Day28 ='',  
	  Day29 ='',  
	  Day30 ='',  
	  Day31 =''   



		Set  @dtStartDate = @dtFirstDate 
			While Convert(Datetime,(Convert(Varchar(4),year(@dtStartDate))   
				   + '-' + Convert(Varchar(2),month(@dtStartDate))   
				   + '-' +Convert(Varchar(2),day(@dtStartDate))) )  
			<=Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate))   
				   + '-' + Convert(Varchar(2),month(@dtLastDate))   
				   + '-' +Convert(Varchar(2),day(@dtLastDate))) )  
			Begin  
		  
				Set @StrQuery=''  
			
				if exists (Select 'X' From #TempSundays Where DayID = datepart(d,@dtStartDate))
					Begin
						
						Set @strQuery='Update #TempAttendanceDaily  
							Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''S'''
						
						exec (@strQuery)
					End
				else if exists (Select 'X' From #TempHolidayMaster Where datepart(d,HOLIDAY_DATE) = datepart(d,@dtStartDate) And HOLIDAY_DEPT_ID = @DeptId)
					Begin
						Set @strQuery='Update #TempAttendanceDaily  
						Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''H''
						From #TempHolidayMaster
						Where EMP_DEPT_ID = HOLIDAY_DEPT_ID'
						
						exec (@strQuery)
					End
				Else
				Begin
					----------Set Present------
					 Set @strQuery='Update #TempAttendanceDaily  
					 Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''P''  
					  from EmpAttendanceDetailsHistory STAD  
					   Where STAD.EMP_ATTENDH_EMP_ID= #TempAttendanceDaily.EMP_ID  
					   And STAD.EMP_ATTENDH_STATUS = 1
					   And STAD.EMP_ATTENDH_MONTH = '+Ltrim(Str(@Month))+' 
					  And STAD.EMP_ATTENDH_Year = '+Ltrim(Str(@Year))+' 
					   And STAD.EMP_ATTENDH_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.EMP_ATTENDH_TIME ='''+@AttendanceShift+'''
					   And  STAD.EMP_ATTENDH_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.EMP_ATTENDH_SCH_ID ='+Ltrim(Str(@SchoolID))
					--print @strQuery
					exec (@strQuery)  
		     
		     Set @strQuery='Update #TempAttendanceDaily  
					 Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=''A''  
					  from EmpAttendanceDetailsHistory STAD  
					   Where STAD.EMP_ATTENDH_EMP_ID= #TempAttendanceDaily.EMP_ID  
					   And STAD.EMP_ATTENDH_STATUS = 0
					   And STAD.EMP_ATTENDH_LEAVE_ID is null
					   And STAD.EMP_ATTENDH_MONTH = '+Ltrim(Str(@Month))+' 
					  And STAD.EMP_ATTENDH_Year = '+Ltrim(Str(@Year))+' 
					   And STAD.EMP_ATTENDH_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.EMP_ATTENDH_TIME ='''+@AttendanceShift+'''
					   And  STAD.EMP_ATTENDH_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.EMP_ATTENDH_SCH_ID ='+Ltrim(Str(@SchoolID))
					--print @strQuery
					exec (@strQuery)  
		     
					--------Set Absent Status------
					 Set @strQuery='Update #TempAttendanceDaily  
					 Set day'+ltrim(str(datepart(d,@dtStartDate)))+'=isnull(LT.LEAVE_TYPE_CODE,'''')  
					  from EmpAttendanceDetailsHistory STAD
					  Join EmpLeaveAvailDetails ELAD
					  On  ELAD.EMPLAD_ID = isnull(EMP_ATTENDH_LEAVE_ID,0)
					  Join LeaveTypeMaster LT
					  On ELAD.EMPLAD_LEAVE_TYPE_ID = LT.LEAVE_TYPE_ID
					    
					  Where STAD.EMP_ATTENDH_EMP_ID= #TempAttendanceDaily.EMP_ID 
					 
					   And STAD.EMP_ATTENDH_STATUS = 0
					   And STAD.EMP_ATTENDH_MONTH = '+Ltrim(Str(@Month))+' 
					  And STAD.EMP_ATTENDH_Year = '+Ltrim(Str(@Year))+' 
					   And STAD.EMP_ATTENDH_DATE = '''+Convert(varchar(4),year(@dtStartDate))+'-'+Convert(varchar(2),month(@dtStartDate))+'-'+Convert(varchar(2),day(@dtStartDate)) +'''
					  And STAD.EMP_ATTENDH_TIME ='''+@AttendanceShift+'''
					   And  STAD.EMP_ATTENDH_CMP_ID ='+Ltrim(Str(@CompanyID))+'
					    And STAD.EMP_ATTENDH_SCH_ID ='+Ltrim(Str(@SchoolID))  
					--print @strQuery
					exec (@strQuery)
				End
				Set @dtStartDate=dateadd(d,1,@dtStartDate)   
			 End  
 
	End

	Select EMP_ID ,
	  EMP_NAME ,
	  EMP_DESIG ,
	  EMP_GRADE	,
	  EMP_ATTEND_TIME,
	
	  Day1 ,  
	  Day2 ,  
	  Day3 ,  
	  Day4 ,  
	  Day5 ,  
	  Day6 ,  
	  Day7 ,  
	  Day8 ,  
	  Day9 ,  
	  Day10,  
	  Day11,  
	  Day12,  
	  Day13,  
	  Day14,  
	  Day15,  
	  Day16,  
	  Day17,  
	  Day18,  
	  Day19,  
	  Day20,  
	  Day21,  
	  Day22,  
	  Day23 ,  
	  Day24 ,  
	  Day25 ,  
	  Day26 ,  
	  Day27 ,  
	  Day28 ,  
	  Day29 ,  
	  Day30 ,  
	  Day31 
	     From #TempAttendanceDaily
	Order By EMP_ID 

	Drop table #TempSundays
	Drop table #TempHolidayMaster

End


