GO









--usp_GetFeesDefaultersChartData 1,1,05,2013
CREATE Procedure [dbo].[usp_GetFeesDefaultersChartData]
@CompanyID int,
@SchoolID int
As
Begin


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

Select 
  CM_NAME as ClassName,
  COUNT(Distinct STU_GUID) as TotalStudents
	From StudentFeeDetails 
	Join StudentMaster
	On STUDFEE_STU_GUID = STU_GUID  
	Join ClassMaster 
	On STUDFEE_CM_ID = CM_ID 
	Join ClassSectionDetail en
	On STU_SEC_ID = en.CL_SEC_ID 
		JOin FeesCategoryMaster  FCM
	On FCM.FCM_ID = STUD_FEE_CAT_ID
	Where STUD_FEES_PAID = 0
	And STUD_CMP_ID = @CompanyID 
	And STUD_SCH_ID = @SchoolID 
	and STU_CMP_ID = @CompanyID 
	And STU_SCH_ID = @SchoolID 
	And FCM.FCM_CAT_CMP_ID = @CompanyID 
	and FCM.FCM_CAT_SCH_ID = @SchoolID 
	And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
	Group By CM_NAME
	Order By CM_NAME

End









