--usp_GetFeesPaidList '2013-09-18',1,1
CREATE Procedure [dbo].[usp_GetFeesPaidList]
@FeesPaidDate datetime,
@CompanyID int,
@SchoolID int
As
Begin


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

	   Select 
      [STUDFEE_STU_GUID] as STUD_GUID
      ,[STUD_FEE_DUE_DATE]
      ,[STUD_FEE_DATE]
      ,isnull(Sum([STUD_FEE_AMOUNT]),0) as STUD_FEE_AMOUNT
      ,isnull(Sum([STUD_LATE_FEE_AMOUNT]),0) as STUD_LATE_FEE_AMOUNT
      ,isnull(Sum([STUD_FEE_AMOUNT]),0)+isnull(Sum([STUD_LATE_FEE_AMOUNT]),0) as STUD_TOTAL_FEE_AMOUNT
      ,isnull([STUD_FEE_RECEIPT_NUMBER],'') as STUD_FEE_RECEIPT_NUMBER
       ,CM_NAME+'-'+SM_NAME as ClassSectionName
       ,LTRIM(Str(STUD_FEE_YEAR))+'-'+Case When STUD_FEE_MONTH<10 then
									'0'+LTRIM(Str(STUD_FEE_MONTH))  
									Else
										LTRIM(Str(STUD_FEE_MONTH))
									End as STUD_PERIOD
	  , STU_FIRST_NAME+isnull(STU_LAST_NAME,'') as STU_NAME
	  ,STU_ROLL_NUMBER as STU_ROLL_NUMBER,
	  CM_ORDER_BY
	From StudentFeeDetails 
	Join StudentMaster
	On STUDFEE_STU_GUID = STU_GUID  
	Join ClassMaster 
	On STUDFEE_CM_ID = CM_ID 
	Join ClassSectionDetail en
	On STU_SEC_ID = en.CL_SEC_ID
	and STUDFEE_CM_ID = en.CL_SEC_CM_ID 
	Join SectionMaster 
	On en.CL_SEC_SM_ID = SM_ID   
	Where isnull(STUD_FEES_PAID,0) = 1
		
	And STUD_CMP_ID = @CompanyID
	And STUD_SCH_ID = @SCHOOLID
	And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
	And STUD_FEE_DATE = @FeesPaidDate
	And STUD_FEE_DATE is not null
	Group By STUDFEE_STU_GUID,
			 STU_ROLL_NUMBER,
			 STU_FIRST_NAME+isnull(STU_LAST_NAME,''),
			 CM_NAME+'-'+SM_NAME,
			 STUD_FEE_RECEIPT_NUMBER,
			 LTRIM(Str(STUD_FEE_YEAR))+'-'+Case When STUD_FEE_MONTH<10 then
									'0'+LTRIM(Str(STUD_FEE_MONTH))  
									Else
										LTRIM(Str(STUD_FEE_MONTH))
									End
			,STUD_FEE_DUE_DATE
			 ,STUD_FEE_DATE		
			 ,CM_ORDER_BY
	Order By CM_ORDER_BY,STU_ROLL_NUMBER  


End


GO
