--usp_GetGenderReport 1,1
CREATE procedure [dbo].[usp_GetGenderReport]
@CompanyID int,
@SchoolID int
As
Begin


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

Create table #TempGenderReport
(
CM_NAME varchar(50),
SM_NAME varchar(50),
TotalBoys int,
TotalGirls int
)

Insert into #TempGenderReport
(
CM_NAME,
SM_NAME,
TotalBoys,
TotalGirls
)
Select Distinct CM_NAME,SM_NAME,
Sum(Case When ISNULL(STU_GENDER,'') = 'M' then
	1
else
	0
end) as TotalBoys,
Sum(Case When ISNULL(STU_GENDER,'') = 'F' then
	1
else
	0
end) as TotalGirls
From ClassMaster 
Join StudentMaster
On CM_ID = STU_CM_ID 
Join ClassSectionDetail 
On CL_SEC_ID = STU_SEC_ID 
And CL_SEC_CM_ID = STU_CM_ID
Join SectionMaster 
On 
CL_SEC_SM_ID = SM_ID  
Where ISNULL(STU_GENDER,'0') <>'0'
And CM_CMP_ID = @CompanyID 
and CM_SCH_ID = @SchoolID 
And CL_CMP_ID = @CompanyID 
and CL_SCH_ID = @SchoolID 
And SM_CMP_ID = @CompanyID 
And SM_SCH_ID  = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
Group By CM_NAME,SM_NAME,ISNULL(STU_GENDER,'')
Order By 1,2

Select CM_NAME,
SM_NAME,
Sum(TotalBoys) as TotalBoys,
Sum(TotalGirls) as TotalGirls 
From #TempGenderReport
Group By CM_NAME,SM_NAME
Order By 1,2
End







