CREATE Procedure [dbo].[usp_getMonthHolidaysList]
@Month int,
@Year int,
@CompanyID int,
@SchoolID int
As
Begin

Declare
@dtFirstDate datetime,
@dtLastDate datetime,
@IteratingDate datetime

---Calculate the first date of processing month    
 Set @dtFirstDate =ltrim(str(@Month))+'/'+'1/'++ltrim(str(@Year))    
--Calculate last date of processing month    
    
Set @dtLastDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@dtFirstDate)+1,0))
Set @dtLastDate = Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))
Set @IteratingDate = Convert(Datetime,(Convert(Varchar(4),year(@dtFirstDate)) + '-' + Convert(Varchar(2),month(@dtFirstDate)) + '-' +Convert(Varchar(2),day(@dtFirstDate))))



Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

CREATE TABLE #TempHolidayMaster
	(
		HOLIDAY_NAME [varchar](50) NULL,
		HOLIDAY_TYPE_ID [int] NULL,
		HOLIDAY_TYPE_NAME varchar(50),
		HOLIDAY_DATE [datetime] NOT NULL,
		HOLIDAY_MONTH int,
		HOLIDAY_YEAR int
	)

--continue to loop until our iterating date is the same as the last date of month
--Select * from #TempLeaseMonthlyDaysData
	WHILE @IteratingDate <= @dtLastDate
	BEGIN

		--****************************Daily Performance Starts************************************
		-------------Insertinng KM Data records into temporary table DailyEquipmentPerformance---------
			Insert into #TempHolidayMaster
			(
				HOLIDAY_NAME,
				HOLIDAY_TYPE_ID,
				HOLIDAY_TYPE_NAME,
				HOLIDAY_DATE,
				HOLIDAY_MONTH,
				HOLIDAY_YEAR
				
			)
			Select	HOLIDAY_NAME,
					isnull(T.HOLIDAY_TYPE_ID,0),
					isnull(T.HOLIDAY_TYPE_NAME,''),
					@IteratingDate,
					month(@IteratingDate),
					Year(@IteratingDate)
			From HolidayMaster B
			Left Join HolidayTypeMaster T
			On B.HOLIDAY_TYPE_ID = T.HOLIDAY_TYPE_ID
			Where @IteratingDate
											 >=
												Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_FROM_DATE)) 
												+ '-' + Convert(Varchar(2),month(B.HOLIDAY_FROM_DATE)) 
												+ '-' +Convert(Varchar(2),day(B.HOLIDAY_FROM_DATE))) )
										
										and @IteratingDate
											<= 	Convert(Datetime,(Convert(Varchar(4),year(B.HOLIDAY_TO_DATE)) 
													+ '-' + Convert(Varchar(2),month(B.HOLIDAY_TO_DATE)) 
													+ '-' +Convert(Varchar(2),day(B.HOLIDAY_TO_DATE))) )
		And B.HOLIDAY_CMP_ID = @CompanyID 
		And B.HOLIDAY_SCH_ID = @SchoolID 
		And Case When @DisplayRecord = -1 then
									1
								else
									B.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
		And Case When @DisplayRecord = -1 then
									1
								else
									T.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 

		---increase the value of our iterating date
		SET @IteratingDate = @IteratingDate + 1
	END
	
	Select * from #TempHolidayMaster
Drop table #TempHolidayMaster

End



GO
