--usp_GetPieChartData
CREATE Procedure [dbo].[usp_GetOverAllFinancialsData]
@CompanyID int,
@SchoolID int
As
Begin

Create table #TempExpenseIncomeCategories
(
	EXP_CAT_ID INT,
	EXP_CAT_NAME VARCHAR(150),
	EXP_CAT_TYPE VARCHAR(150),
	EXP_CAT_Total decimal(18,2)
)
Declare
@CurrentYear int,
@NextYear int,
@StartDate datetime,
@EndDate datetime,
@TotalExpenses decimal(18,6)

If (MONTH(getdate()) in (1,2,3)) 
	Set @CurrentYear = YEAR(Getdate())-1
else
	Set @CurrentYear = YEAR(Getdate())

-----Calculate the Next Year

Set @NextYear = @CurrentYear+1 
---Calculate first date of financial year
Set @StartDate = ltrim(str(4))+'/'+'1/'++ltrim(str(@CurrentYear)) 


--Calculate last date of financial Year   
 Set @EndDate =ltrim(str(3))+'/'+'1/'++ltrim(str(@NextYear))    
    
 Set @EndDate= DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,@EndDate)+1,0))  

---removing time part from date
 Set @EndDate = Convert(Datetime,(Convert(Varchar(4),year(@EndDate)) + '-' + Convert(Varchar(2),month(@EndDate)) + '-' +Convert(Varchar(2),day(@EndDate))))
				
		
Select @TotalExpenses =  SUM(BILL_AMOUNT) 
From BillMaster BM
Where Convert(Datetime,(Convert(Varchar(4),year(BM.BILL_DATE)) + '-' + Convert(Varchar(2),month(BM.BILL_DATE)) + '-' +Convert(Varchar(2),day(BM.BILL_DATE))))
		>= @StartDate 
	  And 
	     Convert(Datetime,(Convert(Varchar(4),year(BM.BILL_DATE)) + '-' + Convert(Varchar(2),month(BM.BILL_DATE)) + '-' +Convert(Varchar(2),day(BM.BILL_DATE))))
		<=@EndDate
And BM.BILL_CMP_ID = @CompanyID 
And BM.BILL_SCH_ID = @SchoolID  
  
Insert into #TempExpenseIncomeCategories 
(
	EXP_CAT_ID,
	EXP_CAT_NAME,
	EXP_CAT_TYPE, 
	EXP_CAT_Total 
)

Select BILL_DETAIL_EXP_CAT_ID,
Expcat.EXP_CAT_NAME,   
'Expenses',
SUM(BILL_DETAIL_AMOUNT)
from BillDetails BD
Join BillMaster BM
On BD.BILL_DETAIL_BILL_ID = BM.BILL_ID 
Join ExpenseCategoryMaster Expcat
On BD.BILL_DETAIL_EXP_CAT_ID = Expcat.EXP_CAT_ID 
Where Convert(Datetime,(Convert(Varchar(4),year(BM.BILL_DATE)) + '-' + Convert(Varchar(2),month(BM.BILL_DATE)) + '-' +Convert(Varchar(2),day(BM.BILL_DATE))))
		>= @StartDate 
	  And 
	     Convert(Datetime,(Convert(Varchar(4),year(BM.BILL_DATE)) + '-' + Convert(Varchar(2),month(BM.BILL_DATE)) + '-' +Convert(Varchar(2),day(BM.BILL_DATE))))
		<=@EndDate 
And BM.BILL_CMP_ID = @CompanyID 
And BM.BILL_SCH_ID = @SchoolID 
And Expcat.EXP_CAT_CMP_ID = @CompanyID 
And Expcat.EXP_CAT_SCH_ID = @SchoolID 
 Group By BILL_DETAIL_EXP_CAT_ID,Expcat.EXP_CAT_NAME
 
 ----------------------Inserting the Fees Data------------------------

Insert into #TempExpenseIncomeCategories 
(
	EXP_CAT_ID,
	EXP_CAT_NAME,
	EXP_CAT_TYPE, 
	EXP_CAT_Total 
)

Select  0,
'School Fees',
'Income',
isnull(SUM(STUD_FEE_TOTAL_AMOUNT),0)

from StudentFeeDetails 
Where Convert(Datetime,(Convert(Varchar(4),year(STUD_FEE_DATE)) + '-' + Convert(Varchar(2),month(STUD_FEE_DATE)) + '-' +Convert(Varchar(2),day(STUD_FEE_DATE))))
		>= @StartDate 
	  And 
	     Convert(Datetime,(Convert(Varchar(4),year(STUD_FEE_DATE)) + '-' + Convert(Varchar(2),month(STUD_FEE_DATE)) + '-' +Convert(Varchar(2),day(STUD_FEE_DATE))))
		<=@EndDate 
 And STUD_FEES_PAID = 1
 And STUD_CMP_ID = @CompanyID 
 And STUD_SCH_ID = @SchoolID 

Select EXP_CAT_NAME as CatName,
	   EXP_CAT_TYPE as CatType,
	   EXP_CAT_Total as Amount
	From #TempExpenseIncomeCategories
	Order By EXP_CAT_ID

--Select (10*100)/1000
--Select @StartDate 
--Select @EndDate
--Select @TotalExpenses

End



