CREATE Procedure [dbo].[usp_getReportCardComments]

@ReportCardIDs varchar(MAX),

@ClassId int

As

Begin



declare 

@SectionID int







Declare @SplitOn varchar(1)

set @SplitOn = ','




  Create table #TempReportCardIds

  (

		ReportCardID int

  )


	if isnull(@ReportCardIDs,'')<>''

	Begin 

		WHILE (Charindex(@SplitOn,@ReportCardIDs)>0)

		BEGIN  

			INSERT INTO #TempReportCardIds (ReportCardID)

			SELECT ltrim(rtrim(Substring(@ReportCardIDs,1,Charindex(@SplitOn,@ReportCardIDs)-1)))

			SET @ReportCardIDs = Substring(@ReportCardIDs,Charindex(@SplitOn,@ReportCardIDs)+len(@SplitOn),len(@ReportCardIDs))

		END     

			INSERT INTO #TempReportCardIds (ReportCardID)

			SELECT ltrim(rtrim(@ReportCardIDs))

    End











---------------------Temporary to Store the Student Comments Details----------------

CREATE TABLE #TempStudentCommentDetails

(

    SCOMMENT_STU_GUID uniqueidentifier,

    SCOMMENT_DESC varchar(500),

    SCOMMENT_EXAM_UNIT varchar(50),

    SCOMMENT_EXAM_TYPE varchar(50),

    SCOMMENT_EXAM_SESSION varchar(50),

    SCOMMENT_Class_ID int,

    SCOMMENT_Section_ID int

)



Insert into #TempStudentCommentDetails

(

	SCOMMENT_STU_GUID ,

    SCOMMENT_EXAM_UNIT ,

    SCOMMENT_EXAM_TYPE,

    SCOMMENT_EXAM_SESSION,

    SCOMMENT_Class_ID,

    SCOMMENT_Section_ID



)

Select Distinct REPCARD_STU_GUID ,

REPCARD_TYPE_VALUE,

REPCARD_TYPE,

REPCARD_SESSION    ,

REPCARD_CM_ID,

REPCARD_SEC_ID  

From StudentReportCardMaster 

Where REPCARD_ID in (Select ReportCardID From #TempReportCardIds) 



---------------------Updating Comments---------------------

Update #TempStudentCommentDetails

set SCOMMENT_DESC = Case When SCOMMENT_EXAM_UNIT = 'Quarter1' then 

				     isnull(STUCOMMENT_Q1_DESC,'')

				    When   SCOMMENT_EXAM_UNIT = 'Quarter2' then 

				     isnull(STUCOMMENT_Q2_DESC,'')	

				    When   SCOMMENT_EXAM_UNIT = 'Quarter3' then 

				     isnull(STUCOMMENT_Q3_DESC,'')	

				      When   SCOMMENT_EXAM_UNIT = 'Semester1' then 

				     isnull(STUCOMMENT_SA1_DESC ,'')	

				        When   SCOMMENT_EXAM_UNIT = 'Semester2' then 

				     isnull(STUCOMMENT_SA2_DESC ,'')

				           When   SCOMMENT_EXAM_UNIT = 'Final' then 

				     isnull(STUCOMMENT_SA2_DESC,'') 

				   End	

From 

StudentCommentDetails

Where SCOMMENT_Class_ID = STUCOMMENT_CM_ID

And SCOMMENT_Section_ID = STUCOMMENT_SEC_ID

AND SCOMMENT_STU_GUID = STUCOMMENT_STU_GUID

And SCOMMENT_EXAM_SESSION = STUCOMMENT_SESSION

    

    

 Select SCOMMENT_STU_GUID,SCOMMENT_DESC From #TempStudentCommentDetails

 

 Drop table  #TempStudentCommentDetails

 Drop table  #TempReportCardIds


End



