--usp_GetRouteStudentsList '6,7'
CREATE Procedure [dbo].[usp_GetRouteStudentsList]  
@RouteIDList varchar(1000)  = null , 
@CompanyID int,
@SchoolId int

As  
Begin  



Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0  
  
Create table #TempRouteIDs
(
	RouteID int
)


Declare @SplitOn varchar(1)
set @SplitOn = ','
--------------------------Populating ClassId  in Temporary Table---------   
   if isnull(@RouteIDList,'') <> '' 
	Begin 
		WHILE (Charindex(@SplitOn,@RouteIDList)>0)
		BEGIN  
			INSERT INTO #TempRouteIDs (RouteID)
			SELECT ltrim(rtrim(Substring(@RouteIDList,1,Charindex(@SplitOn,@RouteIDList)-1)))
			SET @RouteIDList = Substring(@RouteIDList,Charindex(@SplitOn,@RouteIDList)+len(@SplitOn),len(@RouteIDList))
		END     
			INSERT INTO #TempRouteIDs (RouteID)
			SELECT ltrim(rtrim(@RouteIDList))
    End
    Else
    Begin
		INSERT INTO #TempRouteIDs (RouteID)
		Select  ROUTE_ID  From RouteMaster  
		Where Case When @DisplayRecord = -1 then
									1
								else
									IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End    
    End
 
	--Select * from #TempRouteIDs
  
  
	Select  
		RD.ROUTE_STOP_ID,
		ROUTE_DETAIL_ID,
		ROUTE_NAME,
		LStartRoute.LOC_NAME as Route_Start_Location,   
		LEndRoute.LOC_NAME as Route_End_Location,
		LStopLocation.LOC_NAME as Route_Stop,
		STU_ROLL_NUMBER,
		STU_FIRST_NAME,
		STU_LAST_NAME,
		CM_NAME,
		SM_NAME,     
		Replace(isnull(STU_ADDRESS,''),'"','') as STU_ADDRESS,
		isnull(STU_CITY,'') as STU_CITY,
		isnull(STU_STATE,'') as STU_STATE, 
		isnull(STU_CONTACT_NUMBER,'')  STU_CONTACT_NUMBER,
		CM_NAME+'-'+SM_NAME as ClassSectionName,
		EDRIVER.EMP_FIRST_NAME+' '+ EDRIVER.EMP_LAST_NAME as DRIVER_NAME,
		VEH_NUMBER, 
		ECleaner.EMP_FIRST_NAME+ ' '+ECleaner.EMP_LAST_NAME as   CLEANER_NAME 
		--ISNULL(CLEANER_NAME,'') as CLEANER_NAME
		From StudentMaster 
		Join ClassMaster   
			On STU_CM_ID = CM_ID   
		Join ClassSectionDetail en  
			 On STU_SEC_ID = en.CL_SEC_ID  
			 and STU_CM_ID = en.CL_SEC_CM_ID   
		 Join SectionMaster   
			On en.CL_SEC_SM_ID = SM_ID     
			
		 Join RouteMaster 
			On isnull(STU_ROUTE_ID,0) = ROUTE_ID
			
		 Join RouteDetails 
			 On   ROUTE_ID = ROUTE_DETAIL_ROUTE_ID
			 
		 Join RouteStopDetails RD
			On isnull(STU_ROUTE_STOP_ID,0) = RD.ROUTE_STOP_ID 
			and isnull(STU_ROUTE_ID,0) = RD.ROUTE_STOP_ROUTE_ID
			
		 Join LocationMaster LStartRoute
			On LStartRoute.LOC_ID = ROUTE_START_LOCATION_ID
		Join LocationMaster LEndRoute
			On LEndRoute.LOC_ID = ROUTE_END_LOCATION_ID  
		Join LocationMaster LStopLocation
			On LStopLocation.LOC_ID = RD.ROUTE_STOP_LOCATION_ID 
		Join EmpMaster EDRiver
			On ROUTE_DETAIL_DRIVER_ID  = EDRiver.EMP_ID  
		Join VehicleMaster
			On ROUTE_DETAIL_VEHICLE_ID  = VEH_ID 
		Left Join EmpMaster  ECleaner
			On isnull(ROUTE_DETAIL_CLEANER_ID,0) =  ECleaner.EMP_ID  
   
 
 Where RD.ROUTE_STOP_ROUTE_DETAIL_ID = ROUTE_DETAIL_ID
 and RD.ROUTE_STOP_ROUTE_ID = ROUTE_DETAIL_ROUTE_ID
 and  RD.ROUTE_STOP_ROUTE_ID = ROUTE_ID
 And STU_ROUTE_ID is not null
 and STU_ROUTE_STOP_ID is not null
 And Case When @DisplayRecord = -1 then
									1
								else
									RouteMaster.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End  
  And Case When @DisplayRecord = -1 then
									1
								else
									RouteDetails.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
 And Case When @DisplayRecord = -1 then
									1
								else
									RD.IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
 And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
 And isnull(STU_ROUTE_ID,0) in (Select RouteID from #TempRouteIDs) 
 Order By CM_ORDER_BY,SM_NAME,STU_ROLL_NUMBER  
  
  
End  
  


