As
Begin


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0

Create table #TempSalaryDesigGradeDetails
(
	SALDGD_ID int  NULL,
	SALDGD_DESGRADE_ID int  NULL,
	SALDGD_SALHM_ID int  NULL,
	SALDGD_VALUE decimal(18, 2) NULL,
	SALDGD_SESSION varchar(50) NULL,
	SALDGD_CMP_ID int NOT NULL,
	SALDGD_SCH_ID int NOT NULL,
	SALDGD_DESIG_ID int  null,
	SALDGD_GRADE_ID int  null,
	SALGD_SALARY_TYPE varchar(10)
)

insert into #TempSalaryDesigGradeDetails
(
	SALDGD_DESGRADE_ID ,
	SALDGD_SALHM_ID ,
	SALDGD_SESSION ,
	SALDGD_CMP_ID ,
	SALDGD_SCH_ID ,
	SALDGD_DESIG_ID ,
	SALDGD_GRADE_ID,
	SALGD_SALARY_TYPE
)
Select D.DESGRADE_ID,
	S.SALHM_ID,
	@Session,
	@CompanyID,
	@SchoolID,
	D.DESGRADE_DESIG_ID,
	D.DESGRADE_GRADE_ID,
	S.SALHM_TYPE       
from DesigGradeDetails  D, SalaryHeadMaster S 
Where D.DESGRADE_CMP_ID =@CompanyID 
And D.DESGRADE_SCH_ID = @SchoolID
and S.SALHM_CMP_ID = @CompanyID 
And S.SALHM_SCH_ID = @SchoolID 
And S.SALHM_CODE Not in ('MEarn','MInc','MDEDUC')
And Case When @DisplayRecord = -1 then
			1
		else
			S.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 
And Case When @DisplayRecord = -1 then
			1
		else
			D.IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 



Update #TempSalaryDesigGradeDetails
Set #TempSalaryDesigGradeDetails.SALDGD_VALUE = ED.SALDGD_VALUE,
	#TempSalaryDesigGradeDetails.SALDGD_ID = ED.SALDGD_ID
From SalaryDesigGradeDetails ED
Where ED.SALDGD_SALHM_ID = #TempSalaryDesigGradeDetails.SALDGD_SALHM_ID
And ED.SALDGD_DESGRADE_ID = #TempSalaryDesigGradeDetails.SALDGD_DESGRADE_ID
And ED.SALDGD_SESSION = #TempSalaryDesigGradeDetails.SALDGD_SESSION 
And ED.SALDGD_CMP_ID = #TempSalaryDesigGradeDetails.SALDGD_CMP_ID 
And ED.SALDGD_SCH_ID = #TempSalaryDesigGradeDetails.SALDGD_SCH_ID
And Case When @DisplayRecord = -1 then
			1
		else
			ED.SALDGD_IS_ACTIVE
		End = 
		Case When @DisplayRecord = -1 then
			1
		else
			@DisplayRecord
		End 

Update #TempSalaryDesigGradeDetails
Set SALDGD_ID = ISNULL(SALDGD_ID,0)

Select * from #TempSalaryDesigGradeDetails

Drop Table #TempSalaryDesigGradeDetails

End







