--usp_GetSMSTaskFeesDefaultersList '6,3',2013,2013,null,'' ,1 
CREATE Procedure [dbo].[usp_GetSMSTaskFeesDefaultersList]  
@SectionIDList varchar(1000)  = null,  
@FeesMonth int = null,  
@FeesYear int = null,  
@CategoryID int = null,  
@FeesCatId varchar(500) = null,
@SMSTaskId int
As  
Begin  

Declare   
@CompanyID int,
@SchoolID int  
  
Create table #TempClassSectionIDs
(
ClassSectionId int
)

Create table #TempFeeCategoryIDs
(
FeeCatId int
)

 Select @CompanyID = STS_CMP_ID, @SchoolID = STS_SCH_ID    From SMSTask 
 Where STS_ID = @SMSTaskID 


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0  

Declare @SplitOn varchar(1)
set @SplitOn = ','
--------------------------Populating ClassId  in Temporary Table---------   
   if isnull(@SectionIDList,'') <> '' 
	Begin 
		WHILE (Charindex(@SplitOn,@SectionIDList)>0)
		BEGIN  
			INSERT INTO #TempClassSectionIDs (ClassSectionId)
			SELECT ltrim(rtrim(Substring(@SectionIDList,1,Charindex(@SplitOn,@SectionIDList)-1)))
			SET @SectionIDList = Substring(@SectionIDList,Charindex(@SplitOn,@SectionIDList)+len(@SplitOn),len(@SectionIDList))
		END     
			INSERT INTO #TempClassSectionIDs (ClassSectionId)
			SELECT ltrim(rtrim(@SectionIDList))
    End
    Else
    Begin
		INSERT INTO #TempClassSectionIDs (ClassSectionId)
		Select  CL_SEC_ID  From ClassSectionDetail 
		Where CL_CMP_ID = @CompanyID 
		And CL_SCH_ID = @SchoolID    
    End
 
 --------------------------Populating Fee Category ID  in Temporary Table---------   
   if isnull(@FeesCatId,'') <> '' 
	Begin 
		WHILE (Charindex(@SplitOn,@FeesCatId)>0)
		BEGIN  
			INSERT INTO #TempFeeCategoryIDs (FeeCatId)
			SELECT ltrim(rtrim(Substring(@FeesCatId,1,Charindex(@SplitOn,@FeesCatId)-1)))
			SET @FeesCatId = Substring(@FeesCatId,Charindex(@SplitOn,@FeesCatId)+len(@SplitOn),len(@FeesCatId))
		END     
			INSERT INTO #TempFeeCategoryIDs (FeeCatId)
			SELECT ltrim(rtrim(@FeesCatId))
    End
    Else
    Begin
		INSERT INTO #TempFeeCategoryIDs (FeeCatId)
		Select  FCM_ID   From FeesCategoryMaster  
		Where FCM_CAT_CMP_ID = @CompanyID 
		and FCM_CAT_SCH_ID = @SchoolID  
    End
 
  
	Select   
	--[STUDFEE_ID] STUDFEES_ID  
 --     ,[STUD_FEE_DUE_DATE]  
 --     ,isnull([STUD_FEE_AMOUNT],0) as STUD_FEE_AMOUNT  
 --     ,isnull([STUD_LATE_FEE_AMOUNT],0) as STUD_LATE_FEE_AMOUNT  
 --     ,isnull([STUD_FEE_AMOUNT],0)+isnull([STUD_LATE_FEE_AMOUNT],0) as STUD_TOTAL_FEE_AMOUNT  
 --     ,[STUD_FEE_MONTH]  
 --     ,[STUD_FEE_YEAR]  
 --     ,CM_NAME as STUD_CLASS_NAME  
 --      ,SM_NAME as STUD_SECTION_NAME  
 --      ,LTRIM(Str(STUD_FEE_YEAR))+ Case When STUD_FEE_MONTH<10 then  
 --        '0'+LTRIM(Str(STUD_FEE_MONTH))    
 --        Else  
 --         LTRIM(Str(STUD_FEE_MONTH))  
 --        End as STUD_PERIOD  
	Distinct STU_GUID, 
    STU_FIRST_NAME  
   ,isnull(STU_LAST_NAME,'') as STU_LAST_NAME  
  ,STU_ROLL_NUMBER as STU_ROLL_NUMBER  
  ,STU_CONTACT_NUMBER  
 -- ,STU_PHONE  
 -- ,STU_ADDRESS  
--  ,STU_STATE          
 -- ,STU_CITY  
  --, isnull(STUD_FEE_CAT_ID,-1) as STUD_FEE_CAT_ID,  
  -- FCM_CAT_NAME  as STUD_FEE_CATEGORY,
   ,CM_NAME+'-'+SM_NAME as ClassSectionName    
   ,PM_FIRST_NAME,
PM_LAST_NAME,
PM_ADDRESS,
PM_CITY,
PM_STATE,
PM_MOBILE,
STU_CONTACT_NUMBER as  PM_PHONE,
PM_EMAIL      ,
PM_ID   
 From StudentFeeDetails   
 Join StudentMaster  
 On STUDFEE_STU_GUID = STU_GUID 
 Join ParentMaster 
On STU_GUID = PM_STU_GUID    
 Join ClassMaster   
 On STUDFEE_CM_ID = CM_ID   
 Join ClassSectionDetail en  
 On STU_SEC_ID = en.CL_SEC_ID  
 and STU_CM_ID = en.CL_SEC_CM_ID   
 Join SectionMaster   
 On en.CL_SEC_SM_ID = SM_ID     
   
  JOin FeesCategoryMaster  FCM  
 On FCM.FCM_ID = STUD_FEE_CAT_ID  
 Where 
 PM_RELATION_TYPE ='F'
 And en.CL_SEC_ID in (Select ClassSectionId from #TempClassSectionIDs ) 
  And Case When @FeesMonth is null then  
     1  
    else  
     @FeesMonth  
    end =  Case When @FeesMonth is null then  
     1  
    else  
     STUD_FEE_MONTH    
    end  
  And  Case When @FeesYear  is null then  
     1  
    else  
     @FeesYear  
    end =  Case When @FeesYear is null then  
     1  
    else  
     STUD_FEE_YEAR     
    end  
  And  Case When @CategoryID  is null then  
     1  
    else  
     @CategoryID  
    end =  Case When @CategoryID is null then  
     1  
    else  
     isnull(STU_CAT_ID,0)    
    end  
 And isnull(STUD_FEE_CAT_ID,0) in (Select FeeCatId from #TempFeeCategoryIDs) 
  And STUD_FEES_PAID = 0     
  And STUD_CMP_ID = @CompanyID 
And STUD_SCH_ID = @SchoolID 
And PM_CMP_ID = @CompanyID 
And PM_SCH_ID = @SchoolID 
And CL_CMP_ID = @CompanyID 
And CL_SCH_ID = @SchoolID 
And CM_CMP_ID = @CompanyID 
And CM_SCH_ID = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
 --Order By STU_CM_ID,STU_SEC_ID,STU_ROLL_NUMBER     
 --Order By CM_ORDER_BY,SM_NAME,STU_ROLL_NUMBER,STU_GUID  
  
  
End  
  
  
  
  
  
  





