CREATE Procedure [dbo].[usp_getSMSTaskHistoryList]
@SMS_TaskID int
As
Begin

Declare
@Receiver varchar(50)
Select @Receiver = NOTIFICATION_RECEIVER_NAME  From SMSTask S
JOin NotificationReceiverMaster 
On S.STS_NOTIFICATION_RECEIEVER_ID = NOTIFICATION_RECEIVER_ID 
Where s.STS_ID = @SMS_TaskID 

if (@Receiver = 'Parents' Or @SMS_TaskID = 1)
Begin
		Select STU_GUID,
		STU_ROLL_NUMBER,
		STU_FIRST_NAME,
		STU_LAST_NAME,
		PM_FIRST_NAME+' '+PM_LAST_NAME as ReceiverName,
		PM_ADDRESS as Address,
		PM_CITY as City,
		PM_STATE as State,
		PM_MOBILE as Mobile,
		PM_EMAIL  as Email,
		STSH_SENT_DATE as SendDate,
		STSH_STATUS  as SendStatus,
		case When STSH_SEND_TYPE ='E' then
		'Email'
		 When STSH_SEND_TYPE ='S' then
		 'SMS'
		 End as SendType
		From SMSTask
		Join SMSTaskHistory 
		On STS_ID = STSH_TASK_ID 
		Join StudentMaster 
		On STU_GUID = STSH_STU_GUID 
		Join ParentMaster 
		On STSH_PARENT_ID  = PM_ID 
		Where STS_ID = @SMS_TaskID 
		And PM_RELATION_TYPE ='F'
End
Else if (@Receiver = 'Teachers' )
Begin
		Select 
		null as STU_GUID,
		null as STU_ROLL_NUMBER,
		'' as STU_FIRST_NAME,
		'' as STU_LAST_NAME,
		
		isnull(EMP_SALUTATION,'')+' '+EMP_FIRST_NAME+ ' '+EMP_Last_NAME  as ReceiverName ,

		EMP_CURRENT_ADDRESS as Address,
		EMP_CURRENT_CITY as City,
		EMP_CURRENT_STATE as State,
		EMP_MOBILE  as Mobile,
		'' as Email,
		STSH_SENT_DATE as SendDate,
		STSH_STATUS  as SendStatus,
		case When STSH_SEND_TYPE ='E' then
		'Email'
		 When STSH_SEND_TYPE ='S' then
		 'SMS'
		 End as SendType
		From SMSTask
		Join SMSTaskHistory 
		On STS_ID = STSH_TASK_ID 
		Join EmpMaster  
		On EMP_ID  = STSH_TEACHER_ID 

End


End





