CREATE Procedure [dbo].[usp_getSMSTaskParentList]
@SMS_TaskID int
As
Begin

Declare   
@CompanyID int,
@SchoolID int  
  
 Select @CompanyID = STS_CMP_ID, @SchoolID = STS_SCH_ID    From SMSTask 
 Where STS_ID = @SMS_TaskID 



Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0  
  

if Exists ( Select 'X' From ClassSMSTasksDetails 
			Where CLSTS_TASK_ID = @SMS_TaskID 
			And CLSTS_CMP_ID = @CompanyID 
			And CLSTS_SCH_ID = @SchoolID 
			)
Begin
		Select STU_GUID,
		STU_ROLL_NUMBER,
		STU_FIRST_NAME,
		STU_LAST_NAME,
		CM_NAME,
		SM_NAME,
		PM_FIRST_NAME,
		PM_LAST_NAME,
		PM_ADDRESS,
		PM_CITY,
		PM_STATE,
		PM_MOBILE,
		STU_CONTACT_NUMBER as  PM_PHONE,
		PM_EMAIL      ,
		PM_ID   
		From StudentMaster 
		Join ClassSMSTasksDetails 
		On STU_CM_ID = CLSTS_CM_ID 
		And STU_SEC_ID = CLSTS_SEC_ID 
		Join ParentMaster 
		On STU_GUID = PM_STU_GUID 
		jOIN ClassMaster 
		ON STU_CM_ID = CM_ID 
		Join ClassSectionDetail 
		On STU_SEC_ID = CL_SEC_ID 
		And STU_CM_ID = CL_SEC_CM_ID
		Join SectionMaster 
		On CL_SEC_SM_ID = SM_ID  
		Where CLSTS_TASK_ID = @SMS_TaskID 
		And PM_RELATION_TYPE ='F'
		And PM_CMP_ID = @CompanyID 
		And PM_SCH_ID = @SchoolID 
		And CL_CMP_ID = @CompanyID 
		And CL_SCH_ID = @SchoolID 
		And CM_CMP_ID = @CompanyID 
		And CM_SCH_ID = @SchoolID 
		And  STU_SCH_ID = @SchoolID 
		And STU_CMP_ID = @CompanyID 
		And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End    
End
Else
Begin
		Select STU_GUID,
		STU_ROLL_NUMBER,
		STU_FIRST_NAME,
		STU_LAST_NAME,
		CM_NAME,
		SM_NAME,
		PM_FIRST_NAME,
		PM_LAST_NAME,
		PM_ADDRESS,
		PM_CITY,
		PM_STATE,
		STU_CONTACT_NUMBER as  PM_MOBILE,
		PM_PHONE,
		PM_EMAIL      ,
		PM_ID   
		From StudentMaster 
		Join ParentMaster 
		On STU_GUID = PM_STU_GUID 
		jOIN ClassMaster 
		ON STU_CM_ID = CM_ID 
		Join ClassSectionDetail 
		On STU_SEC_ID = CL_SEC_ID 
		And STU_CM_ID = CL_SEC_CM_ID
		Join SectionMaster 
		On CL_SEC_SM_ID = SM_ID  
		Where  PM_RELATION_TYPE ='F'
		And PM_CMP_ID = @CompanyID 
		And PM_SCH_ID = @SchoolID 
		And CL_CMP_ID = @CompanyID 
		And CL_SCH_ID = @SchoolID 
		And CM_CMP_ID = @CompanyID 
		And CM_SCH_ID = @SchoolID 
		And  STU_SCH_ID = @SchoolID 
		And STU_CMP_ID = @CompanyID 
		And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End    

End


End






