CREATE Procedure [dbo].[usp_getStudentAbsenceList]  
@SMSTaskID int
As  
Begin  
Declare   
@dtFirstDate datetime,  
@dtLastDate datetime,  
@NotificationDays int,  
@Days int,
@CompanyID int,
@SchoolID int  
  
 
 Select @CompanyID = STS_CMP_ID, @SchoolID = STS_SCH_ID    From SMSTask 
 Where STS_ID = @SMSTaskID 
  
  

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0  

---Calculate the first date of processing month      
 Set @dtLastDate = GETDATE()  
 Set @dtLastDate =  Convert(Datetime,(Convert(Varchar(4),year(@dtLastDate)) + '-' + Convert(Varchar(2),month(@dtLastDate)) + '-' +Convert(Varchar(2),day(@dtLastDate))))  
          
--Calculate last date of processing month   
  
Select @NotificationDays = SYSP_PARAMETER_VALUE from  SystemParameters     
Where SYS_PARAMETER_ID = 1  
And SYSP_PARAMETER_NAME ='NotificationDays'  
And SYSP_CMP_ID = @CompanyID 
And SYSP_SCH_ID = @SchoolID 
  
Set @Days = @NotificationDays  
   
  
    Set @NotificationDays = @NotificationDays *-15  
         
    Set @dtFirstDate = DATEADD(d,@NotificationDays,@dtLastDate)  
         
     Set @dtFirstDate =  Convert(Datetime,(Convert(Varchar(4),year(@dtFirstDate)) + '-' + Convert(Varchar(2),month(@dtFirstDate)) + '-' +Convert(Varchar(2),day(@dtFirstDate))))  
  
  
Create Table #TempStudentGuids  
(  
 STU_ATTEND_GUID uniqueidentifier  
)  
   
       
 ;WITH CTE AS (  
SELECT STU_ATTEND_GUID,STU_ATTEND_DATE,  
ROW_NUMBER() OVER(PARTITION BY STU_ATTEND_GUID ORDER BY STU_ATTEND_DATE) AS rn  
FROM StudentAttendanceDetails  
Where STU_ATTEND_DATE > =@dtFirstDate   
And  STU_ATTEND_DATE < = @dtLastDate   
And STU_ATTEND_STATUS = 0  
And STU_ATTEND_CMP_ID = @CompanyID 
And STU_ATTEND_SCH_ID = @SchoolID 
)  
insert into #TempStudentGuids  
(STU_ATTEND_GUID)  
SELECT Distinct STU_ATTEND_GUID  
FROM CTE  
GROUP BY STU_ATTEND_GUID,DATEADD(Day,-rn,STU_ATTEND_DATE)  
HAVING COUNT(*)>=@Days     
  
Select  STU_GUID,  
STU_ROLL_NUMBER,  
STU_FIRST_NAME,  
STU_LAST_NAME,  
CM_NAME,  
SM_NAME,  
@dtFirstDate as  ABSent_StartDate,  
@dtLastDate  as ABSent_EndDate,   
PM_FIRST_NAME,  
PM_LAST_NAME,  
PM_ADDRESS,  
PM_CITY,  
PM_STATE,  
STU_CONTACT_NUMBER as  PM_MOBILE,  
PM_PHONE,  
PM_EMAIL      ,  
PM_ID     
From StudentMaster   
Join #TempStudentGuids   
On STU_GUID = STU_ATTEND_GUID   
Join ParentMaster   
On STU_GUID = PM_STU_GUID   
jOIN ClassMaster   
ON STU_CM_ID = CM_ID   
Join ClassSectionDetail   
On STU_SEC_ID = CL_SEC_ID   
And STU_CM_ID = CL_SEC_CM_ID  
Join SectionMaster   
On CL_SEC_SM_ID = SM_ID    
Where PM_RELATION_TYPE ='F' 
And STU_CMP_ID = @CompanyID 
And STU_SCH_ID = @SchoolID 
And PM_CMP_ID = @CompanyID 
And PM_SCH_ID = @SchoolID 
And CL_CMP_ID = @CompanyID 
And CL_SCH_ID = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End   
Drop Table  #TempStudentGuids  
  
End  
  
  
  
  



GO
