--usp_getStudentDetails 'f5ee6991-a205-482a-81f5-cd3246ebf8da'
CREATE procedure [dbo].[usp_getStudentDetails]
@ReportCardIDs varchar(MAX)
as
Begin

Declare @SplitOn varchar(1)
set @SplitOn = ','

----------------Creating temporary table to Store AJCs list--------------------
  Create table #TempReportCardIds
  (
		ReportCardID int
  )
  ---------------popiulating AJC search list----------------------
	if isnull(@ReportCardIDs,'')<>''
	Begin 
		WHILE (Charindex(@SplitOn,@ReportCardIDs)>0)
		BEGIN  
			INSERT INTO #TempReportCardIds (ReportCardID)
			SELECT ltrim(rtrim(Substring(@ReportCardIDs,1,Charindex(@SplitOn,@ReportCardIDs)-1)))
			SET @ReportCardIDs = Substring(@ReportCardIDs,Charindex(@SplitOn,@ReportCardIDs)+len(@SplitOn),len(@ReportCardIDs))
		END     
			INSERT INTO #TempReportCardIds (ReportCardID)
			SELECT ltrim(rtrim(@ReportCardIDs))
    End
   

Select STU_FIRST_NAME+' '+STU_LAST_NAME as STU_NAME,
STU_GUID,
STU_ROLL_NUMBER,
STU_REGSTRATION_NUMBER,
isnull(STU_IMAGE,'') as STU_IMAGE ,
STU_DOB,
STU_CONTACT_NUMBER,
STU_PHONE,  
STU_ADDRESS,
STU_CITY,
STU_BLOOD_GROUP,
CM_NAME as STU_CLASS,
PMFather.PM_FIRST_NAME +' '+ PMFather.PM_Last_NAME as FatherName,       
PMMother.PM_FIRST_NAME +' '+ PMMother.PM_Last_NAME as MotherName,
null as STU_PICTURE,
'' AS SCHOOL_NAME,
null as SCHOOL_LOGO     
From StudentMaster 
Left Join ParentMaster as PMFather
On STU_GUID = PMFather.PM_STU_GUID 
And PMFather.PM_RELATION_TYPE ='F'  
Left Join ParentMaster as PMMother
On STU_GUID = PMMother.PM_STU_GUID 
And PMMother.PM_RELATION_TYPE ='M'
Join ClassMaster
On STU_CM_ID = CM_ID  
Join StudentReportCardMaster SRCM
On SRCM.REPCARD_STU_GUID = STU_GUID 
Where SRCM.REPCARD_ID in (Select ReportCardID From #TempReportCardIds) 


Drop table #TempReportCardIds


End


GO
