Select  @ExamType = REPCARD_TYPE,@ExamTypevalue = REPCARD_TYPE_VALUE    
From StudentReportCardMaster   
Where REPCARD_ID = @ReportCardID   
---------------------Temporary to Store the Student Grade Details----------------  
CREATE TABLE #TempStudentGradeDetails  
(  
 STUGRADE_ID int,  
 STUGRADE_SCHOlASTIC_CAT_ID int,  
 [STUGRADE_Q1_GRADE] [varchar](10) NULL,  
 [STUGRADE_Q2_GRADE] [varchar](10) NULL,  
 [STUGRADE_Q3_GRADE] [varchar](10) NULL,  
 [STUGRADE_FA1_GRADE] [varchar](10) NULL,  
 [STUGRADE_FA2_GRADE] [varchar](10) NULL,  
 [STUGRADE_FA3_GRADE] [varchar](10) NULL,  
 [STUGRADE_FA4_GRADE] [varchar](10) NULL,  
 [STUGRADE_SA1_GRADE] [varchar](10) NULL,  
 [STUGRADE_SA2_GRADE] [varchar](10) NULL,  
 SUBCAT_ID int,  
 SUBCAT_NAME varchar(250),  
    SUBCAT_DESC varchar(250),  
    SUBCAT_PARENT_ID int,  
    STUGRADE_CM_ID int,  
    STUGRADE_SEC_ID int,  
