Where SUBCAT_ID in (Select ParentID From #TempParentIDList)  

Update #TempStudentGradeDetails  
Set #TempStudentGradeDetails.STUGRADE_Q1_GRADE  = '--NA--'  
Where SUBCAT_PARENT_ID =1

Delete From #TempStudentGradeDetails  
Where   
SUBCAT_PARENT_ID is not null  
and SUBCAT_ID not in (  
      Select Distinct SC.SCOHUD_SCHOLASTIC_ID from ScholasticUnitDetail SC  
      Where SC.SCOHUD_UNIT_ID = @ExamUnitId  
      )  
And SUBCAT_ID <> 1  
And isnull(STUGRADE_Q1_GRADE,'') <> '--NA--'  

Update #TempStudentGradeDetails  
