Where isnull(STUGRADE_Q1_GRADE,'') = '--NA--'  

Select   
Case When STUGRADE_Q1_GRADE IS null then  
  '0'  
 when STUGRADE_Q1_GRADE = '' and SUBCAT_PARENT_ID = '1' then  
  '0'  
 else  

 STUGRADE_Q1_GRADE  
--isnull(STUGRADE_Q1_GRADE,'0')  
  end as STUGRADE_Q1_GRADE,  
 SUBCAT_ID ,  
 SUBCAT_NAME ,  
 ISNULL(SUBCAT_PARENT_ID,0) as SUBCAT_PARENT_ID,  
 STU_GUID,  
 'Quarter' as ReportType  
From #TempStudentGradeDetails   
Where SUBCAT_PARENT_ID is not null  
Order By STU_GUID,SUBCAT_ID,isnull(SUBCAT_PARENT_ID,0)  

