CREATE Procedure [dbo].[usp_GetStudentFeesHistoryList]
@ClassId int = null,
@SectionID int = null,
@FeesMonth int = null,
@FeesYear int = null,
@FeesCatId int = null,
@CompanyID int,
@SchoolID int
As
Begin


Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
