Create table #TempClassIDs
(
ClassId int
)

Create table #TempFeeCategoryIDs
(
FeeCatId int
)

Declare @SplitOn varchar(1)
set @SplitOn = ','
--------------------------Populating ClassId  in Temporary Table---------   
   if isnull(@ClassId,'') <> '' 
	Begin 
		WHILE (Charindex(@SplitOn,@ClassId)>0)
		BEGIN  
			INSERT INTO #TempClassIDs (ClassId)
			SELECT ltrim(rtrim(Substring(@ClassId,1,Charindex(@SplitOn,@ClassId)-1)))
			SET @ClassId = Substring(@ClassId,Charindex(@SplitOn,@ClassId)+len(@SplitOn),len(@ClassId))
		END     
			INSERT INTO #TempClassIDs (ClassId)
			SELECT ltrim(rtrim(@ClassId))
    End
    Else
    Begin
		INSERT INTO #TempClassIDs (ClassId)
		Select  CM_ID  From ClassMaster
		Where CM_CMP_ID = @CompanyID 
		And CM_SCH_ID = @SchoolID    
    End
 
 --Select * from #TempClassIDs
