---------------------Temporary to Store the Student Subject List----------------  
 Create Table #TempClassSubjectIDList  
 (  
  SCOHLASTIC_ID int  
 )  
  
-----------------Temporary table to store the Subject and Sub Category List--------  
 Create table #TempIds  
 (  
  Id int  
 )  
  
------------------------Inserting Student Subject IDS into ----------------------  
------------------------#TempClassSubjectIDList table ---------------------------  
Insert into #TempClassSubjectIDList  
(  
 SCOHLASTIC_ID  
)   
Select CLSCOH_SCHOLASTIC_ID From ClassScholasticDetail  
Where CLSCOH_CM_ID = @ClassID   
  
  
--Insert into #TempClassSubjectIDList  
--(  
-- SCOHLASTIC_ID  
--)   
--values (1)  
  
;WITH CatTB(SCHOLASTIC_ID)  
AS  
(   
SELECT SCHOLASTIC_ID   
FROM ScholasticMaster  
WHERE SCHOLASTIC_ID in (Select  SCOHLASTIC_ID from #TempClassSubjectIDList)  
And SCHOLASTIC_CMP_ID  = @CompanyID   
And SCHOLASTIC_SCH_ID = @SchoolID   
UNION ALL  
SELECT C.SCHOLASTIC_ID  
FROM ScholasticMaster AS C  
JOIN CatTB AS CT  
ON C.SCHOLASTIC_PARENT_ID = CT.SCHOLASTIC_ID  
Where  C.SCHOLASTIC_CMP_ID  = @CompanyID   
And C.SCHOLASTIC_SCH_ID = @SchoolID   
)  
Insert Into #TempIds  
(  
Id)  
SELECT Distinct SCHOLASTIC_ID FROM CatTB  
  
  
Insert into #TempIds  
(  
 Id  
)   
values (1)  
  
--Select * from #TempIds  
-----------Inserting the Scohlastic Category and Sub Categories ----------  
----------- Temporary Table Into #TempStudentMarksDetails Table---------  
Insert Into #TempStudentGradeDetails  
(  
   SUBCAT_ID,  
   SUBCAT_NAME,  
            SUBCAT_DESC,  
            SUBCAT_PARENT_ID,  
            STUGRADE_CM_ID,  
            STUGRADE_SEC_ID,   
            STUGRADE_SUBJECT_ID  
             
)  
Select SCHOLASTIC_ID,SCHOLASTIC_NAME,SCHOLASTIC_DESC,SCHOLASTIC_PARENT_ID,@ClassID,@SectionID,  
SCHOLASTIC_SUBJECT_ID      
