#TempStudentGradeDetails.STUGRADE_Q2_GRADE = SMD.STUGRADE_Q2_GRADE,  
#TempStudentGradeDetails.STUGRADE_Q3_GRADE = SMD.STUGRADE_Q3_GRADE,  
#TempStudentGradeDetails.STUGRADE_FA1_GRADE  = SMD.STUGRADE_FA1_GRADE,  
#TempStudentGradeDetails.STUGRADE_FA2_GRADE = SMD.STUGRADE_FA2_GRADE,  
#TempStudentGradeDetails.STUGRADE_FA3_GRADE = SMD.STUGRADE_FA3_GRADE,  
#TempStudentGradeDetails.STUGRADE_FA4_GRADE = SMD.STUGRADE_FA4_GRADE,  
