--usp_getStudentICardData 6,6
CREATE  Procedure [dbo].[usp_getStudentICardData]
(
@ClassId int = null,
@SectionId int = null,
@CompanyID int,
@SchoolID int
)
As
Begin

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0


	Select 
	SCH_NAME as SCHOOL_NAME,
	SCH_CITY AS SCHOOL_CITY,
	SCH_PHONE AS SCHOOL_PHONE,
	SCH_ADDRESS AS SCHOOL_ADDRESS,
	STU_FIRST_NAME+' '+STU_LAST_NAME as STU_NAME,
	ISNULL(PM_FIRST_NAME,'')+' '+ ISNULL(PM_LAST_NAME,'') as STU_FATHERS_NAME,
	STU_GUID ,
	ISNULL(STU_IMAGE,'') as STU_IMAGE_FILENAME,
	 ISNULL(STU_ADDRESS ,'') as STU_ADDRESS,
	 ISNULL(STU_CONTACT_NUMBER ,'') as STU_PHONE,
	 CM_NAME+'-'+SM_NAME as STU_CLASS ,
	 STU_ROLL_NUMBER,
	 ISNULL(STU_ROUTE_ID,0) as STU_ROUTE_ID ,   
	 ISNULL(STU_ROUTE_STOP_ID,0) as STU_ROUTE_STOP_ID,
	 '' as STU_TRANSPORT,
	 null as SCHOOL_IMAGE,
	 null as STU_IMAGE
	 from 
	StudentMaster 
	Join ClassMaster 
	On STU_CM_ID = CM_ID 
	Join ClassSectionDetail 
	On STU_SEC_ID = CL_SEC_ID 
	Join SectionMaster 
	On CL_SEC_SM_ID = SM_ID 
	and CM_ID = CL_SEC_CM_ID
	Join SchoolMaster 
	On SCH_ID = STU_SCH_ID 
	Left Join ParentMaster PM
	On STU_GUID = PM.PM_STU_GUID 
	and PM.PM_RELATION_TYPE ='F'
	
	
Where 
 Case When @ClassId is null then
		1
		else
		STU_CM_ID 
	end = Case When @ClassId is null then
		1
		else
		@ClassId 
	end
And Case When @SectionId is null then
		1
		else
		STU_SEC_ID 
	end = Case When @SectionId is null then
		1
		else
		@SectionId 
	end
and STU_CMP_ID = @CompanyID 
And STU_SCH_ID = @SchoolID 
And Case When @DisplayRecord = -1 then
		1
	else
		STU_IS_ACTIVE
	End = 
	Case When @DisplayRecord = -1 then
		1
	else
		@DisplayRecord
	End 
Order by  CM_ORDER_BY,SM_NAME,STU_ROLL_NUMBER
End
 




GO
