Insert into #TempIds
(
	Id
) 
values (1)


-----------Inserting the Subject Category and Sub Categories ----------
----------- Temporary Table Into #TempStudentMarksDetails Table---------
Insert Into #TempStudentMarksDetails
(
			SUBCAT_ID,
			SUBCAT_NAME,
            SUBCAT_DESC,
            SUBCAT_PARENT_ID,
            STUMARKS_CM_ID,
            STUMARKS_SEC_ID 
           
)
Select SUBCAT_ID,SUBCAT_NAME,SUBCAT_DESC,SUBCAT_PARENT_ID,@ClassID,@SectionID   
From SubjectCategoryDetails
Join #TempIds 
On SUBCAT_ID = Id
Where SUBCAT_CMP_ID = @CompanyID 
And SUBCAT_SCH_ID = @SchoolID 

Update #TempStudentMarksDetails
Set #TempStudentMarksDetails.STUMARKS_ID = SMD.STUMARKS_ID,
#TempStudentMarksDetails.STUMARKS_SUB_CAT_ID = SMD.STUMARKS_SUB_CAT_ID,
#TempStudentMarksDetails.STUMARKS_Q1_MARKS1 = SMD.STUMARKS_Q1_MARKS1,
#TempStudentMarksDetails.STUMARKS_Q1_MARKS2 = SMD.STUMARKS_Q1_MARKS2,
#TempStudentMarksDetails.STUMARKS_Q2_MARKS1 = SMD.STUMARKS_Q2_MARKS1,
#TempStudentMarksDetails.STUMARKS_Q2_MARKS2 = SMD.STUMARKS_Q2_MARKS2,
#TempStudentMarksDetails.STUMARKS_Q3_MARKS1 = SMD.STUMARKS_Q3_MARKS1,
#TempStudentMarksDetails.STUMARKS_Q3_MARKS2 = SMD.STUMARKS_Q3_MARKS2,
#TempStudentMarksDetails.STUMARKS_FA1 = SMD.STUMARKS_FA1,
#TempStudentMarksDetails.STUMARKS_FA2 = SMD.STUMARKS_FA2,
#TempStudentMarksDetails.STUMARKS_FA3 = SMD.STUMARKS_FA3,
#TempStudentMarksDetails.STUMARKS_FA4 = SMD.STUMARKS_FA4,
#TempStudentMarksDetails.STUMARKS_SA1 = SMD.STUMARKS_SA1,
#TempStudentMarksDetails.STUMARKS_SA2 = SMD.STUMARKS_SA2
From StudentMarksDetails SMD
Where STUMARKS_STU_GUID = @STU_GUID 
And SMD.STUMARKS_SUB_CAT_ID  = #TempStudentMarksDetails.SUBCAT_ID 
And SMD.STUMARKS_CM_ID = #TempStudentMarksDetails.STUMARKS_CM_ID
And SMD.STUMARKS_SEC_ID = #TempStudentMarksDetails.STUMARKS_SEC_ID
And SMD.STUMARKS_CMP_ID = @CompanyID 
And SMD.STUMARKS_SCH_ID = @SchoolID 


Update #TempStudentMarksDetails 
Set STUMARKS_EXAMTYPE = isnull(CM_EXAM_ASSESMENT,'') 
From ClassMaster 
Where CM_ID = STUMARKS_CM_ID 
And CM_CMP_ID = @CompanyID 
And CM_SCH_ID = @SchoolID 

Select isnull(STUMARKS_ID,0) as STUMARKS_ID,
	isnull(STUMARKS_SUB_CAT_ID,0) as STUMARKS_SUB_CAT_ID,
	STUMARKS_Q1_MARKS1,
	STUMARKS_Q1_MARKS2,
	STUMARKS_Q2_MARKS1,
	STUMARKS_Q2_MARKS2,
	STUMARKS_Q3_MARKS1,
	STUMARKS_Q3_MARKS2,
	STUMARKS_FA1,
	STUMARKS_FA2,
	STUMARKS_FA3,
	STUMARKS_FA4,
	STUMARKS_SA1,
	STUMARKS_SA2,
	SUBCAT_ID ,
	SUBCAT_NAME ,
    SUBCAT_DESC ,
    SUBCAT_PARENT_ID ,
    isnull(STUMARKS_CM_ID,0) as STUMARKS_CM_ID,
    isnull(STUMARKS_SEC_ID,0) as STUMARKS_SEC_ID,
    STUMARKS_EXAMTYPE
    From #TempStudentMarksDetails 
	Order By SUBCAT_ID


Drop table #TempClassSubjectIDList
Drop table #TempIds
Drop table #TempStudentMarksDetails


End


