--usp_getStudentsCommentsData 6,6,'Quarter1','2013-2014',1,1
CREATE Procedure [dbo].[usp_getStudentsCommentsData]
@ClassID int,
@SectionID int,
@ExamUnit varchar(50),
@Session varchar(50),
@CompanyID int,
@SchoolID int
As
Begin



Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0  
  

---------------------Temporary to Store the Student Marks Details----------------
CREATE TABLE #TempStudentCommentDetails
(
	STU_GUID uniqueIdentifier,
	STUCOMMENT_ID int,
	STUCOMMENT_DESCRIPTION varchar(500),
    STUCOMMENT_CM_ID int,
    STUCOMMENT_SEC_ID int
)


-----------Inserting the Subject Category and Sub Categories ----------
----------- Temporary Table Into #TempStudentMarksDetails Table---------
Insert Into #TempStudentCommentDetails
(
			
	STU_GUID ,
    STUCOMMENT_CM_ID ,
    STUCOMMENT_SEC_ID 
)
Select  STU_GUID,
  @ClassID,
  @SectionID
From StudentMaster
Where STU_CM_ID = @ClassID 
And STU_SEC_ID = @SectionID 
And STU_CMP_ID = @CompanyID 
And STU_SCH_ID = @SchoolID  
And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End   
if @ExamUnit ='Quarter1' 
Begin
	Update #TempStudentCommentDetails
	Set #TempStudentCommentDetails.STUCOMMENT_ID  = SCD.STUCOMMENT_ID,
	#TempStudentCommentDetails.STUCOMMENT_DESCRIPTION = SCD.STUCOMMENT_Q1_DESC 
From StudentCommentDetails SCD
Where SCD.STUCOMMENT_STU_GUID = #TempStudentCommentDetails.STU_GUID  
And SCD.STUCOMMENT_CM_ID  = #TempStudentCommentDetails.STUCOMMENT_CM_ID
And SCD.STUCOMMENT_SEC_ID = #TempStudentCommentDetails.STUCOMMENT_SEC_ID
And SCD.STUCOMMENT_SESSION = @Session
And SCD.STUCOMMENT_CMP_ID = @CompanyID 
And SCD.STUCOMMENT_SCH_ID = @SchoolID 
End
else if @ExamUnit ='Quarter2' 
Begin
	
	Update #TempStudentCommentDetails
	Set #TempStudentCommentDetails.STUCOMMENT_ID  = SCD.STUCOMMENT_ID,
	#TempStudentCommentDetails.STUCOMMENT_DESCRIPTION = SCD.STUCOMMENT_Q2_DESC 
From StudentCommentDetails SCD
Where SCD.STUCOMMENT_STU_GUID = #TempStudentCommentDetails.STU_GUID  
And SCD.STUCOMMENT_CM_ID  = #TempStudentCommentDetails.STUCOMMENT_CM_ID
And SCD.STUCOMMENT_SEC_ID = #TempStudentCommentDetails.STUCOMMENT_SEC_ID
And SCD.STUCOMMENT_SESSION = @Session
And SCD.STUCOMMENT_CMP_ID = @CompanyID 
And SCD.STUCOMMENT_SCH_ID = @SchoolID 
End

else if @ExamUnit ='Quarter3' 
Begin

	Update #TempStudentCommentDetails
	Set #TempStudentCommentDetails.STUCOMMENT_ID  = SCD.STUCOMMENT_ID,
	#TempStudentCommentDetails.STUCOMMENT_DESCRIPTION = SCD.STUCOMMENT_Q3_DESC 
