			SUBCAT_NAME,
            SUBCAT_DESC,
            SUBCAT_PARENT_ID,
            STUMARKS_CM_ID,
            STUMARKS_SEC_ID,
            SUBJECT_ID 
           
)
Select  STU_GUID,
STU_ROLL_NUMBER,
STU_FIRST_NAME,
STU_LAST_NAME,    
  SUBCAT_ID,
  SUBCAT_NAME,
  SUBCAT_DESC,
  SUBCAT_PARENT_ID,
  @ClassID,
  @SectionID,
  SUBCAT_SUBJECT_ID    
From StudentMaster,
SubjectCategoryDetails
Join #TempIds 
On SUBCAT_ID = Id
Where STU_CM_ID = @ClassID 
And STU_SEC_ID = @SectionID 
And STU_CMP_ID = @CompanyID 
And STU_SCH_ID  = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End    

if @ExamUnit ='Quarter1' 
Begin
	Update #TempStudentMarksDetails
	Set #TempStudentMarksDetails.STUMARKS_ID = SMD.STUMARKS_ID,
	#TempStudentMarksDetails.STUMARKS_MARKS1 = SMD.STUMARKS_Q1_MARKS1,
	#TempStudentMarksDetails.STUMARKS_MARKS2 = SMD.STUMARKS_Q1_MARKS2
From StudentMarksDetails SMD
Where STUMARKS_STU_GUID = #TempStudentMarksDetails.STU_GUID  
And SMD.STUMARKS_SUB_CAT_ID  = #TempStudentMarksDetails.SUBCAT_ID 
And SMD.STUMARKS_CM_ID = #TempStudentMarksDetails.STUMARKS_CM_ID
And SMD.STUMARKS_SEC_ID = #TempStudentMarksDetails.STUMARKS_SEC_ID
And SMD.STUMARKS_CMP_ID = @CompanyID 
