	#TempStudentMarksDetails.STUMARKS_MARKS1 = SMD.STUMARKS_Q2_MARKS1,
	#TempStudentMarksDetails.STUMARKS_MARKS2 = SMD.STUMARKS_Q2_MARKS2
From StudentMarksDetails SMD
Where STUMARKS_STU_GUID = #TempStudentMarksDetails.STU_GUID  
And SMD.STUMARKS_SUB_CAT_ID  = #TempStudentMarksDetails.SUBCAT_ID 
And SMD.STUMARKS_CM_ID = #TempStudentMarksDetails.STUMARKS_CM_ID
And SMD.STUMARKS_SEC_ID = #TempStudentMarksDetails.STUMARKS_SEC_ID
And SMD.STUMARKS_CMP_ID = @CompanyID 
And SMD.STUMARKS_SCH_ID = @SchoolID 
End

else if @ExamUnit ='Quarter3' 
Begin
	Update #TempStudentMarksDetails
	Set #TempStudentMarksDetails.STUMARKS_ID = SMD.STUMARKS_ID,
	#TempStudentMarksDetails.STUMARKS_MARKS1 = SMD.STUMARKS_Q3_MARKS1,
	#TempStudentMarksDetails.STUMARKS_MARKS2 = SMD.STUMARKS_Q3_MARKS2
From StudentMarksDetails SMD
Where STUMARKS_STU_GUID = #TempStudentMarksDetails.STU_GUID  
And SMD.STUMARKS_SUB_CAT_ID  = #TempStudentMarksDetails.SUBCAT_ID 
And SMD.STUMARKS_CM_ID = #TempStudentMarksDetails.STUMARKS_CM_ID
And SMD.STUMARKS_SEC_ID = #TempStudentMarksDetails.STUMARKS_SEC_ID
And SMD.STUMARKS_CMP_ID = @CompanyID 
And SMD.STUMARKS_SCH_ID = @SchoolID 
End

Update #TempStudentMarksDetails 
Set STUMARKS_EXAMTYPE = isnull(CM_EXAM_ASSESMENT,'') 
From ClassMaster 
Where CM_ID = STUMARKS_CM_ID 
And CM_CMP_ID = @CompanyID 
And CM_SCH_ID = @SchoolID 

Select 

	STU_GUID,
	STU_ROLL_NUMBER,
	STU_FIRST_NAME,
	STU_LAST_NAME ,
	isnull(STUMARKS_ID,0) as STUMARKS_ID,
	STUMARKS_MARKS1,
	STUMARKS_MARKS2,
	isnull(SUBJECT_ID,0) as SUBJECT_ID,
	SUBCAT_ID ,
	SUBCAT_NAME ,
    SUBCAT_DESC ,
    SUBCAT_PARENT_ID ,
    isnull(STUMARKS_CM_ID,0) as STUMARKS_CM_ID,
    isnull(STUMARKS_SEC_ID,0) as STUMARKS_SEC_ID,
    STUMARKS_EXAMTYPE,
    @ExamUnit as 'ExamTypeValue'
    
    From #TempStudentMarksDetails 
    --Where STU_GUID= '794d9835-cb4e-4280-be3e-a4afd699763b'
	Order By SUBCAT_ID


Drop table #TempClassSubjectIDList
Drop table #TempIds
Drop table #TempStudentMarksDetails


End




