 #TempStudentGradeDetails.STUGRADE_FA2_GRADE  = SMD.STUGRADE_FA2_GRADE,  

 #TempStudentGradeDetails.STUGRADE_SA1_GRADE  = SMD.STUGRADE_SA1_GRADE  

From StudentGradeDetails SMD  

Where STUGRADE_STU_GUID = @STU_GUID   

And SMD.STUGRADE_SCHOLASTIC_CAT_ID  = #TempStudentGradeDetails.SUBCAT_ID   

And SMD.STUGRADE_CM_ID = #TempStudentGradeDetails.STUGRADE_CM_ID  

And SMD.STUGRADE_SEC_ID = #TempStudentGradeDetails.STUGRADE_SEC_ID  

and SMD.STUGRADE_SESSION = @Session   

And SMD.STUGRADE_CMP_ID = @CompanyID   

And SMD.STUGRADE_SCH_ID  = @SchoolID   

End  

Else if @ExamUnit ='Semester2'  

Begin  

Update #TempStudentGradeDetails  

Set #TempStudentGradeDetails.STUGRADE_ID = SMD.STUGRADE_ID,  

 #TempStudentGradeDetails.STUGRADE_SCHOlASTIC_CAT_ID  = SMD.STUGRADE_SCHOlASTIC_CAT_ID,  

 #TempStudentGradeDetails.STUGRADE_FA1_GRADE  = SMD.STUGRADE_FA3_GRADE,  

 #TempStudentGradeDetails.STUGRADE_FA2_GRADE  = SMD.STUGRADE_FA4_GRADE,  

 #TempStudentGradeDetails.STUGRADE_SA1_GRADE  = SMD.STUGRADE_SA2_GRADE  

From StudentGradeDetails SMD  

Where STUGRADE_STU_GUID = @STU_GUID   

And SMD.STUGRADE_SCHOLASTIC_CAT_ID  = #TempStudentGradeDetails.SUBCAT_ID   

And SMD.STUGRADE_CM_ID = #TempStudentGradeDetails.STUGRADE_CM_ID  

And SMD.STUGRADE_SEC_ID = #TempStudentGradeDetails.STUGRADE_SEC_ID  

and SMD.STUGRADE_SESSION = @Session   

And SMD.STUGRADE_CMP_ID = @CompanyID   

And SMD.STUGRADE_SCH_ID  = @SchoolID   

End  

  

Update #TempStudentGradeDetails   

Set STUGRADE_EXAMTYPE  = isnull(CM_EXAM_ASSESMENT,'')   

From ClassMaster   

Where CM_ID = STUGRADE_CM_ID   

And CM_CMP_ID = @CompanyID   

And CM_SCH_ID = @SchoolID   

  

  

Insert Into #TempParentIDList  

(  

 ParentID   

)  

Select Distinct SUBCAT_PARENT_ID   

From #TempStudentGradeDetails  

Where SUBCAT_PARENT_ID is not null  

  

Update #TempStudentGradeDetails  

Set #TempStudentGradeDetails.STUGRADE_FA1_GRADE  = '--NA--',  

 #TempStudentGradeDetails.STUGRADE_FA2_GRADE  = '--NA--',  

 #TempStudentGradeDetails.STUGRADE_SA1_GRADE  = '--NA--'  

Where SUBCAT_ID in (Select ParentID From #TempParentIDList)  

  



Update #TempStudentGradeDetails  



Set #TempStudentGradeDetails.STUGRADE_FA1_GRADE  = '--NA--',  

 #TempStudentGradeDetails.STUGRADE_FA2_GRADE  = '--NA--',  

 #TempStudentGradeDetails.STUGRADE_SA1_GRADE  = '--NA--'   



Where SUBCAT_PARENT_ID =1

  

  

Delete From #TempStudentGradeDetails  

Where   

SUBCAT_PARENT_ID is not null  

 and SUBCAT_ID not in (  

      Select Distinct SC.SCOHUD_SCHOLASTIC_ID from ScholasticUnitDetail SC  

      Where SC.SCOHUD_UNIT_ID = @ExamUnitID  

      )  

And SUBCAT_ID <> 1  

And isnull(STUGRADE_FA1_GRADE,'') <> '--NA--'  

  







  

Select isnull(STUGRADE_ID,0) as STUGRADE_ID,  

 isnull(STUGRADE_SCHOlASTIC_CAT_ID,0) as STUGRADE_SCHOlASTIC_CAT_ID,  

 STUGRADE_FA1_GRADE,  

 STUGRADE_FA2_GRADE,  

 STUGRADE_SA1_GRADE,  

   

 SUBCAT_ID ,  

 SUBCAT_NAME ,  

    SUBCAT_DESC ,  

    SUBCAT_PARENT_ID ,  

    isnull(STUGRADE_CM_ID,0) as STUGRADE_CM_ID,  

    isnull(STUGRADE_SEC_ID,0) as STUGRADE_SEC_ID ,  

    STUGRADE_EXAMTYPE,  

    STUGRADE_SUBJECT_ID  

    From #TempStudentGradeDetails   

 Order By SUBCAT_ID  

  

Drop table #TempParentIDList  

Drop table #TempClassSubjectIDList  

Drop table #TempIds  

Drop table #TempStudentGradeDetails  

  

  

End  


GO
