@SectionID int,
@ExamUnit varchar(50),
@Session varchar(50),
@CompanyID int,
@SchoolID int
As
Begin



Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0  


---------------------Temporary to Store the Student Marks Details----------------
CREATE TABLE #TempStudentMarksDetails
(
	STU_GUID uniqueIdentifier,
	STU_ROLL_NUMBER int,
	STU_FIRST_NAME VARCHAR(50),
	STU_LAST_NAME VARCHAR(50),
	STUMARKS_ID int,
	STUMARKS_MARKS1 [decimal](18, 2) NULL,
	STUMARKS_MARKS2 [decimal](18, 2) NULL,
	STUMARKS_SA_MARKS [decimal](18, 2) NULL,
	SUBCAT_ID int,
	SUBCAT_NAME varchar(50),
    SUBCAT_DESC varchar(50),
    SUBCAT_PARENT_ID int,
    STUMARKS_CM_ID int,
    STUMARKS_SEC_ID int,
    STUMARKS_EXAMTYPE varchar(50),
    SUBJECT_ID int,
	
)


---------------------Temporary to Store the Student Subject List----------------
	Create Table #TempClassSubjectIDList
	(
		SUB_ID int
	)

-----------------Temporary table to store the Subject and Sub Category List--------
	Create table #TempIds
	(
		Id int
	)

------------------------Inserting Student Subject IDS into ----------------------
------------------------#TempClassSubjectIDList table ---------------------------
Insert into #TempClassSubjectIDList
(
	SUB_ID
) 
Select CLSUBD_SUB_ID From ClassSubjectDetail 
Where CLSUBD_CM_ID = @ClassID 
And CLSUBD_SUB_ID Not in (Select SUB_ID from SubjectMaster Where SUB_CMP_ID = @CompanyID
						  And SUB_SCH_ID = @SchoolID
						  And SUB_Name ='Activity')
--Insert into #TempClassSubjectIDList
--(
--	SUB_ID
--) 
--values (2)




;WITH CatTB(SUBCAT_ID)
AS
( 
SELECT SUBCAT_ID
FROM SubjectCategoryDetails

WHERE SUBCAT_SUBJECT_ID in (Select  SUB_ID from #TempClassSubjectIDList)
And SUBCAT_CMP_ID = @CompanyID 
And SUBCAT_SCH_ID = @SchoolID 
UNION ALL
SELECT C.SUBCAT_ID
FROM SubjectCategoryDetails AS C
JOIN CatTB AS CT
ON C.SUBCAT_PARENT_ID = CT.SUBCAT_ID
Where  C.SUBCAT_CMP_ID = @CompanyID 
And C.SUBCAT_SCH_ID = @SchoolID 
)
Insert Into #TempIds
(
Id)
SELECT SUBCAT_ID FROM CatTB
	
--Select * from #TempIds

--Select * from SubjectCategoryDetails
--Join #TempIds 
--On SUBCAT_ID = Id

--Insert into #TempIds
--(
--	Id
--) 
--values (1)


-----------Inserting the Subject Category and Sub Categories ----------
----------- Temporary Table Into #TempStudentMarksDetails Table---------
Insert Into #TempStudentMarksDetails
(
			
			STU_GUID ,
			STU_ROLL_NUMBER,
			STU_FIRST_NAME ,
			STU_LAST_NAME ,
			SUBCAT_ID,
			SUBCAT_NAME,
            SUBCAT_DESC,
            SUBCAT_PARENT_ID,
            STUMARKS_CM_ID,
            STUMARKS_SEC_ID,
            SUBJECT_ID 
           
)
Select  STU_GUID,
STU_ROLL_NUMBER,
STU_FIRST_NAME,
STU_LAST_NAME,    
  SUBCAT_ID,
  SUBCAT_NAME,
  SUBCAT_DESC,
  SUBCAT_PARENT_ID,
  @ClassID,
  @SectionID,
  SUBCAT_SUBJECT_ID    
From StudentMaster,
SubjectCategoryDetails
Join #TempIds 
On SUBCAT_ID = Id
Where STU_CM_ID = @ClassID 
And STU_SEC_ID = @SectionID 
And STU_CMP_ID = @CompanyID 
And STU_SCH_ID  = @SchoolID 
And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End  

if @ExamUnit ='Semester1' 
Begin
	Update #TempStudentMarksDetails
	Set #TempStudentMarksDetails.STUMARKS_ID = SMD.STUMARKS_ID,
	#TempStudentMarksDetails.STUMARKS_MARKS1 = SMD.STUMARKS_FA1,
	#TempStudentMarksDetails.STUMARKS_MARKS2 = SMD.STUMARKS_FA2,
	#TempStudentMarksDetails.STUMARKS_SA_MARKS = SMD.STUMARKS_SA1
From StudentMarksDetails SMD
Where STUMARKS_STU_GUID = #TempStudentMarksDetails.STU_GUID  
And SMD.STUMARKS_SUB_CAT_ID  = #TempStudentMarksDetails.SUBCAT_ID 
And SMD.STUMARKS_CM_ID = #TempStudentMarksDetails.STUMARKS_CM_ID
And SMD.STUMARKS_SEC_ID = #TempStudentMarksDetails.STUMARKS_SEC_ID
And SMD.STUMARKS_CMP_ID = @CompanyID 
And SMD.STUMARKS_SCH_ID = @SchoolID 
