Update #TempStudentMarksDetails 
Set STUMARKS_EXAMTYPE = isnull(CM_EXAM_ASSESMENT,'') 
From ClassMaster 
Where CM_ID = STUMARKS_CM_ID 
And CM_CMP_ID = @CompanyID 
And CM_SCH_ID = @SchoolID 

Select 

	STU_GUID,
	STU_ROLL_NUMBER,
