    @ExamUnit as 'ExamTypeValue'
    
    From #TempStudentMarksDetails 
    --Where STU_GUID= '794d9835-cb4e-4280-be3e-a4afd699763b'
	Order By SUBCAT_ID


Drop table #TempClassSubjectIDList
Drop table #TempIds
Drop table #TempStudentMarksDetails


