--exec usp_getStudentSummaryReportData 1,1
CREATE Procedure [dbo].[usp_getStudentSummaryReportData]
@CompanyID int,
@SchoolID int
As
Begin

Declare
@RecStatus varchar(50)
Select @RecStatus = SYSP_PARAMETER_VALUE From SystemParameters 
					Where SYSP_PARAMETER_NAME = 'DisplayRecords'
					And SYSP_CMP_ID = @CompanyID
					And SYSP_SCH_ID = @SchoolID

Declare
@DisplayRecord int
if @RecStatus = 'A'
Set @DisplayRecord = -1
else if @RecStatus = 'T'
Set @DisplayRecord = 1
else if @RecStatus = 'F'
Set @DisplayRecord = 0  

Create Table #TempClassAgeGrades
(
	AgeInYears int,
	PG_M int,
	PG_F int,
	MI_M int,
	MI_F int,
	MII_M int,
	MII_F int,
	MIII_M int,
	MIII_F int,
	I_M int,
	I_F int,
	II_M int,
	II_F int,
	III_M int,
	III_F int,
	IV_M int,
	IV_F int,
	V_M int,
	V_F int,
	VI_M int,
	VI_F int,
	VII_M int,
	VII_F int,
	VIII_M int,
	VIII_F int,
	IX_M int,
	IX_F int,
	X_M int,
	X_F int
	)

Declare @AgeYear int
Declare @CM_NAME varchar(50)
Declare @CM_FULL_NAME varchar(50)
Declare @CM_ID int
Declare @StrQuery varchar(1000)
Set @AgeYear = 1
While @AgeYear <=1
Begin
	Insert Into #TempClassAgeGrades
	(
		AgeInYears
	)
	Values(@AgeYear)
	
	Set @AgeYear = @AgeYear +1

End

	  Declare CursorClass Cursor For  
        Select CM_Name,CM_ID
        From Classmaster
        Where CM_CMP_ID = @CompanyID
        And CM_SCH_ID = @SchoolID
       
			 --Open the cursor
			 OPEN CursorClass   

			--Fetching the values from cursor
			 FETCH NEXT FROM CursorClass 
			 INTO @CM_NAME,@CM_ID
			 WHILE @@FETCH_STATUS = 0   
			 BEGIN 
			 ----------------Calculating the total number of Boys--------------
		            if exists (Select 'X' From StudentMaster 
							   Where STU_CM_ID = @CM_ID
							   And STU_CMP_ID = @CompanyID 
							   And STU_SCH_ID = @SchoolID
							   AND isnull(STU_GENDER,'') = 'M' 
							   And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End 
							   ) 
					Begin
					
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_M=(Select Count(''X'')'  
										+' from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										 AND isnull(STU_GENDER,'''') = ''M'''
										+')'
										
										
						--print @StrQuery
						exec (@StrQuery)  
						
				End
				 if exists (Select 'X' From StudentMaster 
							   Where STU_CM_ID = @CM_ID
							   And STU_CMP_ID = @CompanyID 
							   And STU_SCH_ID = @SchoolID
							   AND isnull(STU_GENDER,'') = 'F'
							   And Case When @DisplayRecord = -1 then
									1
								else
									STU_IS_ACTIVE
								End = 
								Case When @DisplayRecord = -1 then
									1
								else
									@DisplayRecord
								End  
							   ) 
					Begin
					
						Set @StrQuery = 'UPDATE  #TempClassAgeGrades
										Set '+@CM_NAME+'_F=(Select Count(''X'')'  
										+' from StudentMaster' 
										+' Where STU_CM_ID ='+LTRIM(Str(@CM_ID))
										+' And STU_CMP_ID ='+LTRIM(Str(@CompanyID)) 
										+' And STU_SCH_ID = '+LTRIM(Str(@SchoolID))
										+' And Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											STU_IS_ACTIVE
										End = 
										Case When '+Ltrim(Str(@DisplayRecord))+' = -1 then
											1
										else
											'+Ltrim(str(@DisplayRecord))+
										' End
										 AND isnull(STU_GENDER,'''') = ''F'''
										+')'
										
										
						--print @StrQuery
						exec (@StrQuery)  
						
				End
					
		
			  --Fetching the values from cursor
				 FETCH NEXT FROM CursorClass 
				 INTO @CM_NAME,@CM_ID
			 END
			CLOSE CursorClass   
			DEALLOCATE CursorClass 
		


Select  Ltrim(Str(AgeInYears)) as AgeInYears
		 ,
		 isnull(PG_M ,0) as   PG_M,
	isnull(PG_F ,0) as   PG_F,
	isnull(MI_M ,0) as MI_M,
	isnull(MI_F ,0)  as MI_F,
	isnull(MII_M ,0) as  MII_M,
	isnull(MII_F ,0)  as MII_F,
	isnull(MIII_M ,0) as MIII_M,
	isnull(MIII_F ,0) as MIII_F,
	isnull(I_M ,0)  as I_M,
	isnull(I_F ,0) as I_F,
	isnull(II_M ,0) as II_M ,
	isnull(II_F ,0) as II_F,
	isnull(III_M ,0) as III_M,
	isnull(III_F ,0) as III_F ,
	isnull(IV_M ,0) as IV_M,
	isnull(IV_F ,0) as IV_F,
	isnull(V_M ,0) as V_M,
	isnull(V_F ,0) as V_F,
	isnull(VI_M ,0) as VI_M,
	isnull(VI_F ,0) as VI_F,
	isnull(VII_M ,0) as VII_M,
	isnull(VII_F ,0) as VII_F,
	isnull(VIII_M ,0) as VIII_M,
	isnull(VIII_F ,0) as VIII_F,
	isnull(IX_M ,0) as IX_M,
	isnull(IX_F ,0) as IX_F,
	isnull(X_M ,0) as X_M,
	isnull(	X_F ,0) as X_F from #TempClassAgeGrades
Union All
Select  'Total' as AgeInYears
		 ,
		 Sum(isnull(PG_M ,0)) as   PG_M,
	Sum(isnull(PG_F ,0)) as   PG_F,
	Sum(isnull(MI_M ,0)) as MI_M,
	Sum(isnull(MI_F ,0))  as MI_F,
	Sum(isnull(MII_M ,0)) as  MII_M,
	Sum(isnull(MII_F ,0))  as MII_F,
	Sum(isnull(MIII_M ,0)) as MIII_M,
	Sum(isnull(MIII_F ,0)) as MIII_F,
	Sum(isnull(I_M ,0))  as I_M,
	Sum(isnull(I_F ,0)) as I_F,
	Sum(isnull(II_M ,0)) as II_M ,
	Sum(isnull(II_F ,0)) as II_F,
	Sum(isnull(III_M ,0)) as III_M,
	Sum(isnull(III_F ,0)) as III_F ,
	Sum(isnull(IV_M ,0)) as IV_M,
	Sum(isnull(IV_F ,0)) as IV_F,
	Sum(isnull(V_M ,0)) as V_M,
	Sum(isnull(V_F ,0)) as V_F,
	Sum(isnull(VI_M ,0)) as VI_M,
	Sum(isnull(VI_F ,0)) as VI_F,
	Sum(isnull(VII_M ,0)) as VII_M,
	Sum(isnull(VII_F ,0)) as VII_F,
	Sum(isnull(VIII_M ,0)) as VIII_M,
	Sum(isnull(VIII_F ,0)) as VIII_F,
	Sum(isnull(IX_M ,0)) as IX_M,
	Sum(isnull(IX_F ,0)) as IX_F,
	Sum(isnull(X_M ,0)) as X_M,
	Sum(isnull(	X_F ,0)) as X_F
	 from #TempClassAgeGrades

Drop Table #TempClassAgeGrades



End




GO
/****** Object:  StoredProcedure [dbo].[usp_getSubjectSubCategoriesList]    Script Date: 11-01-2025 14:40:06 ******/
SET ANSI_NULLS ON
