--usp_getSubjectSubCategoriesList 2,1001 

CREATE Procedure [dbo].[usp_getSubjectSubCategoriesList]  

@CompanyID int,  

@SchoolID int  

As  

Begin  


Declare
@CurrentSessionValue  varchar(50)

Select @CurrentSessionValue = isnull(MAX(SESSION_VALUE),'') From SessionMaster 
Where SESSION_CMP_ID = @CompanyID
And SESSION_SCH_ID = @SchoolID


Create Table #TempSubjectCategoryDetails  

(  

 SUBCAT_ID int,  

 SUBCAT_NAME varchar(250),  

 SUBCAT_DESC varchar(250),  

 SUBCAT_PARENT_ID int,  

 SUBCAT_TYPE varchar(10),  

 SUBCAT_EXAM_CAT_ID int,   

 SUBCAT_EXAM_CAT_NAME varchar(100),  

 SUBCAT_SUBJECT_ID int  

)  

  

  

-----------Inserting the Missing Subject Headings in SubjectCategoryDetails Table---------  

Declare  

@SUBCAT_PARENT_ID int  

Select @SUBCAT_PARENT_ID = SUBCAT_ID From  SubjectCategoryDetails Where SUBCAT_ID = 1  

Insert Into SubjectCategoryDetails  

(  

   [SUBCAT_NAME]  

    ,[SUBCAT_DESC]  

    ,[SUBCAT_PARENT_ID]  

    ,[SUBCAT_SUBJECT_ID]  

    ,[CREATED_BY]  

    ,[CREATED_DATE]  

    ,[MODIFIED_BY]  

    ,[MODIFIED_DATE]  

    ,SUBCAT_CMP_ID  

    ,SUBCAT_SCH_ID    
	,SUBCAT_SESSION
)  

Select SUB_NAME,  

    SUB_NAME,  

    @SUBCAT_PARENT_ID,  

    SUB_ID,  

    'Administrator',  

    GETDATE(),  

    'Administrator',  

    GETDATE()  

    ,SUB_CMP_ID  

    ,SUB_SCH_ID  
	,@CurrentSessionValue
From SubjectMaster  

Where SUB_ID not in (Select  isnull(SUBCAT_SUBJECT_ID,0) From SubjectCategoryDetails 
				     Where SUBCAT_SESSION = @CurrentSessionValue
					 And SUBCAT_CMP_ID = @CompanyID
					 And SUBCAT_SCH_ID = @SchoolID
					 
					 )  

And SUB_CMP_ID = @CompanyID  

And SUB_SCH_ID = @SchoolID    

And SUB_NAME <> 'Activity'  

  
Insert Into #TempSubjectCategoryDetails  

(  

 SUBCAT_ID,  

 SUBCAT_NAME,  

 SUBCAT_DESC,  

 SUBCAT_PARENT_ID,  

 SUBCAT_TYPE,  

 SUBCAT_EXAM_CAT_ID,   

 SUBCAT_SUBJECT_ID   

)  

Select SUBCAT_ID,  

 SUBCAT_NAME,  

 SUBCAT_DESC,  

 SUBCAT_PARENT_ID,  

 'A',  

 2,  

 SUBCAT_SUBJECT_ID   

 From SubjectCategoryDetails   

 Where SUBCAT_CMP_ID = @CompanyID   

 And SUBCAT_SCH_ID = @SchoolID   
 And SUBCAT_SESSION = @CurrentSessionValue
	

  

Insert Into #TempSubjectCategoryDetails  

(  

 SUBCAT_ID,  

 SUBCAT_NAME,  

 SUBCAT_DESC,  

 SUBCAT_PARENT_ID,  

 SUBCAT_TYPE,  

 SUBCAT_EXAM_CAT_ID,   

 SUBCAT_SUBJECT_ID   

)  

Select SCHOLASTIC_ID+1000,  

 SCHOLASTIC_NAME,  

 SCHOLASTIC_DESC,  

 SCHOLASTIC_PARENT_ID+1000,  

 'S',  

 1,  

 SCHOLASTIC_SUBJECT_ID    

 From ScholasticMaster    

 Where SCHOLASTIC_CMP_ID = @CompanyID   

 And SCHOLASTIC_SCH_ID = @SchoolID   
 And SCHOLASTIC_SESSION = @CurrentSessionValue
  

Select * from #TempSubjectCategoryDetails  

