From TimeTableSetupDetails 
Where TTSETUP_TTSESSION_ID = @SessionID
And TTSETUP_CMP_ID = @CompanyID 
And TTSETUP_SCH_ID = @SchoolID   

Declare 
@Counter int
Create Table #TempTimeTableData
(
	Period_ID int,
	Period_Description varchar(50),
	Period_TimeSlot varchar(50),
	ClassSectionID_Day1 int,
	SubjectID_Day1 int,
	ClassSectionID_Day2 int,
	SubjectID_Day2 int,
	ClassSectionID_Day3 int,
	SubjectID_Day3 int,
	ClassSectionID_Day4 int,
	SubjectID_Day4 int,
	ClassSectionID_Day5 int,
	SubjectID_Day5 int,
	ClassSectionID_Day6 int,
	SubjectID_Day6 int,
	
	ClassSection_Day1 varchar(100),
	SubjectName_Day1 varchar(100),
	ClassSection_Day2 varchar(100),
	SubjectName_Day2 varchar(100),
	ClassSection_Day3 varchar(100),
	SubjectName_Day3 varchar(100),
	ClassSection_Day4 varchar(100),
	SubjectName_Day4 varchar(100),
	ClassSection_Day5 varchar(100),
	SubjectName_Day5 varchar(100),
	ClassSection_Day6 varchar(100),
	SubjectName_Day6 varchar(100)
)

Insert into #TempTimeTableData
(
	Period_ID,
	Period_Description,
	Period_TimeSlot
)
Select TTPERIOD_ID,
	   TTPERIOD_DESCTIPTION,
	   Replace(Replace(convert(varchar,TTPERIOD_START_TIME,0),'AM', ' AM'),'PM', ' PM')
	  + ' - '
	  +
	   Replace(Replace(convert(varchar,TTPERIOD_END_TIME,0),'AM', ' AM'),'PM', ' PM')
    From TimeTablePeriodMaster 
	Where TTPERIOD_TTSESSION_ID =@SessionID 
	And TTPERIOD_NUMBER<=@TotalPeriod 
	And TTPERIOD_CMP_ID = @CompanyID 
	And TTPERIOD_SCH_ID = @SchoolID  
 And TTPERIOD_SESSION = @SessionYear 
	
---------------------Updating Teacher ID and Subject ID in Temp Table------
	
	Set @Counter = 1
	Declare 
	@Query varchar(5000)
	While @Counter <=6
	Begin
		Set @Query = '
		Update #TempTimeTableData 
		Set ClassSectionID_Day'+LTRIM(Str(@Counter))+'=  TTD.TTDETAIL_SEC_ID,
		SubjectID_Day'+LTRIM(Str(@Counter)) +'= TTD.TTDETAIL_SUB_ID 
		From TimeTableDetails TTD
		Where TTD.TTDETAIL_PERIOD_ID = #TempTimeTableData.Period_ID
		And  TTD.TTDETAIL_TEACHER_ID ='+LTRIM(str(@TeacherID))+' 
		And TTD.TTDETAIL_SESSION_ID = '+Ltrim(Str(@SessionID ))+' 
		And TTD.TTDETAIL_DAY_OF_WEEK ='+LTRIM(Str(@Counter))+'
		And TTD.TTDETAIL_CMP_ID  = '+LTRIM(Str(@CompanyID))+'
		And TTD.TTDETAIL_SCH_ID  = '+LTRIM(Str(@SchoolID))+'
		And TTD.TTDETAIL_SESSION  = '''+@SessionYear+''''
		Execute (@Query)
		
		-------------------Setting Subject Name------------------------
		Set @Query = '
		Update #TempTimeTableData 
		Set SubjectName_Day'+LTRIM(Str(@Counter))+'=  TTD.SUB_NAME
		From SubjectMaster TTD
		Where TTD.SUB_ID = #TempTimeTableData.SubjectID_Day'+LTRIM(Str(@Counter))+'
		And TTD.SUB_CMP_ID  = '+LTRIM(Str(@CompanyID))+'
		And TTD.SUB_SCH_ID  = '+LTRIM(Str(@SchoolID))
	Execute (@Query)
	-------------------Setting Class Section Name------------------------
		Set @Query = '
		Update #TempTimeTableData 
		Set ClassSection_Day'+LTRIM(Str(@Counter))+'=  CM_NAME+''-''+SM_NAME
		From ClassSectionDetail TTD
		Join ClassMaster
		On TTD.CL_SEC_CM_ID = CM_ID
		Join SectionMaster
		On TTD.CL_SEC_SM_ID = SM_ID
		Where TTD.CL_SEC_ID = #TempTimeTableData.ClassSectionID_Day'+LTRIM(Str(@Counter))+'
		And TTD.CL_CMP_ID  = '+LTRIM(Str(@CompanyID))+'
		And TTD.CL_SCH_ID  = '+LTRIM(Str(@SchoolID))
	
	
		--print @Query
		Execute (@Query)
		
		Set @Counter = @Counter+1 
	End

	Select Period_ID ,
	Period_Description ,
	Period_TimeSlot ,
	isnull(ClassSection_Day1,'') as TeacherName_Day1 ,
	isnull(SubjectName_Day1 ,'') as SubjectName_Day1 ,
	isnull(ClassSection_Day2 ,'')as TeacherName_Day2  ,
	isnull(SubjectName_Day2 ,'') as SubjectName_Day2 ,
	isnull(ClassSection_Day3,'') as TeacherName_Day3 ,
