CREATE procedure [dbo].[usp_getTimeTableSubstitutionData]
@SessionID int,
@ClassID int,
@SecId int,
@CompanyID int,
@SchoolID int,
@SubstitutionDate datetime
As
Begin

Declare
@TotalPeriod int , @WeekDay int, @SessionYear varchar(50) 

Select  @TotalPeriod = TTSETUP_TOTAL_PERIODS
, @SessionYear = isnull(TTSETUP_SESSION,'')
From TimeTableSetupDetails 
Where TTSETUP_TTSESSION_ID = @SessionID
And TTSETUP_CMP_ID = @CompanyID 
And TTSETUP_SCH_ID = @SchoolID 

Declare 
@Counter int
Create Table #TempTimeTableData
(
	Period_ID int,
	Period_Description varchar(50),
	Period_TimeSlot varchar(50),
	TeacherID_Day int,
	SubjectID_Day int,
	NewTeacherID_Day int,
	Substitution_ID int
	
)


Insert into #TempTimeTableData
(
	Period_ID,
	Period_Description,
	Period_TimeSlot
)
	Select TTPERIOD_ID,
	   TTPERIOD_DESCTIPTION,
	   Replace(Replace(convert(varchar,TTPERIOD_START_TIME,0),'AM', ' AM'),'PM', ' PM')
	  + ' - '
	  +
	   Replace(Replace(convert(varchar,TTPERIOD_END_TIME,0),'AM', ' AM'),'PM', ' PM')
    From TimeTablePeriodMaster 
	Where TTPERIOD_TTSESSION_ID =@SessionID 
	And TTPERIOD_CMP_ID = @CompanyID 
		And TTPERIOD_SCH_ID = @SchoolID   
	And TTPERIOD_NUMBER<=@TotalPeriod  
And TTPERIOD_SESSION = @SessionYear
Set @WeekDay = DATEPART(DW,@SubstitutionDate)-1 
	
---------------------Updating Teacher ID and Subject ID in Temp Table------
	
	
		
		Update #TempTimeTableData 
		Set TeacherID_Day=  TTD.TTDETAIL_TEACHER_ID,
		SubjectID_Day= TTD.TTDETAIL_SUB_ID 
		From TimeTableDetails TTD
		Where TTD.TTDETAIL_PERIOD_ID = #TempTimeTableData.Period_ID
		And  TTD.TTDETAIL_CM_ID =@ClassID 
		And TTD.TTDETAIL_SEC_ID = @SecId
		And TTD.TTDETAIL_DAY_OF_WEEK = @WeekDay
		And TTD.TTDETAIL_SESSION_ID = @SessionID
		And TTD.TTDETAIL_CMP_ID  = @CompanyID
		And TTD.TTDETAIL_SCH_ID  = @SchoolID
		And TTD.TTDETAIL_SESSION = @SessionYear
		
-----------------Updating New teacherId from TimetableSubsstitution Details
	Update #TempTimeTableData 
		Set NewTeacherID_Day =  TTD.TTSUBSD_TEACHER_ID_NEW,
		Substitution_ID = isnull(TTSUBSD_ID,0)
		
		From TimeTableSubstitutionDetails TTD
		Where TTD.TTSUBSD_PERIOD_ID = #TempTimeTableData.Period_ID
		And  TTD.TTSUBSD_CM_ID =@ClassID 
		And TTD.TTSUBSD_SEC_ID = @SecId
		And TTD.TTSUBSD_SUB_ID = #TempTimeTableData.SubjectID_Day
		And TTD.TTSUBSD_TEACHER_ID = #TempTimeTableData.TeacherID_Day
		And TTD.TTSUBSD_DAY_OF_WEEK = @WeekDay
		And TTD.TTSUBSD_SUBSTITUTION_DATE = @SubstitutionDate
		And TTD.TTSUBSD_SESSION_ID = @SessionID
		And TTD.TTSUBSD_CMP_ID  = @CompanyID
		And TTD.TTSUBSD_SCH_ID  = @SchoolID
		

	
	Select Period_ID ,
	Period_Description ,
	Period_TimeSlot ,
	TeacherID_Day ,
	SubjectID_Day ,
	NewTeacherID_Day ,
	isnull(Substitution_ID,0) as Substitution_ID,
	@WeekDay as WeekDayNumber  
	From #TempTimeTableData
	
	Drop Table #TempTimeTableData
End


  





