Select TTPERIOD_ID,
	   TTPERIOD_DESCTIPTION,
	   Replace(Replace(convert(varchar,TTPERIOD_START_TIME,0),'AM', ' AM'),'PM', ' PM')
	  + ' - '
	  +
	   Replace(Replace(convert(varchar,TTPERIOD_END_TIME,0),'AM', ' AM'),'PM', ' PM'),
	   TTD.TTSUBSD_TEACHER_ID,
	   TTD.TTSUBSD_SUB_ID,
	   TTD.TTSUBSD_TEACHER_ID_NEW,
	   TTSUBSD_ID,
	   TTSUBSD_CM_ID,
	   TTSUBSD_SEC_ID,
	   TTD.TTSUBSD_SUBSTITUTION_DATE
    From TimeTablePeriodMaster
    join  TimeTableSubstitutionDetails TTD
    On TTPERIOD_ID  = TTSUBSD_PERIOD_ID
	Where TTPERIOD_TTSESSION_ID = @SessionID 
	And TTPERIOD_CMP_ID = @CompanyID 
	And TTPERIOD_SCH_ID = @SchoolID   
	And TTD.TTSUBSD_SESSION_ID = @SessionID
		And TTD.TTSUBSD_CMP_ID  = @CompanyID
		And TTD.TTSUBSD_SCH_ID  = @SchoolID
		And TTD.TTSUBSD_SUBSTITUTION_DATE >= @StartDate
		And TTD.TTSUBSD_SUBSTITUTION_DATE <= @EndDate
		And TTPERIOD_SESSION = @SessionYear
		And TTSUBSD_SESSION = @SessionYear


Update #TempTimeTableData
Set ClassSectionName = CM_NAME +'-'+SM_NAME ,
ClassOrder = isnull(CM_ORDER_BY,0)
From ClassSectionDetail
Join ClassMaster
on CL_SEC_CM_ID = CM_ID
Join SectionMaster
On CL_SEC_SM_ID = SM_ID
Where CL_SEC_ID = SEC_ID


Update #TempTimeTableData
Set TeacherName = isnull(EMP_SALUTATION,'')+ TTD.EMP_FIRST_NAME +' '+TTD.EMP_LAST_NAME
From EmpMaster TTD
Where TTD.EMP_ID = #TempTimeTableData.TeacherID_Day
And TTD.EMP_CMP_ID  = @CompanyID
And TTD.EMP_SCH_ID  = @SchoolID


Update #TempTimeTableData
Set NewTeacherName = isnull(EMP_SALUTATION,'')+ TTD.EMP_FIRST_NAME +' '+TTD.EMP_LAST_NAME
From EmpMaster TTD
Where TTD.EMP_ID = #TempTimeTableData.NewTeacherID_Day
And TTD.EMP_CMP_ID  = @CompanyID
And TTD.EMP_SCH_ID  = @SchoolID



Update #TempTimeTableData
Set SubjectName = SUB_NAME
From SubjectMaster TTD
Where TTD.SUB_ID = #TempTimeTableData.SubjectID_Day
And TTD.SUB_CMP_ID  = @CompanyID
And TTD.SUB_SCH_ID  = @SchoolID


-----------------------------Checking History Data--------------------------

if Exists (Select 'X' From TimeTableSubstitutionDetailsHistory  ttd
			Where TTD.TTSUBSDH_SESSION_ID = @SessionID
			And TTD.TTSUBSDH_CMP_ID  = @CompanyID
			And TTD.TTSUBSDH_SCH_ID  = @SchoolID
			And TTD.TTSUBSDH_SUBSTITUTION_DATE >= @StartDate
			And TTD.TTSUBSDH_SUBSTITUTION_DATE <= @EndDate
			And TTD.TTSUBSDH_SESSION = @SessionYear
		)
Begin		



Insert into #TempTimeTableDataHistory
(
	Period_ID ,
	Period_Description,
	Period_TimeSlot,  
	TeacherID_Day, 
	SubjectID_Day,
	NewTeacherID_Day ,
	Substitution_ID,
	CM_ID,
	SEC_ID,
	SubstitutionDate
 
)
Select TTPERIODH_PERIOD_ID,
	   TTPERIODH_DESCTIPTION,
	   Replace(Replace(convert(varchar,TTPERIODH_START_TIME,0),'AM', ' AM'),'PM', ' PM')
	  + ' - '
	  +
	   Replace(Replace(convert(varchar,TTPERIODH_END_TIME,0),'AM', ' AM'),'PM', ' PM'),
	   TTD.TTSUBSDH_TEACHER_ID,
	   TTD.TTSUBSDH_SUB_ID,
	   TTD.TTSUBSDH_TEACHER_ID_NEW,
	   TTSUBSDH_ID,
	   TTSUBSDH_CM_ID,
	   TTSUBSDH_SEC_ID,
	   TTD.TTSUBSDH_SUBSTITUTION_DATE
    From TimeTablePeriodMasterHistory
    join  TimeTableSubstitutionDetailsHistory TTD
    On TTPERIODH_PERIOD_ID  = TTSUBSDH_PERIOD_ID
	Where TTPERIODH_TTSESSION_ID = @SessionID 
	And TTPERIODH_CMP_ID = @CompanyID 
	And TTPERIODH_SCH_ID = @SchoolID   
	And TTD.TTSUBSDH_SESSION_ID = @SessionID
		And TTD.TTSUBSDH_CMP_ID  = @CompanyID
		And TTD.TTSUBSDH_SCH_ID  = @SchoolID
		And TTD.TTSUBSDH_SUBSTITUTION_DATE >= @StartDate
		And TTD.TTSUBSDH_SUBSTITUTION_DATE <= @EndDate
		And TTPERIODH_SESSION = @SessionYear
		And TTSUBSDH_SESSION = @SessionYear


	Update #TempTimeTableDataHistory
	Set ClassSectionName = CM_NAME +'-'+SM_NAME ,
	ClassOrder = isnull(CM_ORDER_BY,0)
	From ClassSectionDetail
	Join ClassMaster
	on CL_SEC_CM_ID = CM_ID
	Join SectionMaster
	On CL_SEC_SM_ID = SM_ID
	Where CL_SEC_ID = SEC_ID


	Update #TempTimeTableDataHistory
	Set TeacherName = isnull(EMP_SALUTATION,'')+ TTD.EMP_FIRST_NAME +' '+TTD.EMP_LAST_NAME
	From EmpMaster TTD
	Where TTD.EMP_ID = #TempTimeTableData.TeacherID_Day
	And TTD.EMP_CMP_ID  = @CompanyID
	And TTD.EMP_SCH_ID  = @SchoolID


	Update #TempTimeTableDataHistory
	Set NewTeacherName = isnull(EMP_SALUTATION,'')+ TTD.EMP_FIRST_NAME +' '+TTD.EMP_LAST_NAME
	From EmpMaster TTD
	Where TTD.EMP_ID = #TempTimeTableData.NewTeacherID_Day
	And TTD.EMP_CMP_ID  = @CompanyID
	And TTD.EMP_SCH_ID  = @SchoolID



	Update #TempTimeTableDataHistory
	Set SubjectName = SUB_NAME
	From SubjectMaster TTD
	Where TTD.SUB_ID = #TempTimeTableData.SubjectID_Day
	And TTD.SUB_CMP_ID  = @CompanyID
	And TTD.SUB_SCH_ID  = @SchoolID

End

	
	Select Period_ID ,
	Period_Description ,
	Period_TimeSlot ,

	SubjectName ,
	TeacherName ,
	NewTeacherName ,
	ClassSectionName ,
	isnull(ClassOrder,0) as ClassOrder,
	SubstitutionDate
	
	From #TempTimeTableData
	Union
	Select Period_ID ,
	Period_Description ,
	Period_TimeSlot ,

	SubjectName ,
	TeacherName ,
	NewTeacherName ,
	ClassSectionName ,
	isnull(ClassOrder,0) as ClassOrder,
	SubstitutionDate
	From #TempTimeTableDataHistory
	Order By 1
	
	Drop Table #TempTimeTableData
End


GO
/****** Object:  StoredProcedure [dbo].[usp_select_SMSTaskSchedule]    Script Date: 11-01-2025 14:40:06 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO




  
  
  
--usp_select_SMSTaskSchedule 5  
CREATE Procedure [dbo].[usp_select_SMSTaskSchedule]    
(    
 @day As Integer  )    
As    
Begin    
Declare @query varchar(3999)    
  
Set @query='Select SMSTask.STS_ID, 
		   SMSTask.STS_NAME,   
		   SMSTaskSchedule.STS_SCHEDULE_STARTTIME     
   From SMSTaskSchedule Join SMSTask    
   on SMSTaskSchedule.STS_SCHEDULE_TASK_ID=SMSTask.STS_ID'    
If @day=1    
Begin    
  Set @query=@query + ' Where STS_SCHEDULE_Sunday=1'    
End    
Else If @day=2    
Begin    
 Set @query=@query+' Where STS_SCHEDULE_Monday=1'    
End    
Else If @day=3    
Begin    
 Set @query=@query+' Where STS_SCHEDULE_Tuesday=1'    
End    
Else If @day=4    
Begin    
 Set @query=@query+' Where STS_SCHEDULE_Wednesday=1'    
End    
Else If @day=5    
Begin    
 Set @query=@query+' Where STS_SCHEDULE_THRUSDAY=1'    
End    
Else If @day=6    
Begin    
 Set @query=@query+' Where STS_SCHEDULE_Friday=1'    
End    
Else If @day=7    
Begin    
 Set @query=@query+' Where STS_SCHEDULE_Saturday=1'    
End    
 Set @query=@query + ' And STS_STATUS_ID = 1 Order by SMSTaskSchedule.STS_SCHEDULE_STARTTIME'    
--Exec(@query)    
  
  
CREATE TABLE #tempSMSTaskScheduleMain(        
STS_TaskId int,        
STS_TaskName varchar(100),        
 STS_StartTime datetime,        
)    
  
  
   
Insert Into #tempSMSTaskScheduleMain         
Exec(@query)        
     
Update #tempSMSTaskScheduleMain         
Set STS_StartTime = Convert(datetime, Convert(varchar(4),Datepart(year,getdate()))+'-'+Convert(varchar(3),Datepart(month,getdate()))+'-'+Convert(varchar(3),Datepart(day,getdate()))+' '+ RIGHT(STS_StartTime,7))     
From #tempSMSTaskScheduleMain     
  
Select STS_TaskID as STS_TASK_ID,   
STS_TaskName,   
STS_StartTime,
STS_NOTIFICATION_SEND_EMAIL,
STS_NOTIFICATION_SEND_SMS,
STS_NOTIFICATION_RECEIEVER_ID ,
NOTIFICATION_RECEIVER_NAME as STS_NOTIFICATION_RECEIVER,
STS_REPEAT_SCHEDULE,
STS_STATUS_ID ,
STS_LAST_RUN_DATE,
STS_LAST_RUN_STATUS_ID,

 STSSM_NAME  as STS_STATUS
from #tempSMSTaskScheduleMain 
Join SMSTask 
On  STS_TaskID = STS_ID
Join NotificationReceiverMaster 
On STS_NOTIFICATION_RECEIEVER_ID  = NOTIFICATION_RECEIVER_ID 
Join SMSTaskStatusMaster 
on STS_STATUS_ID = STSSM_ID 
Where (STS_LAST_RUN_STATUS_ID is null or  STS_LAST_RUN_STATUS_ID <> 4 )
And (STS_LAST_RUN_DATE is null 
or  
Convert(datetime, Convert(varchar(4),Datepart(year,STS_LAST_RUN_DATE))+'-'+Convert(varchar(3),Datepart(month,STS_LAST_RUN_DATE))+'-'+Convert(varchar(3),Datepart(day,STS_LAST_RUN_DATE)))
<>
Convert(datetime, Convert(varchar(4),Datepart(year,STS_StartTime))+'-'+Convert(varchar(3),Datepart(month,STS_StartTime))+'-'+Convert(varchar(3),Datepart(day,STS_StartTime)))

)
--Where ATS_StartTime>=GETDATE()   
Order By STS_StartTime  

  
Delete From  #tempSMSTaskScheduleMain  
  
End    
 

GO
