CREATE Procedure [dbo].[usp_UpdateStudentFeesDiscountData]
@ClassID int,
@FeesCatID int
as
Begin

Declare
@FeesCatName varchar(100)

Select @FeesCatName =FCM_CAT_NAME From FeesCategoryMaster Where FCM_ID   = @FeesCatId

if @FeesCatName = 'Annual Charges'
Begin
	Update StudentMaster 
	Set STU_ANNUAL_FFES = isnull(FCD_AMOUNT,0) 
	From FeeClassDetails 
	Where FCD_CM_ID = @ClassID
	And FCD_FEE_CAT_ID = @FeesCatId 
	And STU_CM_ID = @CLassId

End
else if @FeesCatName ='Tuition Fees'
Begin
	Update StudentMaster 
		Set STU_TUTION_FEES = isnull(FCD_AMOUNT,0) 
		From FeeClassDetails 
		Where FCD_CM_ID = @ClassID
		And FCD_FEE_CAT_ID = @FeesCatId 
		And STU_CM_ID = @CLassId
End

Select 'True'

End

GO
